n			<p>ราคารวมภาษี</p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; text-align:right; width:185px\">\n			<p>4,108.80</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'',NULL,NULL,4,'2021-03-15 02:49:43',NULL,NULL,''),(6,'FM-IT-64-0006','2021-01-18',4,'1536712608041','2,3','ขออนุมัติเบิกเงินซ่อมบำรุงรถยนต์ 8กว-118 รอบเช็คระยะ 50,000 ก.ม.','<p>เนื่องจากรถยนต์บริษัท TOYOTA VELLFIRE ทะเบียน 8กว-118 กท.ครบกำหนดเช็คระยะ 50,000 ก.ม. โดยนำรถเข้าไปตรวจเช็คระยะที่ศูนย์โตโยต้า พาราวินเซอร์ สาขาศรีนครินทร์ โดยมีค่าใช้จ่ายรวมทั้งสิ้น 4,548.57 บาท</p>\n\n<p>นายจิรานุวัฒน์ โปรยลาภ จึงทำเรื่องเบิกเงินทดรองจ่ายจำนวน 5,000.00 บาท เพื่อไปชำระรายการซ่อมบำรุงดังกล่าวและจะนำเงินส่วนที่เหลือมาเคลียร์กับฝ่ายการเงิน ภายหลังจากชำระเงินที่ศุนย์โตโยต้าแล้วเสร็จ</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณา หากเห็นชอบโปรดลงนามในเอกสารที่แนบ</p>\n',1526339054692,0,0,5,'',NULL,NULL,4,'2021-03-15 02:51:25',NULL,NULL,''),(7,'FM-CON-64-0001','2021-03-16',1566381654308,'1615781427251','1612751038474,1566381381121','โครงการไอโคเปน: แบบเสาเข็ม REV.3 ','<p>เนื่องด้วยทางฝ่ายแบบโครงการ ICOPENH (Sukhumvit 76) ได้มีการปรับแก้ไขผังเสาเข็ม จึงขอนำส่งแบบตำแหน่งเสาเข็ม (REV.3)</p>\n\n<p>จึงเรียนมาเพื่อให้ฝ่ายที่เกี่ยวข้องทราบ</p>\n',1566381654308,0,1612751038474,5,'ICO แบบเสาเข็มตามแบบ rev3.pdf',NULL,NULL,10,'2021-03-16 04:22:36',NULL,NULL,'\\public\\memo\\FMCON6416032021\\'),(8,'FM-CON-64-0002','2021-03-16',1566381654308,'1615781427251','1612751038474,1566381381121','โครงการไอโคเปน: แก้ไขแนวเข็มแปลง SC','<p>รายละเอียดตามเอกสารแนบ</p>\n',1566381654308,0,1612751038474,5,'ICO แก้ไขแนวเข็ม sc.pdf',NULL,NULL,10,'2021-03-16 04:32:04',NULL,NULL,'\\public\\memo\\FMCON6416032021\\'),(9,'FM-ARCH-64-0001','2021-03-18',1593074585627,'1612751038474','3','อนุมัติ ขอย้ายเงินสดย่อย','<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;เนื่องจากหน้างาน โครงการ IDEN Sukhumvit 101 ได้พิจารณาขอย้ายวงเงินสดย่อยจากคุณ ธนชัย โฉมงาม มาที่คุณ วิศวรุต เกกินะ เนื่องจากคุณ ธนชัย โฉมงาม ได้ลาออก ผลในวันที่ 15 มีนาคม 2564 นี้</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; โดยวงเงินดังกล่าว คิดเป็นเงินสดย่อย 5,000 บาท</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1593074585627,1612751038474,1536712608041,3,'',NULL,NULL,9,'2021-03-18 07:07:28',NULL,NULL,''),(10,'FM-ARCH-64-0002','2021-03-18',1593074585627,'8','1525820558822,1612751038474','IDEN 101 ออกหนังสือเรียกผู้รับเหมาเข้าหน้างาน','<p>เรียน ฝ่ายกฎหมาย</p>\n\n<p>เอกสารแนบ : สัญญา ใบสั่งจ้าง รูปภาพประกอบ</p>\n\n<p>เนื่องด้วย หน้างานโครงการ IDEN 101 ได้เชิญผู้รับเหมา Idecora ที่มีหน้าที่รับผิดชอบงานก่อสร้าง บ้านแปลง 16 เพื่อเข้าไปแก้ไขปัญหาปลวกขึ้นบ้าน และความเสียหายที่เกิดจากปลวกขึ้นบ้าน แต่ผู้รับเหมา Idecora ปฏิเสธที่จะเข้าไปปฏิบัติหน้าที่ ตามความรับผิดชอบตามสัญญา</p>\n\n<p>จึงต้องการให้ฝ่ายกฎหมายออกหนังสือเพื่อแจ้งให้&nbsp;ผู้รับเหมา Idecora เข้าปฏิบัติหน้าที่ เพื่อเก็บความเสียหายที่เกิดจากปลวก&nbsp;</p>\n\n<p>ตำแหน่งที่ตรวจพบ&nbsp;</p>\n\n<p>- ห้องเก็บงานระบบไฟ</p>\n\n<p>- ประตูห้องน้ำแม่บ้าน</p>\n',1593074585627,0,1612751038474,5,'สัญญาก่อสร้างบ้านแฝด IDEN101แปลง 15และ16.pdf,WO-CC-18000171(2).pdf,3362.jpg,3364.jpg,3363.jpg,3365.jpg',NULL,NULL,9,'2021-03-18 10:22:06',NULL,NULL,'\\public\\memo\\FMARCH6418032021\\'),(11,'FM-CON-64-0003','2021-03-18',1615781427251,'1531524013391','1612751038474','ICOPENH : ชี้แจงการรับผลิตภัณฑ์คอนกรีตสำเร็จรูป Block  L-B','<p>เนื่องด้วยฝ่ายก่อสร้าง โครงการ ICOPENH&nbsp;ได้มีการสั่งสินค้า ผลิตภัณฑ์คอนกรีตสำเร็จรูป Block L-B &nbsp;</p>\n\n<p>คาน-พื้นชั้น 1 &nbsp; จำนวน 1 Lot &nbsp;จำนวนเงิน 319,333.68 (รวมภาษีมูลค่าเพิ่ม) &nbsp;ตามใบกำกับภาษี เลขที่ TI6311/002 ลงวันที่ 25/11/2563 &nbsp;</p>\n\n<p>ฝ่ายก่อสร้าง รับมอบแผ่นคอนกรีตสำเร็จรูป วันที่ 22 ก.พ. 2564 &nbsp;เนื่องจากเอกสารใบกำกับการขนส่งสินค้า ไม่ได้ถูกส่งมาให้วิศวกร</p>\n\n<p>โครงการ โดยตรง เอกสารถูกรับและเก็บไว้ โดย ผรม.ภูดิศ &nbsp;และมีการตรวจรับสินค้า กับผรม.ภูดิศ ซึ่งเป็นผู้รับเหมาติดตั้งแผ่นพรีแคส</p>\n\n<p>ในวันที่ 22 ก.พ. 2564</p>\n\n<p>จึงเรียนมาเพื่อโปรดทราบ</p>\n\n<p>&nbsp;</p>\n',1615781427251,0,1612751038474,5,'',NULL,NULL,10,'2021-03-18 10:47:34',NULL,NULL,''),(12,'FM-ARCH-64-0003','2021-03-19',1566381654308,'10','8','IKP หนังสือเร่งรัดทีแมน ตามเอกสารแนบ','<p>เรียน ฝ่ายที่เกี่ยวข้อง<br>\n<br>\nขอนำส่งเมโมตามเอกสารแนบข้างต้น เป็นเมโมย้อนหลังครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอบคุณครับ</p>\n',1566381654308,0,1612751038474,5,'Memo_IDENKP-64-002 หนังสือเร่งรัดTMAN.pdf',NULL,NULL,9,'2021-03-19 05:01:23',NULL,NULL,'\\public\\memo\\FMARCH6419032021\\'),(13,'FM-ARCH-64-0004','2021-03-19',1566381654308,'8','10','IKP ขออนุมัติออกหนังสือแจ้งขอใช้พื้นที่หน้าบริษัท ไทยโทเรซินเทติคส์ จำกัด','<p>รายละเอียดตามเอกสารแนบ</p>\n',1566381654308,0,1612751038474,5,'IKP_MEMO_64-003.pdf',NULL,NULL,9,'2021-03-19 05:06:44',NULL,NULL,'\\public\\memo\\FMARCH6419032021\\'),(14,'FM-ARCH-64-0005','2021-03-19',1566381654308,'8','10','IKP ขอให้ออกหนังสือเตือนผู้รับเหมาที่พักอาศัยภายในโครงการไอเดน เกษตร-พหลโยธิน','<p>ตามเอกสารแนบ</p>\n',1566381654308,0,1612751038474,5,'',NULL,NULL,9,'2021-03-19 05:12:27',NULL,NULL,''),(15,'FM-ARCH-64-0006','2021-03-19',1566381654308,'1536712608041','10','IKP อนุมัติ ขอย้ายเงินสดย่อย','<p>เรียน ฝ่ายที่เกี่ยวข้อง<br>\n<br>\nขอนำส่งเมโมตามเอกสารแนบข้างต้น เป็นเมโมย้อนหลังครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอบคุณครับ</p>\n',1566381654308,1612751038474,1536712608041,3,'',NULL,NULL,9,'2021-03-19 05:22:39',NULL,NULL,''),(16,'FM-ARCH-64-0007','2021-03-19',1566381654308,'1615781427251','10','ICO แบบสถาปัตย์บ้าน SA SA SC SD SE SF SG SH SI LA LB LC LD LE LF','<p>เรียน คุณนันทพัทธ์</p>\n\n<p>&nbsp;</p>\n\n<p>ขอนำส่งไฟล์ CAD ของบ้าน&nbsp;SA SA SC SD SE SF SG SH SI LA LB LC LD LE LF&nbsp; โครงการ ICO&nbsp;<br>\n*หมายเหตุ ขอส่งผ่านอีเมล์นะครับ เนื่องจากในเมโมแนบไฟล์ CAD ไม่ได้<br>\n<br>\nขอบคุณครับ</p>\n',1566381654308,1615781427251,1612751038474,3,'',NULL,NULL,9,'2021-03-19 05:51:41',NULL,NULL,''),(17,'FM-CON-64-0004','2021-03-19',1615781427251,'1612751038474','1566381381121','ICOPENH : บ.ฐานวิศวกรรม ขอปรับลดสเป็คคอนกรีต','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>เนื่องด้วยทาง IRIS GROUP ได้กำหนดคุณสมบัติคอนกรีตที่ใช้ให้กับ ทาง บ.ฐานวิศวกรรม จำกัด คือ 280 ksc (Cy)ซึ่งทาง&nbsp;บ.ฐานวิศวกรรม ได้แจ้งปัญหาที่พบดังนี้</p>\n\n<p>1. คอนกรีตกำลังอัดสูง มีการเซ็ตตัวที่รวดเร็ว</p>\n\n<p>2. ระยะเวลาขนส่ง ประมาณ 40 นาที อาจทำให้คอนกรีตหนืด และเริ่มเซ็ตตัว</p>\n\n<p>3. หากเพิ่มน้ำยาหน่วงคอนกรีต จะมีค่าใช้จ่ายเพิ่ม 100 บ./ตร.ม.</p>\n\n<p>4. เมื่อเทคอนกรีตแล้ว ต้องพรมน้ำที่ผิวหน้าคอนกรีต อาจเกิดการเยิ้ม</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;โดยทาง&nbsp;บ.ฐานวิศวกรรมได้ขอความอนุเคราะห์ ลดคุณสมบัติลงจากกำลังแรงอัดคอนกรีต 280 ksc (Cy) เป็น 240&nbsp; ksc (Cy) ในงานเทพื้น Topping</p>\n\n<p>&nbsp; &nbsp; &nbsp;ซึ่งความเห็นของวิศวกรควบคุมงาน เห็นด้วยในการอนุมัติใช้เฉพาะในงานเทพื้น Topping เท่านั้น ซึ่งตรงกับที่ทาง&nbsp;บ.ฐานวิศวกรรมได้ขอความอนุเคราะห์ มาครับ</p>\n',1615781427251,0,1612751038474,5,'บ.ฐาน ขอปรับลดสเป็คคอนกรีต.pdf',NULL,NULL,10,'2021-03-19 07:39:58',NULL,NULL,'\\public\\memo\\FMCON6419032021\\'),(18,'FM-ARCH-64-0008','2021-03-19',1566381654308,'8','10','IKP ขอให้ออกหนังสือติดตาม บริษัท ไอเดคคอร่า จำกัด เพื่อเข้ามาแก้ไขงานรั้วที่เสียหาย  สำหรับโครงการไอเดน เกษตร-พหลโยธิน  ','<p>ตามที่บริษัท ไอเดคคอร่า จำกัด (ผู้รับจ้าง) ได้เซ็นต์สัญญากับบริษัท ไอริส กรุ๊ป จำกัด (ผู้ว่าจ้าง) เพื่อทำการรื้อถอนรั้วเก่าและก่อสร้างรั้วใหม่ โครงการไอเดน เกษตร-พหลโยธิน&nbsp; โดยมีการส่งผลงานเมื่อวันที่ 11 มีนาคม 2563 และมีการรับประกันผลงาน 1 ปี &nbsp;นั้น</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ในการนี้ ฝ่ายก่อสร้างโดยนาย ธนพนธ์ อุตมานิติเจริญ ขอเรียนให้ทราบว่า เมื่อวันที่ 8 มีนาคม 2564 งานรั้วระแนงโครงสร้างเหล็กที่ผู้รับจ้างได้ก่อสร้างโดยได้ติดตั้งบนกำแพงก่ออิฐ นั้น ได้เกิดการพังทลายและถล่มลงไปในพื้นบริเวณข้างเคียง อันมีสาเหตุมาจากการก่อสร้างที่ไม่ถูกต้องตามหลักวิศวกรรม กล่าวคือตรงจุดรองรับระหว่างแผ่นเพลทกับคานคอนกรีต &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(ทับหลัง)กำแพงนั้น มีสภาพไม่สมบูรณ์โดยปรากฏแผ่นเพลทขึ้นสนิม พุกไม่ได้ฝังในเนื้อคอนกรีต และมีสนิมหนา ส่งผลให้การรับกำลังบริเวณจุดรองรับดังกล่าวบกพร่อง เป็นเหตุให้เกิดการพังทลายของกำแพง ซึ่งทางสถาปนิกโครงการได้มีการประสานงานให้ผู้รับจ้างเข้ามาดำเนินการแก้ไขแล้ว แต่ได้รับการปฎิเสธ</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อให้ฝ่ายกฎหมายออกหนังสือติดตามผู้รับจ้างให้เข้ามาแก้ไขเป็นการเร่งด่วน</p>\n',1566381654308,0,1612751038474,5,'90-62 สัญญาว่าจ้างรื้อถอนรั้วเก่าและก่อสร้า.pdf,IKP_รั้วโครงการที่เสียหาย.pdf,IKP_การติดตามงานกับคุณเต้ย.pdf',NULL,NULL,9,'2021-03-19 12:35:30',NULL,NULL,'\\public\\memo\\FMARCH6419032021\\'),(19,'FM-CON-64-0005','2021-03-18',1615426891970,'1612751038474','','ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน','',1615426891970,1612751038474,1612751038474,6,'Memo_CON_IBY-64-03_อนุมัติเงินสำรองจ่าย.pdf',NULL,NULL,10,'2021-03-22 02:24:15',NULL,NULL,'\\public\\memo\\FMCON6418032021\\'),(20,'FM-CON-64-0006','2021-03-18',1615426891970,'1612751038474','','ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน','',1615426891970,1612751038474,1612751038474,6,'Memo_CON_IBY-64-03_อนุมัติเงินสำรองจ่าย.pdf',NULL,NULL,10,'2021-03-22 02:26:39',NULL,NULL,'\\public\\memo\\FMCON6418032021\\'),(21,'FM-CON-64-0007','2021-03-18',1615426891970,'1612751038474','','ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน','<p>ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน</p>\n',1615426891970,1612751038474,1612751038474,5,'Memo_CON_IBY-64-03_อนุมัติเงินสำรองจ่าย.pdf',NULL,NULL,10,'2021-03-22 02:29:39',NULL,NULL,'\\public\\memo\\FMCON6418032021\\'),(22,'FM-CON-64-0008','2021-03-18',1615426891970,'1612751038474','','ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน','<p>ขออนุมัติเงินสำรองจ่ายเพื่อใช้ในการก่อสร้างซ่อมแซมในกรณีฉุกเฉิน</p>\n',1615426891970,1612751038474,1612751038474,0,'Memo_CON_IBY-64-03_อนุมัติเงินสำรองจ่าย.pdf',NULL,NULL,10,'2021-03-22 04:19:05',NULL,NULL,'\\public\\memo\\FMCON6418032021\\'),(23,'FM-ARCH-64-0009','2021-03-22',1566381654308,'8','10','IKP ขอให้ออกหนังสือยกเลิกสัญญา และดำเนินการทางกฎหมายขั้นเด็ดขาดกับบริษัท ที-แมน คอร์ปอเรชั่น จำกัด เนื่องจากขาดแคลนแรงงานในการทำงาน ผลงานไม่มีคุณภาพ และไม่ทำงานให้แล้วเสร็จภายในระยะเวลาที่กำหนด ','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ตามที่บริษัท ไอริส กรุ๊ป จำกัด ได้มีการทำสัญญาว่าจ้าง บริษัท ที-แมน คอร์ปอเรชั่น จำกัด (บริษัทคู่สัญญา) เพื่อทำงานก่อสร้างบ้านแฝดและบ้านแถวโครงการไอเดน เกษตร-พหลโยธิน ให้กับโครงการไอเดน เกษตร-พหลโยธิน โดยผู้ควบคุมงาน และได้เห็นถึงความไม่เรียบร้อยในการเก็บงานบ้านแปลง 37 และแปลง 38 จึงได้ออกหนังสือเตือนทางบริษัท ที-แมน คอร์ปอเรชั่น จำกัด&nbsp; เข้ามาเก็บงานและเร่งการเก็บงานในระยะเวลาที่กำหนด จำนวน 2 ครั้ง และเมื่อวันที่ 3 มีนาคม 2564 ทางคุณสุนี เชื้อประกอบกิจ ,คุณมณฑา ทองส่งโสม ,คุณนวลพรรณ สงวนศรี ได้นัดคุยกับบริษัท ที-แมน คอร์ปอเรชั่น จำกัด เรื่องการเข้ามาเก็บหน้างานแปลง 37 และ แปลง 38 โดยทางทีแมนสัญญาด้วยวาจาว่า “จะเข้าเก็บบ้านแปลง 37 และแปลง 38 ให้เสร็จภายในระยะเวลา 5 วัน โดยเริ่มตั้งแต่ วันที่ 8 มีนาคม 2564 ถึง 12 มีนาคม 2564” หลังจากผู้ควบคุมงานและฝ่ายที่เกี่ยวข้องได้เข้าตรวจงานแล้ว ได้มีมติสรุปว่า ทางบริษัท ที-แมน คอร์ปอเรชั่น จำกัดเข้าเก็บงานยังไม่เสร็จสมบูรณ์ตามคำกล่าวในข้างต้น</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;ในการนี้ฝ่ายก่อสร้างโดย นายธนพนธ์&nbsp; อุตมานิติเจริญ&nbsp; สถาปนิกโครงการ ขอเรียนให้ฝ่ายกฎหมายทราบว่าบริษัทคู่สัญญา &nbsp;&nbsp;ไม่สามารถดำเนินการแก้ไขงานให้แล้วเสร็จภายในระยะเวลาที่กำหนดได้ เนื่องด้วยขาดแคลนแรงงานในการทำงาน ขาดผู้ควบคุมงาน ขาดศักยภาพในการเก็บบ้านแปลงอื่นๆ นอกจากนี้ผลงานที่ผ่านมายังคงขาดซึ่งคุณภาพงานที่ดีและไม่สามารถพัฒนาคุณภาพงานให้ดีขึ้นได้</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงขอให้ฝ่ายกฎหมายออกหนังสือยกเลิกสัญญา และดำเนินการทางกฎหมายขั้นเด็ดขาดกับบริษัท ที-แมน คอร์ปอเรชั่น จำกัด เป็นลำดับถัดไป</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อทราบและโปรดดำเนินการอย่างเร่งด่วน<br>\n<br>\n*หมายเหตุ ไฟล์ที่แนบจะมีอยู่ 3 ไฟล์ 1.ไฟล์ภาพรวมปัจจุบันของแปลง 37 - 38 ตั้งแต่วันที่ 4 - วันที่ 22 มีนาคม 2564&nbsp;<br>\n2. ไฟล์ตรวจงานที่ไม่เรียบร้อยของ 37 3.ไฟล์ตรวจงานที่ไม่เรียบร้อยของ 38 (ไฟล์ตรวจหน้างานขออนุญาตส่งไปทางเมลล์นะครับ)</p>\n',1566381654308,0,1612751038474,5,'ภาพรวม v.2.pdf',NULL,NULL,9,'2021-03-22 07:00:33',NULL,NULL,'\\public\\memo\\FMARCH6422032021\\'),(24,'FM-CON-64-0009','2021-03-22',1615781427251,'1612751038474','1566381381121','ICOPENH : แจ้ง บ.ฐานวิศวกรรม ขอยืมอุปกรณ์ค้ำแผ่นพรีแคส','<p>เรียน ผู้อำนวยการ / ผู้จัดการ</p>\n\n<p>เนื่องด้วย บ.ฐานวิศวกรรม ได้ทำงานติดตั้งแผ่นพรีแคสคอนกรีต โดยทางโครงการได้มีการเร่งแผนติดตั้ง ทำให้อุปกรณ์ค้ำยันแผ่นไม่เพียงพอ</p>\n\n<p>ทางโครงการ&nbsp;ICOPENH จึงขอเป็นตัวแทนในการขอยืมอุปกรณ์ค้ำยันแผ่นพรีแคสคอนกรีต ให้กับ บ.ฐานวิศวกรรม&nbsp; จำนวน 40 ชุดโดยทางโครงการจะขอยืมประมาณ 2 เดือน และจะคืนในสภาพที่ได้รับมา ไม่มีการตัด หรือเชื่อม ใดๆให้วัสดุเสียหาย</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1612751038474,5,'Memo ยืมpop ฐานออกเอกสาร.pdf',NULL,NULL,10,'2021-03-22 09:59:25',NULL,NULL,'\\public\\memo\\FMCON6422032021\\'),(25,'FM-CON-64-0010','2021-03-22',1615781427251,'1612751038474','1566381381121','ICOPENH : ขอให้ทาง บ.ไบร์ท แก้ไขคุณภาพงาน','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยทางโครงการ ICOPENH ได้พบกับปัญหาของคุณภาพแผ่น ในเรื่องของร่องกรู๊ฟบริเวณด้านหน้าบ้าน LB18, LB19, LB20 มีความคลาดเคลื่อนกับแผ่นที่มาประกอบ ที่ระยะ 6-10 มม.</p>\n\n<p>ทางโครงการจึงมีความต้องการให้ทาง บ.ไบร์ท ส่งทีมงานมาแก้ไขงานให้ได้ตามมาตรฐาน</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1612751038474,6,'ระยะ.jpg,LB18.jpg,LB19.jpg,LB20.jpg,Plan layout.jpg',NULL,NULL,10,'2021-03-22 11:03:19',NULL,NULL,'\\public\\memo\\FMCON6422032021\\'),(26,'FM-IT-64-0007','2021-01-19',4,'1536712608041','2,3','ขออนุมัติเติมเงินบัตรผ่านทางพิเศษอัตโนมัติ (easypass)','<p>เนื่องด้วยทางบริษัท ไอริส กรุ๊ป จำกัด&nbsp; มีนโยบายให้พนักงานใช้รถยนต์บริษัทฯ ในการติดต่องานภายนอก โดยทางฝ่ายเทคโนโลยีสารสนเทศ จะอำนวยความสะดวกโดยการเติมเงินค่าบัตร EASY PASS ประจำทุกเดือน&nbsp; จึงขออนุมัติเติมบัตรผ่านทางพิเศษอัตโนมัติ ดังนี้</p>\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse; width:643px\">\n	<tbody>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:47px\">\n			<p><strong>ลำดับ</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:123px\">\n			<p><strong>ทะเบียน</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:113px\">\n			<p><strong>ยี่ห้อรถ</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:113px\">\n			<p><strong>หน่วยงาน</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:85px\">\n			<p><strong>ยอดคงเหลือ</strong></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; height:25px; vertical-align:top; width:161px\">\n			<p><strong>จำนวนเงินที่จะเติม</strong><strong> (</strong><strong>บาท)</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:47px\">\n			<p>1</p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; 