l-align:middle\">\n			<p><strong>8</strong><strong>,000.00</strong></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><strong>หมายเหตุ</strong>&nbsp; ยอดคงเหลือของบัตรทางด่วน ณ วันที่&nbsp; 23/03/2564 จาก https://www.thaieasypass.com</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'report_easypass.pdf',NULL,NULL,4,'2021-03-23 07:29:23',NULL,NULL,'\\public\\memo\\FMIT6423032021\\'),(37,'FM-CON-64-0011','2021-03-23',1615426891970,'1612751038474','','ขออนุมัติเงินสำรอง','<p>ขออนุมัติเงินสำรอง</p>\n',1615426891970,1612751038474,1612751038474,0,'Memo_CON_IBY-64-03_อนุมัติเงินสำรองจ่าย.pdf',NULL,NULL,10,'2021-03-23 08:35:25',NULL,NULL,'\\public\\memo\\FMCON6423032021\\'),(38,'FM-CON-64-0012','2021-03-23',1615781427251,'1612751038474','1566381381121','ICOPENH : ขอความร่วมมือทาง บ.ไบร์ท เรื่องคุณภาพแผ่นพรีแคส','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยโครงการ ICOPENH ได้ใช้แผ่นพรีแคสคอนกรีตกับทาง บ.ไบร์ท ในงานแผ่นพื้น และผนังโครงสร้าง โดยมีกำหนดที่จะใช้กับบ้านทุกหลังในโครงการ รวม 192 หลัง</p>\n\n<p>ล่าสุดจากการตรวจคุณภาพงาน ได้พบกับปัญหาของคุณภาพแผ่น ในเรื่องของร่องกรู๊ฟบริเวณด้านหน้าบ้าน LB18, LB19, LB20 มีความคลาดเคลื่อนกับแผ่นที่มาประกอบ ที่ระยะ 8-12&nbsp;มม. ทางโครงการจึงมีความกังวลในเรื่องของความสวยงาม ที่มาตรฐานต่างจากหลังข้างเคียง และอาจส่งผลต่อการตรวจรับโอนบ้านจากกลุ่มลูกค้า</p>\n\n<p>ทางโครงการ&nbsp;ICOPENH จึงขอความร่วมมือกับทาง&nbsp;บ.ไบร์ท ในการป้องกันและแก้ไขปัญหาที่พบคือ</p>\n\n<p>1. ขอแรงงานช่าง มาแก้ไขแผ่นที่หน้างานให้แล้วเสร็จภายใน&nbsp;7/4/64</p>\n\n<p>2.&nbsp;ความคลาดเคลื่อนของร่องกรู๊ฟระหว่างแผ่นที่มาประกอบ ไม่เกิน 6&nbsp;มม. หรือร่องไม่เกยซ้อนกัน</p>\n\n<p>&nbsp;</p>\n\n<p>ในกรณีที่ทางโครงการพบปัญหาดังกล่าวอีก ทางโครงการจะขอความร่วมมือกับทาง&nbsp;บ. มาแก้ไขเป็นกรณี ต่อๆไปครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1612751038474,5,'LB18.jpg,LB19.jpg,LB20.jpg,ระยะ.jpg,Plan layout.jpg',NULL,NULL,10,'2021-03-23 10:08:35',NULL,NULL,'\\public\\memo\\FMCON6423032021\\'),(39,'FM-CON-64-0013','2021-03-23',1615781427251,'1612751038474','1525820558822,1566381381121','ICOPENH : ชี้แจงความสูงสายสื่อสารหน้าโครงการ ที่ส่งผลต่อการขนส่งแผ่น','<p>เรียน ผู้อำนวยการฝ่ายก่อสร้าง / เจ้าหน้าที่กฏหมาย</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยงานก่อสร้างในโครงการ ICOPENH เป็นงานระบบติดตั้งแผ่นพรีแคสคอนกรีต ซึ่งทาง บ.ไบร์ทเป็นผู้รับผิดชอบในการผลิต และจัดจ้างรถขนส่งแผ่นพรีแคส มายังโครงการ</p>\n\n<p>ล่าสุดทาง บ.ไบร์ท แจ้งปัญหาคือสายไฟสื่อสารหน้าโครงการ มีระยะที่ต่ำเกินไป ทำให้รถขนส่งไม่สามารถเข้าโครงการได้ตามปกติ และอาจส่งผลให้มีปัญหาการจราจรหน้าโครงการ&nbsp; ทางโครงการจึงขอส่งเรื่องให้ฝ่ายประสานงานพิจารณาในเรื่องการติดต่อไปยังหน่วยงานต่างๆ เพื่อเข้ามาแก้ไขครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1612751038474,5,'ไบร์ท ชี้แจงปัญหาขนส่ง.jpg,ไบร์ท ชี้แจงปัญหาขนส่ง 2.jpg,ไบร์ท ชี้แจงปัญหาขนส่ง 3.jpg',NULL,NULL,10,'2021-03-23 10:58:30',NULL,NULL,'\\public\\memo\\FMCON6423032021\\'),(40,'FM-ARCH-64-0010','2021-03-26',1566381654308,'8','3,10,1531524013391','แจ้งเหตุรั้วโครงการ IDEN เกษตร พหลโยธิน ล้มและเกิดความเสียหาย เนื่องจากพายุฝน เมื่อวันที่ 22 มีนาคม 2564','<p>&nbsp;</p>\n\n<p>&nbsp;เนื่องจากในวันที่ 22 มีนาคม 2564 ได้เกิดลมแรง และมีฝนตกหนัก ส่งผลให้รั้วโครงการล้ม และมีความเสียหายเกิดขึ้น รวม พื้นที่ 90&nbsp; ตารางเมตร&nbsp; ด้วยเหตุนี้ฝ่ายก่อสร้างจึงนำส่งรูปภาพแสดงความเสียหายอันเนื่องจากเหตุดังกล่าว&nbsp; และให้ฝ่ายกฎหมายดำเนินการขั้นต่อไปอย่างเร่งด่วน<br>\n&nbsp;จึงเรียนมาเพื่อโปรดดำเนินการขั้นต่อไปอย่างเร่งด่วน</p>\n',1566381654308,0,1612751038474,5,'รูปรั้วที่ล้ม.pdf,ผังรั้วโครงการ-1.jpg,แบบสถาปัตยกรรมรั้วโครงการ 621129.pdf',NULL,NULL,9,'2021-03-26 11:09:01',NULL,NULL,'\\public\\memo\\FMARCH6426032021\\'),(41,'FM-IT-64-0018','2021-03-29',4,'1536712608041','2,3','ขออนุมัติชำระเงินค่าต่อภาษีรถยนต์ประจำปี TOYATA VELLFIRE 8กว-118 ','<p>เนื่องด้วยรถยนต์ โตโยต้า เลขทะเบียน 8กว-118 กรุงเทพมหานคร จะครบกำหนดชำระค่าภาษีรถยนต์ในวันที่ 21 มิถุนายน 2021&nbsp;ทางฝ่ายเทคโนโลยีสารสนเทศจึงขอเบิกเงินเพื่อชำระค่าภาษีดังกล่าว ผ่าน บริษัท โตโยต้า ลีสซิ่ง ประเทศไทย จำกัด โดยมีรายละเอียดค่าใช้จ่ายดังนี้</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"width:80%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center; vertical-align:middle\">\n			<p>รายการ</p>\n			</td>\n			<td style=\"text-align:center; vertical-align:middle\">\n			<p>จำนวนเงิน (บาท)</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>ค่าภาษีรถยนต์</p>\n			</td>\n			<td style=\"text-align:right; vertical-align:middle\">\n			<p>9,752.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>ค่าบริการ</p>\n			</td>\n			<td style=\"text-align:right; vertical-align:middle\">\n			<p>400.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>รวมยอดเงินที่ชำระ</p>\n			</td>\n			<td style=\"text-align:right; vertical-align:middle\">\n			<p>10,152.00</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>*หมายเหตุ ได้ส่งส่วนท้ายพรบ.รถยนต์สำหรับใช้ต่อภาษีรถยนต์ ให้ทางบจก.โตโยต้า ลีสซิ่ง (ประเทศไทย) แล้ว</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'ใบแจ้งครบกำหนดชำระภาษีรถยนต์ประจำปี.pdf',NULL,NULL,4,'2021-03-29 04:14:23',NULL,NULL,'\\public\\memo\\FMIT6429032021\\'),(42,'FM-ARCH-64-0011','2021-03-29',1566381654308,'8','10','IKP ขอให้ออกหนังสือและดำเนินการยื่นคำร้องที่สำนักงานการประปาบางเขนเรื่องตัวอุดท่อประปาหลุดออกและให้ทางการประปาเข้ามาดำเินการแก้ไข เพื่อจะได้ทำการติดตั้งมิเตอร์ประปาต่อไปได้','<p>เนื่องจากช่างประปาเข้ามาติดมิเตอร์น้ำภายในโครงการไอเดน เกษตร-พหลโยธิน บ้านเลขที่ 9/34&nbsp;- 9/40&nbsp;และคลับเฮ้าส์ เมื่อวันที่ 8/3/64 ที่ผ่านมา แต่ไม่สามารถดำเนินงานติดตั้งต่อได้เนื่องจากทางประปาแจ้งว่ามีท่อประปาบางส่วนได้หายไป และมีอุปกรณ์อุดปากท่อได้หลุดออกไป</p>\n\n<p>&nbsp;</p>\n\n<p>ทั้งนี้ทางหน้างานโครงการไอเดน เกษตร-พหลโยธินได้ประสานงานกับเจ้าหน้าที่ประปา (ช่างเก็ท) เมื่อวันที่ 29/3/64 ซึ่งทางเจ้าหน้าที่ได้มีการชี้แจ้งดังนี้ ให้ทางไอริสเข้าไปที่สำนักงานการประปาบางเขนในส่วนของ สบน. (ส่วนบริการประชาชน) และแจ้งที่เคาน์เตอร์ เรื่อง อุปกรณ์อุดปากท่อประปาหลุดออก พร้อมแนบเอกสารดังนี้<br>\n<br>\n1.ใบมอบอำนาจในการวางท่อของบริษัท ไอริส กรุ๊ป จำกัด ในโครงการไอเดน เกษตร - พหลโยธิน<br>\n2.ใบเสร็จที่จ่ายค่ามิเตอร์ประปา ใบขอติดตั้งมิเตอร์<br>\n3.รูปถ่ายหน้างาน (แสดงตำแหน่งที่จะอุดปากท่อ)<br>\n4.แปลนแนวท่อประปาเฟส 1 (แบบของประปา+ตำแหน่งที่จะอุดปากท่อ)<br>\n<br>\nจงเรียนให้ทราบเพื่อดำเนินการอย่างเร่งด่วน</p>\n',1566381654308,0,1612751038474,5,'งานวางท่อประปา.pdf,ตำแหน่งวางอุดปากท่อ.pdf,รูปปิดท่อ.pdf,ตัวอุดท่อประปา.jpg',NULL,NULL,9,'2021-03-29 07:00:47',NULL,NULL,'\\public\\memo\\FMARCH6429032021\\'),(43,'FM-IT-64-0019','2021-03-29',4,'1536712608041','2,3','ขออนุมัติสั่งซื้อฮาร์ดดิสก์สำหรับจัดเก็บข้อมูล (ไดรฟ์กลาง)','<p>เนื่องด้วยฮาร์ดดิสก์ 2 ใน 5&nbsp;ตัว ที่ใช้จัดเก็บข้อมูลและไฟล์ต่างๆของบริษัท มีการเสื่อมสภาพตามอายุการใช้งานและเนื่องจากเกิดไฟกระชากเมื่อเย็นวันศุกร์ที่ผ่านมาส่งผลให้ฮาร์ดดิสก์ 2 ทั้งลูกเกิดการชำรุดไม่สามารถใช้งานได้ ส่งผลกระทบในส่วนของฝ่ายการตลาด,ฝ่ายทรัพยากรบุคคล,ฝ่ายพัฒนาธุรกิจ และ ในหมวดของการจัดเก็บไฟล์ส่วนกลางบางส่วนไม่สามารถเข้าใช้งานได้</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"border-collapse:collapse\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center; vertical-align:middle; width:321px\">\n			<p><strong>รายละเอียด</strong></p>\n			</td>\n			<td style=\"text-align:center; vertical-align:middle; width:132px\">\n			<p><strong>จำนวน</strong></p>\n			</td>\n			<td style=\"text-align:center; vertical-align:middle; width:161px\">\n			<p><strong>ราคา</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#f2f2f2; text-align:left; vertical-align:middle; width:321px\">\n			<p>H<strong>DD SEAGATE IRONWOLF (SATA3 </strong><strong>64</strong><strong>MB 5900RPM)</strong></p>\n			</td>\n			<td style=\"background-color:#f2f2f2; text-align:center; vertical-align:middle; width:132px\">\n			<p>2 ตัว</p>\n			</td>\n			<td style=\"background-color:#f2f2f2; text-align:right; vertical-align:middle; width:161px\">\n			<p>5,640.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" rowspan=\"1\" style=\"text-align:right; vertical-align:middle; width:321px\">\n			<p><strong>ภาษีมูลค่าเพิ่ม 7%</strong></p>\n			</td>\n			<td style=\"text-align:right; vertical-align:middle; width:161px\">394.80</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" rowspan=\"1\" style=\"text-align:right; vertical-align:middle; width:321px\">\n			<p><strong>รวมทั้งสิ้น</strong></p>\n			</td>\n			<td style=\"text-align:right; vertical-align:middle; width:161px\">\n			<p>6,034.80</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>ทางฝ่ายเทคโนโลยีสารสนเทศจึงขอเสนอให้ซื้อฮาร์ดดิสก์ใหม่เพื่อทดแทนในส่วนที่เกิดความเสียหาย</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'ใบเสนอราคา HDD -APS Group.pdf',NULL,NULL,4,'2021-03-29 10:05:00',NULL,NULL,'\\public\\memo\\FMIT6429032021\\'),(44,'FM-ARCH-64-0012','2021-03-30',1593074585627,'8','1612751038474','IDEN 101 ออกหนังสือเรียกผู้รับเหมา IDA เข้าหน้างาน ','<p>เนื่องด้วย หน้างานโครงการ IDEN 101 ได้เชิญผู้รับเหมา IDA ที่มีหน้าที่รับผิดชอบงานก่อสร้าง บ้านแปลง 37-38 ,39-40 เข้ามาทำงานในวันที่ 29 มี.ค. พ.ศ.2564 แต่ทาง&nbsp;เชิญผู้รับเหมา IDA ไม่ได้เข้ามาปฎิบัติหน้าที่ ตามที่รับปากไว้</p>\n\n<p>จึงต้องการให้ฝ่ายกฎหมายออกหนังสือเพื่อแจ้งให้&nbsp;ผู้รับเหมา IDA เข้าปฏิบัติหน้าที่ ตามความรับผิดชอบ ภายใน 3-7 วัน</p>\n',1593074585627,1593074585627,1612751038474,1,'',NULL,NULL,9,'2021-03-30 03:09:39',NULL,NULL,''),(45,'FM-ARCH-64-0013','2021-03-30',1566381654308,'8','1612751038474,10','IKP: ขอให้ออกหนังสือหักเงินค้ำประกันผลงาน บริษัท ทีแมนคอร์ปอเรชั่น จำกัด จากแปลง 37 และ 38 เพื่อนำมาแก้ไขงานพื้นไม้เอ็นจิเนียริ่ง','<p>มื่อวันที่ 29/01/64 ที่ผ่านมาทางหน้างานโครงการไอเดน เกษตร-พหลโยธิน ได้ทำเอกสาร memorandum เลขที่&nbsp;IDENKP-64-501 และ&nbsp;IDENKP 64-502&nbsp;&nbsp;แจ้งหักเงินผู้รับจ้างหน้างานบริษัท ทีแมนคอร์ปอเรชั่น จำกัด (บริษัท ทีแมนฯ) และ ห้างหุ้นส่วนจำกัด เอ.พีอลูมิเนียมกลาส&nbsp;&nbsp;เรื่องงานแก้ไขไม้เอ็นจิเนียริ่งขึ้นราบ้านตัวอย่างแปลง 37 งานแก้ไขไม้เอ็นจิเนียริ่งขึ้นราบ้านตัวอย่างแปลง 38 ที่เกิดจากสาเหตุน้ำรั่วบริเวณกระจกอลูมิเนียม ประตูอลูมิเนียม และหลังคา</p>\n\n<p>&nbsp;</p>\n\n<p>ทั้งนี้ทางผู้รับจ้างที่เกี่ยวข้องตามข้างต้นได้รับทราบข้อมูลตามเอกสารดังกล่าว และมีการเซ็นยินยอมรับผิดชอบความเสียหายที่เกิดขึ้น ยกเว้น บริษัท ทีแมนฯ ทางหน้างานโครงการไอเดน เกษตร-พหลโยธินได้มีการติดตามเรื่องการเซ็นเอกสารตั้งแต่วันที่ 29/01/64 จนถึงวันที่ 29/03/64 แต่ยังไม่มีการตอบรับใดๆจากผู้รับจ้างบริษัท ทีแมนฯ</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อให้ฝ่ายกฎหมายออกหนังสือชี้แสดงเจตจำนงในการหักเงินประกันผลงาน (จากยอดเงินประกันผลงานสะสมของในแต่ละงวดงาน) เพื่อนำมาเป็นค่าใช้จ่ายสำหรับการซ่อมแซมพื้นเสียหายซึ่งอยู่ในความรับผิดชอบของ บริษัท ทีแมนฯ</p>\n\n<p>&nbsp;</p>\n\n<p>โปรดดำเนินการอย่างเร่งด่วน</p>\n\n<p>&nbsp;</p>\n',1566381654308,0,1612751038474,5,'Memo_IDENKP-64-501 งานแก้ไขไม้เอ็นจิเนียบ้านตัวอย่างแปลง 37.pdf,Memo_IDENKP-64-502 งานแก้ไขไม้เอ็นจิเนียบ้านตัวอย่างแปลง 38.pdf,แชทติดตามงาน.pdf',NULL,NULL,9,'2021-03-30 08:40:10',NULL,NULL,'\\public\\memo\\FMARCH6430032021\\'),(46,'FM-CON-64-0014','2021-03-30',1566381381121,'1536712608041','8','ขอเบิกค่าเดินทาง','<p>ข้าพเจ้า นายพจกาญจน์ ศรีไพสุรินทร์ ตำแหน่ง วิศวกรไฟฟ้า แผนก ก่อสร้าง</p>\n\n<p>ขอเบิกค่าใช้จ่ายการเดินทางไปปฎิบัติงานโดยมีรายละเอียดดังนี้</p>\n\n<p>ค่าพาหนะ การเดินทางจากโครงการ ไอโคเป่น สุขุมวิท 76 ไป และ กลับ โครงการ ไอเดน สุขุมวิท 101 รวมระยะทั้งหมด 20 กิโลเมตร รวมเป็นเงินทั้งสิ้น 80 บาท</p>\n\n<p>ข้าพเจ้าขอรับรองว่ารายการที่กล่าวมาข้างต้นเป็นจริง และส่งเอกสารแนบด้วย 1 ฉบับ</p>\n',1566381381121,1615781427251,1536712608041,3,'งานไฟฟ้า 101,ๅจๅ','2021-04-09 08:26:11',NULL,10,'2021-03-30 11:00:17','2021-04-09 08:07:10',NULL,'\\public\\memo\\FMCON6430032021\\'),(47,'FM-CON-64-0015','2021-03-30',1566381381121,'1536712608041','1527376046432','เบิกค่าเดินทาง','<p>ข้าพเจ้า นายพจกาญจน์ ศรีไพสุรินทร์ ตำแหน่ง วิศวกรไฟฟ้า แผนก ก่อสร้าง</p>\n\n<p>ขอเบิกค่าใช้จ่ายการเดินทางไปปฎิบัติงานโดยมีรายละเอียดดังนี้</p>\n\n<p>ค่าพาหนะ การเดินทางจากบริษัทไอริส กรุ๊ป&nbsp;ไป และ กลับ โครงการ เวนิส ดิ ไอริส วัชรพล&nbsp;รวมระยะทั้งหมด 34&nbsp;กิโลเมตร รวมเป็นเงินทั้งสิ้น 136&nbsp;บาท</p>\n\n<p>ข้าพเจ้าขอรับรองว่ารายการที่กล่าวมาข้างต้นเป็นจริง และส่งเอกสารแนบด้วย 1 ฉบับ</p>\n',1566381381121,1615781427251,1536712608041,3,'รายละเอียดสเปคหม้อแปลงที่ผู้ขายเสนอราคา,เวนิส','2021-04-09 08:08:43',NULL,10,'2021-03-30 11:03:21','2021-04-09 08:06:42',NULL,'\\public\\memo\\FMCON6430032021\\'),(48,'FM-MKT-64-0001','2021-04-01',7,'1536712608041','5,3,2','ขออนุมัติ งบประมาณในการซื้อโฆษณาออนไลน์ แคมเปญ สาดไม่ยั้ง ประจำเดือนเมษายน 2564 สำหรับ 5 โครงการ ไอริส พาร์ค / ไอริส เวสท์เกต / ไอโคเปน / ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน','<p>&nbsp;</p>\n\n<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการจัดแคมเปญ&nbsp;สาดไม่ยั้ง ประจำเดือนเมษายน 2564 สำหรับ 5 โครงการ ไอริส พาร์ค / ไอริส เวสท์เกต / ไอโคเปน / ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน โดยเริ่มตั้งแต่วันที่ 1 - 30 เมษายน 2564 มีรายละเอียด ดังนี้</p>\n\n<ul>\n	<li>ค่าโฆษณาผ่านทาง Facebook สำหรับ 3 โครงการ ได้แก่</li>\n</ul>\n\n<ol>\n	<li>ไอริส พาร์ค จำนวน 50,000 บาท</li>\n	<li>ไอโคเปน จำนวน 50,000 บาท</li>\n	<li>ไอริส เวสท์เกต จำนวน 30,000 บาท</li>\n</ol>\n\n<ul>\n	<li>ค่าโฆษณาผ่านทาง Google สำหรับ 5 โครงการ โครงการละ 6,000 บาท รวมเป็นเงิน 30,000 บาท</li>\n</ul>\n\n<p>รวมงบประมาณที่ขออนุมัติเป็นเงินทั้งสิ้น 160,000 บาท</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมติ</p>\n\n<p>&nbsp;</p>\n',1616118836457,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-04-01 09:25:23',NULL,NULL,''),(49,'FM-CON-64-0016','2021-04-01',1615781427251,'1612751038474','1566381381121','ICOPENH : ชี้แจงการทำไทน์บีม และใบเสนอราคา','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยปัญหาเข็มเยื้องศูนย์ ของงานตอกเสาเข็มโซน SC ที่เกิดจากการขยับผังจัดสรรค์</p>\n\n<p>ทางผู้เชียวชาญงานเสาเข็มจึงกำหนดให้ทำไทน์บีมจำนวน 2 ช่วงคาน ยาวรวม 5 เมตร (ตามรูปแนบ)</p>\n\n<p>และทางผู้รับเหมางานโครงสร้างได้เสนอราคามา โดยทางผู้ควบคุมงานเห็นควรว่าเป็นราคาที่เหมาะสม ตามใบเสนอราคาที่แนบมาครับ</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1612751038474,0,'เสนอราคาไทน์บีม.pdf',NULL,NULL,10,'2021-04-01 10:11:58',NULL,NULL,'\\public\\memo\\FMCON6401042021\\'),(50,'FM-ARCH-64-0014','2021-04-01',1593074585627,'1536712608041','1612751038474','IDEN 101 ยกเลิกการเปิดฝาบ่อพักน้ำ เพื่อตรวจขนาดท่อ','<p>เนื่องด้วย กรมที่ดิน เข้ามาตรวจโครงการจัดสรร ในวันที่ 17 มี.ค. 2564 และมีคำสั่งให้ทางโครงการเปิดฝาท่อเพื่อถ่ายรูปวัดขนาดท่อ ทางโครงได้ดำเนินการเปิดฝาบ่อพักน้ำ ในวันที่ 29 มี.ค. 2564 และ คุณ กิติพงษ์ สุมานนท์ มีัคำสั่งให้ รอกบ่อพักและท่อให้สะอาด จึงมอบหมายให้ทางโครงการ จัดจ้างผู้รับเหมามาทำความสะอาดบ่อพักและท่อ แต่ด้วยทางกรมที่ดิน ได้ออก\"บันทึกการตรวจสาธารณูปโภคในบริเวณที่ดินจัดสรร เพื่อประกอบการพิจารณา ลดวงเงินค้ำประกัน\" ,มาให้ทางฝ่ายกฎหมาย ในวันที่&nbsp;30 มี.ค. 2564 และได้ตรวจให้ ประเด็น</p>\n\n<p>1. บ่อพักของท่อระบายน้ำ ตรวจให้ ดำเนินการเสร็จบางส่วน</p>\n\n<p>2. บ่อตรวจคุณภาพน้ำ ตรวจให้&nbsp;เสร็จเรียบร้อยแล้ว</p>\n\n<p>จึงไม่จำเป็นต้องเปิดฝาท่ออีกและต้องการขอยกเลิก คำสั่งให้ รอกบ่อพักและท่อให้สะอาด&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ<strong>&nbsp;</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1593074585627,1612751038474,1536712608041,1,'',NULL,NULL,9,'2021-04-01 11:27:57',NULL,NULL,''),(51,'FM-CON-64-0017','2021-04-01',1615781427251,'1612751038474','1566381381121','ICOPENH : ชี้แจงการทำไทน์บีม และใบเสนอราคา','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยปัญหาเข็มเยื้องศูนย์ ของงานตอกเสาเข็มโซน SC ที่เกิดจากการขยับผังจัดสรรค์</p>\n\n<p>ทางผู้เชียวชาญงานเสาเข็มจึงกำหนดให้ทำไทน์บีมจำนวน 2 ช่วงคาน ยาวรวม 5 เมตร (ตามรูปแนบ)</p>\n\n<p>และทางผู้รับเหมางานโครงสร้างได้เสนอราคามา โดยทางผู้ควบคุมงานเห็นควรว่าเป็นราคาที่เหมาะสม ตามใบเสนอราคาที่แนบมาครับ</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1536712608041,6,'เสนอราคาไทน์บีม.pdf',NULL,NULL,10,'2021-04-01 11:31:45',NULL,NULL,'\\public\\memo\\FMCON6401042021\\'),(52,'FM-IT-64-0020','2021-04-02',4,'1536712608041','2,3','ขออนุมัติต่อบริการ Alpha SSL เว็บ iris.co.th','<p>เนื่องจาก SSL Certifacate ของเว็บไซต์ www.iris.co.th ที่ใช้สำหรับเข้ารหัสและถอดรหัสข้อมูลระหว่างเครื่องเซอเวอร์กับเว็บเบราว์เซอร์เพื่อเพิ่มความปลอดภัยในการรับ-ส่งข้อมูลบนอินเทอร์เน็ตและสร้างความน่าเชื่อถือในการเข้าชมเว็บไซต์ของลูกค้า จะหมดอายุในวันที่ 29 เมษายน 2564</p>\n\n<p>ทางฝ่ายเทคโนโลยีสารสนเทศเสนอให้ต่ออายุการใช้งานต่อไปอีก 1 ปี เพื่อความสะดวกและความปลอดภัยในการเข้าชมเว็บไซต์ของลูกค้า</p>\n\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:90%\">\n	<thead>\n		<tr>\n			<th scope=\"col\" style=\"text-align: center;\">รายละเอียด</th>\n			<th scope=\"col\" style=\"text-align: center;\">จำนวน</th>\n			<th scope=\"col\" style=\"text-align: center;\">ราคา</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>บริการ Alpha SSl Certifacate</td>\n			<td style=\"text-align:center\">1 ปี</td>\n			<td style=\"text-align:right\">4,600.00</td>\n		</tr>\n		<tr>\n			<td>- รองรับการใช้งาน Domain หลัก และ Sub Domain</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td>- ไม่จำกัด License Server</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:right\">ส่วนลด (5%)</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">230.00</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:right\">ราคาหลังหักส่วนลด</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">4,370.00</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:right\">ภาษีมูลค่าเพิ่ม (7%)</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">305.90</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:right\">ราคารวมทั้งสิ้น</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\"><ins>4,675.90</ins></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อขอพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'ใบเสนอราคา SSL ปีที่ 2.pdf',NULL,NULL,4,'2021-04-02 04:45:26',NULL,NULL,'\\public\\memo\\FMIT6402042021\\'),(53,'FM-IT-64-0021','2021-04-02',4,'1536712608041','2,3','ขออนุมัติจ่ายค่าน้ำมัน บัตร Fleet Card เดือนมีนาคม','<p>เนื่องด้วยทางบริษัทได้ทำการออกบัตร Fleet Card เติมน้ำมันกับธนาคารกสิกรไทย เพื่อสะดวกในการเติมน้ำมันของรถยนต์บริษัท</p>\n\n<p>บัดนี้ ทางธนาคารกสิกรไทย ได้ทำการส่งใบแจ้งหนี้การใช้จ่ายบัตร Fleet Card โดยมีรายละเอียดดังนี้</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"width:80%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\">\n			<p><strong>ทะเบียนรถ</strong></p>\n			</td>\n			<td style=\"text-align:center\">\n			<p><strong>ค่าใช้จ่าย</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>NISSAN ฎศ – 745 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp;&nbsp;&nbsp; &nbsp;950.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>NISSAN ฎศ – 475 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp; 1,880.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>TOYOTA 2กถ – 6841 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp; 1,310.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>TOYOTA 8กว-118 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp; 5,640.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p><strong>รวมทั้งสิ้น</strong></p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>9,780.00</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; หมายเหตุ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * วันที่สรุปยอด 25/03/2564</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1536712608041,5,'ใบแจ้งยอดบัตรเครดิต Fleetcard.pdf',NULL,NULL,4,'2021-04-02 06:55:46',NULL,NULL,'\\public\\memo\\FMIT6402042021\\'),(54,'FM-CON-64-0018','2021-04-05',1615781427251,'1612751038474','1536712608041,1566381381121','ICOPENH : สอบถามงานโครงสร้างที่ยังไม่จัดจ้าง แปลง SB','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยแปลง SB ได้วางพื้นเสร็จแล้วตามสัญญาว่าจ้าง&nbsp;&nbsp;บ.ฐานวิศวกรรม ประกอบแผ่นในโซน SB จำนวน 5 หลัง (รูปแนบ1)</p>\n\n<p>ต่อมาทราบว่าแปลง SB เคยปรับลดบ้านจาก 6 หลัง เหลือ 5 หลังตามผังจัดสรรค์ จึงทำให้หน้างานมีโครงสร้างฐานราก, คานพื้น และแผ่นพื้นคอนกรีตวางไว้โดยไม่ใช้งาน (รูปแนบ2)&nbsp;&nbsp;</p>\n\n<p>ทางฝ่ายก่อสร้างจึงขอสอบถามว่าจะทำอย่างไรกับโครงสร้างที่เหลือไว้ในแปลง SB &nbsp; ซึ่งถ้าให้วางแผ่นพื้นในส่วนที่เหลือ ทางฝ่ายจัดซื้อต้องจัดจ้างไปยัง บ.ฐานวิศวกรรม เพื่อติดตั้งครับ</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1536712608041,1,'รูปแนบ 1.jpg,รูปแนบ 2.jpg',NULL,NULL,10,'2021-04-05 03:04:52',NULL,NULL,'\\public\\memo\\FMCON6405042021\\'),(55,'FM-MKT-64-0002','2021-04-05',7,'1536712608041','3,2','ขออนุมัติชำระค่าภาษีป้าย ประจำปี 2564 โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;ตามกำหนดชำระภาษีป้าย ประจำปี 2564 ของโครงการ ICOPENH สำนักงานเทศบาลสำโรงเหนือ บริเวณ ป้ายติดเสาไฟ และตอม่อ BTS (รูปถ่ายตามแนบ) เนื่องจากป้ายโฆษณาเป็นภาษาไทยปนภาษาอังกฤษ เข้าปะเภท 2(ข) รายละเอียดตามกำหนดอัตราภาษีป้าย พ.ศ. 2564 (26 บาท/500 ตร.ม.) รายละเอียดตามแนบ ดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp;โดยขนาด 80x120 เซนติเมตร 120x240 เซนติเมตร และ 240x240 เซนติเมตร จำนวนทั้งหมด 24 ป้าย เป็นเงิน 46,381 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;ดังนั้น ฝ่ายการตลาดจึงเจรจาต่อรองภาษีป้ายเหลือ 20,000 บาท (สองหมื่นบาทถ้วน) เป็นค่าดำเนินการภาษีป้าย ประจำปี 2564 <strong>โดยชำระเป็นเงินสด (ไม่มีใบเสร็จ) นำชำระโดย คุณลออ เชื้อประกอบกิจ</strong> ณ สำนักงานเทศบาลสไโรงเหนือ ฝ่ายสำรวจ/แผนที่ภาษี&nbsp;ในวันที่ 23 เมษายน 2564</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติเงินจำนวนดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;ลงชื่อ..................................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (นางสาวลออ เชื้อประกอบกิจ)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้ช่วยกรรมการบริหาร</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1525042815017,1612152002474,1536712608041,0,'2032021 _1_๒๑๐๓๒๒_0.jpg,432021 _1_๒๑๐๓๑๙_10.jpg,432021 _1_๒๑๐๓๑๙_57.jpg',NULL,NULL,7,'2021-04-05 10:31:12',NULL,NULL,'\\public\\memo\\FMMKT6405042021\\'),(56,'FM-ARCH-64-0015','2021-04-05',1566381654308,'1531524013391','8,10,3','แจ้งเหตุรั้วโครงการ IDEN เกษตร พหลโยธิน ล้มและเกิดความเสียหาย เนื่องจากพายุฝน เมื่อวันที่ 5 เมษายน 2564','<p>เนื่องจากในวันที่ 5&nbsp;เมษายน&nbsp;2564 เวลา 8.30 น. ทางหน้างานโครงการ IDEN เกษตร พหลโยธิน ได้พบเศษวัสดุของรั้วที่พักเพิ่มเติมจากครั้งแรก คาดการณ์ว่า ในวันที่ 4 เมษายน 2564 น่าจะเกิดจากสาเหตุลมแรง&nbsp;มีฝนตกหนัก&nbsp;และมีพายุ &nbsp;&nbsp;ส่งผลให้รั้วโครงการล้ม และมีความเสียหายเกิดขึ้น ยาว 14.10 เมตร&nbsp;&nbsp;รวมเป็นพื้นที่ 42.3&nbsp; ตารางเมตร&nbsp; ด้วยเหตุนี้ฝ่ายก่อสร้างจึงนำส่งรูปภาพแสดงความเสียหายอันเนื่องจากเหตุดังกล่าว&nbsp; และให้ฝ่ายกฎหมายและฝ่ายการเงินดำเนินการขั้นต่อไปอย่างเร่งด่วน<br>\n&nbsp;จึงเรียนมาเพื่อโปรดดำเนินการขั้นต่อไปอย่างเร่งด่วน</p>\n',1566381654308,0,1612751038474,6,'210405_รั้วล้มครั้งที่ 2.pdf',NULL,NULL,9,'2021-04-05 10:21:25',NULL,NULL,'\\public\\memo\\FMARCH6405042021\\'),(57,'FM-ARCH-64-0016','2021-04-06',1566381654308,'8','10','IKP ขอให้ออกหนังสือติดตาม บริษัท ไอเดคคอร่า จำกัด เพื่อเข้ามาแก้ไขงานรั้วที่เสียหาย ครั้งที่2  สำหรับโครงการไอเดน เกษตร-พหลโยธิน  ','<p>ตามที่บริษัท ไอเดคคอร่า จำกัด (ผู้รับจ้าง) ได้เซ็นต์สัญญากับบริษัท ไอริส กรุ๊ป จำกัด (ผู้ว่าจ้าง) เพื่อทำการรื้อถอนรั้วเก่าและก่อสร้างรั้วใหม่ โครงการไอเดน เกษตร-พหลโยธิน &nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ในการนี้ ฝ่ายก่อสร้างโดยนาย ธนพนธ์ อุตมานิติเจริญ ขอเรียนให้ทราบว่า เมื่อวันที่ 5 เมษายน 2564 งานรั้วระแนงโครงสร้างเหล็กที่ผู้รับจ้างได้ก่อสร้างโดยได้ติดตั้งบนกำแพงก่ออิฐ นั้น ได้เกิดการพังทลายและถล่มลงไปในพื้นบริเวณข้างเคียง อันมีสาเหตุมาจากการก่อสร้างที่ไม่ถูกต้องตามหลักวิศวกรรม กล่าวคือตรงจุดรองรับระหว่างแผ่นเพลทกับคานคอนกรีต &nbsp;(ทับหลัง)กำแพงนั้น มีสภาพไม่สมบูรณ์โดยปรากฏแผ่นเพลทขึ้นสนิม พุกไม่ได้ฝังในเนื้อคอนกรีต และมีสนิมหนา ส่งผลให้การรับกำลังบริเวณจุดรองรับดังกล่าวบกพร่อง เป็นเหตุให้เกิดการพังทลายของกำแพง</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อให้ฝ่ายกฎหมายออกหนังสือติดตามผู้รับจ้างให้ให้รีบเข้ามาดำเนินการแก้ไขเป็นการเร่งด่วน</p>\n',1566381654308,0,1612751038474,3,'210405_รั้วล้มครั้งที่ 2.pdf',NULL,NULL,9,'2021-04-06 04:56:25',NULL,NULL,'\\public\\memo\\FMARCH6406042021\\'),(58,'FM-CON-64-0019','2021-04-06',1612751038474,'1531524013391','1593074585627','IDEN 101: ขออนุมัติจ่ายเงินประกันผลงาน แปลง 17 และ 18 ให้กับบริษัท เอส.พี.อี.เดเวลลอปเม้นท์ จำกัด ','   \n   เมื่อวันที่ 21 มกราคม 2564 บริษัท เอส.พี.อี.เดเวลลอปเม้นท์ จำกัด (บจ.เอส.พี.อี) ได้มีการส่งเบิกเงินประกันผลงานของโครงการ IDEN 101  แปลงที่ 17 และ 18 โดยปรากฏมูลค่าเงินประกันผลงานรายแปลงคือ 235,844.85 บาท รวมเงินประกันผลงานทั้งสิ้น 471,689.70 บาท ซึ่งครบกำหนดประกันผลงานในวันที่ 23 ตุลาคม 2563 (ทั้ง 2 แปลง)  และฝ่ายหน้างานได้แจ้งให้      บจ.เอส.พี.อี แก้ไขรายละเอียดงานเพิ่มเติม  นั้น\n\n    ในการนี้ ฝ่ายก่อสร้าง โดย นาย วิศวรุต เกกินะ (สถาปนิกโครงการ) ขอเรียนให้ทราบว่า บจ.เอส.พี.อี ได้ดำเนินการแก้ไขตามรายการที่แจ้งแล้วเสร็จเป็นที่เรียบร้อยแล้ว และกำหนดเข้าแก้ไขงานในแปลงที่ 41 และ 42 เป็นลำดับถัดไป\n	จึงเรียนมาเพื่อโปรดอนุมัติ\n\n\n\n\n	',1612751038474,0,1531524013391,3,'memo.pdf',NULL,NULL,10,'2021-04-06 09:11:07',NULL,NULL,'\\public\\memo\\FMCON6406042021\\'),(59,'FM-IT-64-0022','2021-04-06',4,'1617075740614','2,3,5','ขออนุมัติสั่งซื้อฮาร์ดดิสก์พกพา','<p>เนื่องจากสำนักงานใหญ่ได้ใช้งานระบบจัดเก็บไฟล์ข้อมูลในระบบเครือข่ายเพื่อสร้างความสะดวกในการจัดเก็บ แบ่งปัน และ ค้นหาไฟล์ภายในองค์กร&nbsp;เนื่องด้วยอุปกรณ์ที่ใช้จัดเก็บเป็นอุปกรณ์อิเล็กทรอนิกส์ที่มีความเสื่อมสภาพตามการใช้งานและมีโอกาสที่จะเสียหายได้โดยไม่มีการแจ้งเตือนล่วงหน้า อาจทำให้ไฟล์สำคัญที่จัดเก็บสูญหายได้</p>\n\n<p>ทางฝ่ายเทคโนโลยีสารสนเทศจึงเสนอวิธีป้องกันเหตุดังกล่าว ด้วยการสำรองข้อมูลเก็บในฮาร์ดดิสก์พกพาสัปดาห์ละ 1 ครั้ง โดยใช้อุปกรณ์ดังนี้<br>\n<img alt=\"\" src=\"http://hr.iris.co.th:3000/public/memo/FMIT6406042021/itemdetail.jpg\" style=\"width:80%\"></p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1617075740614,5,'ใบเสนอราคา ext hdd 4TB.pdf,itemdetail.jpg','2021-04-18 03:56:47',NULL,4,'2021-04-06 09:44:43',NULL,NULL,'\\public\\memo\\FMIT6406042021\\'),(60,'FM-CON-64-0020','2021-04-06',1615781427251,'1612751038474','1536712608041,1566381381121','ICOPENH : ชี้แจงการทำไทน์บีม และใบเสนอราคา แปลง SC','<p>เรียน ผู้อำนวยการงานก่อสร้าง</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยปัญหาเข็มเยื้องศูนย์ ของงานตอกเสาเข็มโซน SC ที่เกิดจากการขยับผังจัดสรรค์</p>\n\n<p>ทางผู้เชียวชาญงานเสาเข็มจึงกำหนดให้ทำไทน์บีมเพื่อความแข็งแรงของงานฐานรากในแต่ละจุด ยาวรวม 25 เมตร (ตามรูปแนบ)&nbsp;</p>\n\n<p>และทางผู้รับเหมางานโครงสร้างได้เสนอราคามา โดยทางผู้ควบคุมงานได้ตรวจสอบใบเสนอราคาแล้วเห็นว่าเป็นราคาที่เหมาะสม</p>\n\n<p>จึงขอส่งเรื่องมายังผู้อำนวยการงานก่อสร้าง เพื่อพิจารณาครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ</p>\n',1615781427251,1612751038474,1536712608041,1,'ใบเสนอราคาไทน์บีม SC   6-4-64.pdf,แบบไทน์บีม SC.jpg,ระยะเยื้องศูนย์.jpg,ตรวจสอบ BOQ.jpg',NULL,NULL,10,'2021-04-06 09:57:15',NULL,NULL,'\\public\\memo\\FMCON6406042021\\'),(61,'FM-ARCH-64-0017','2021-04-07',1593074585627,'1536712608041','1566381381121,8','IDEN 101 เพิ่มขนามิตเตอร์ไฟฟ้าสโมสรโครงการ','<p>เนื่องจากมีการชำระค่าติดตั่งมิตเตอร์ไฟฟ้าสโมสรโครงการ ขนาดเครื่องวัดฯ 15(45)A 230/400V 3P 4W ในราคา 5,800 บาท ชำระในวันที่ 13 ธันวาคม 2561 แต่ไม่สามารถติดตั่งมิตเตอร์ได้เนื่องจาก ขนาดมิตเตอร์ไม่สอดคล้องกับการใช้ง้านไฟฟ้า ซึ่งประกอบด้วย 1)สโมสร 2)ป้อมยาม 3)ซุ้มประตู 4)สวนในโครงการ 5)ปั้มน้ำหลายจุดในโครงการ จึงจำเป็นต้องเพิ่มขนาดมิตเตอร์ไฟฟ้าเป็น 30(100)A 230/400V 3P 4W</p>\n\n<p>จึงเรียนมาเพื่อให้ฝ่ายกฎหมายเขียนจดหมายเพื่อยื่นของเพิ่มขนามมิตเตอร์ไฟฟ้าต่อการไฟฟ้าเขตบางกะปิ และเพื่อให้ทราบราคาที่ต้องชำระเพิ่มเติมต่อไป</p>\n',1593074585627,1525820558822,1536712608041,1,'',NULL,NULL,9,'2021-04-07 03:30:31',NULL,NULL,''),(62,'FM-MKT-64-0003','2021-04-08',7,'1536712608041','3,2','ขออนุมัติชำระค่าภาษีป้าย ประจำปี 2564 โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;ตามกำหนดชำระภาษีป้าย ประจำปี 2564 ของโครงการ ICOPENH สำนักงานเทศบาลสำโรงเหนือ บริเวณ ป้ายติดเสาไฟ และตอม่อ BTS (รูปถ่ายตามแนบ) เนื่องจากป้ายโฆษณาเป็นภาษาไทยปนภาษาอังกฤษ เข้าปะเภท 2(ข) รายละเอียดตามกำหนดอัตราภาษีป้าย พ.ศ. 2564 (26 บาท/500 ตร.ม.) รายละเอียดตามแนบ ดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp;โดยขนาด 80x120 เซนติเมตร 120x240 เซนติเมตร และ 240x240 เซนติเมตร จำนวนทั้งหมด 24 ป้าย เป็นเงิน 46,381 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;ดังนั้น ฝ่ายการตลาดจึงเจรจาต่อรองภาษีป้ายเหลือ 20,000 บาท (สองหมื่นบาทถ้วน) เป็นค่าดำเนินการภาษีป้าย ประจำปี 2564&nbsp;<strong>โดยชำระเป็นเงินสด (ไม่มีใบเสร็จ) นำชำระโดย คุณลออ เชื้อประกอบกิจ</strong>&nbsp;ณ สำนักงานเทศบาลสำโรงเหนือ ฝ่ายสำรวจ/แผนที่ภาษี&nbsp;ในวันที่ 23 เมษายน 2564</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติเงินจำนวนดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;ลงชื่อ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(นางสาวลออ เชื้อประกอบกิจ)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้ช่วยกรรมการบริหาร</p>\n',1525042815017,1612152002474,1536712608041,0,'432021 _1_๒๑๐๓๑๙_7.jpg,432021 _1_๒๑๐๓๑๙_35.jpg,432021 _1_๒๑๐๓๑๙_98.jpg,432021 _1_๒๑๐๓๑๙_37.jpg',NULL,NULL,7,'2021-04-08 07:26:07',NULL,NULL,'\\public\\memo\\FMMKT6408042021\\'),(63,'FM-CON-64-0021','2021-04-08',1615781427251,'1527894542301','1536712608041','ICOPENH : ชี้แจงผู้รับเหมางานติดตั้งแผ่นพรีแคสขอปรับราคา','<p>เรียน ผู้จัดการฝ่ายจัดซื้อ</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วย บ.ฐานวิศวกรรมโยธา จำกัด ซึ่งเป็นผู้รับเหมางานติดตั้งแผ่นพรีแคสคอนกรีต</p>\n\n<p>ได้ขอพิจารณาปรับราคางานติดตั้งบ้าน Type S&nbsp; โดยได้แนบเอกสารเหตุผลในการขอพิจารณาปรับราคามา ดังเอกสารแนบครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงคววามนับถือ</p>\n',1615781427251,1527894542301,1536712608041,3,'บ.ฐานขอเพิ่มงบจัดจ้าง.pdf','2021-05-21 05:12:38',NULL,10,'2021-04-08 10:33:39',NULL,NULL,'\\public\\memo\\FMCON6408042021\\'),(64,'FM-ARCH-64-0018','2021-04-09',1566381654308,'1536712608041','10,5','IKP ขออนุมัติจัดจ้างผู้รักษาความปลอดภัยรอบกลางคืนภายในโครงการไอเดน เกษตร-พหลโยธิน','<p>&nbsp; &nbsp; &nbsp; &nbsp;เนื่องจากทางหน้างานโครงการไอเดน เกษตร-พหลโยธิน มีความประสงค์จัดจ้างผู้รักษาความปลอดภัยภายในโครงการในรอบกลางคืน เนื่องจากภายในโครงการเริ่มมีทรัพย์สินมีค่าหลายอย่าง&nbsp; โดยอยากให้เริ่มจัดจ้างตั้งแต่วันที่ 12/04/64 เป็นต้นไป</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1566381654308,0,1536712608041,5,'',NULL,NULL,9,'2021-04-09 05:48:23',NULL,NULL,''),(65,'FM-CON-64-0022','2021-04-16',10,'1536712608041','2','ขออนุมัติเงินประกันผลงานให้แก่ผู้รับเหมา บจก.พี.เค.พี.','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; เนื่องด้วย โครงการไอริส พาร์ค ได้รับข้อร้องเรียนจากลูกบ้าน เรื่องของงานซ่อมแซมบ้านหลังโอนกรรมสิทธิ์ &nbsp;ทางฝ่ายก่อสร้างได้มีการประสานงานกับผู้รับเหมา บจก.พี.เค.พี.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>ให้เข้ามาดำเนินงานซ่อมแซมบ้าน แต่ผู้รับเหมา ขาดสภาพคล่อง จึงขอเบิกเงินประกันผลงาน ของปี 2560-2561&nbsp; บางส่วน เพื่อเป็นทุนในการดำเนินการซ่อมแซมบ้าน เป็นจำนวนเงิน &nbsp;50,000.00 บาท &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>ได้แจ้งในที่ประชุม วันที่ 8 เม.ย. 2564 และเชิญผรม.เข้ามาเจรจาในวันเดียวกันแล้ว เบื้องต้นชี้แจงกับผรม.ถึงเงื่อนไขในการเบิกคืนเงินประกันผลงานส่วนที่เหลือ &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>หากผู้รับเหมา ซ่อมแซมบ้านแต่ละหลัง เรียบร้อยฝ่ายก่อสร้างจะทำเอกสารให้ฝ่ายบัญชี การเงิน ทำการเบิก-จ่าย ต่อไป&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1615426891970,1536712608041,1536712608041,1,'',NULL,NULL,10,'2021-04-16 07:41:30',NULL,NULL,''),(66,'FM-CON-64-0023','2021-04-19',1566381381121,'1566381654308','1583315519071','ขอแก้ไขแผ่นพีคาส','<p><strong>I COPENH (Sukhumvit 76) PROJECT</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ฝ่ายก่อสร้าง ได้ตรวจสอบหน้างานภายในโครงการ ปรากฎว่าพบปัญหาเรื่องแผ่นพีคาสในการเดินงานระบบไฟฟ้าและประปารวมถึงงานห้องเก็บของใต้บันได โดยข้ออนุญาติแก้ไขแบบแผ่นพีคาสดังนี้&nbsp;</p>\n\n<p><strong>Type LA,LC,LE&nbsp;</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.เพิ่มขนาดช่องงานระบบ ผนั้งชั้น 1 เบอร์ 8,23,38,53,68,83</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.เพิ่มความสูงผนังใต้บันได ผนังชั้น 1 เบอร์ 11,26,41,56,71,86</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3.ขยับช่องเดินสายไฟหรือใส่บล๊อคไฟแทน ผนังชั้น 1 เบอร์ 2,17,32,47,62,77</p>\n\n<p><strong>Type LB,LD,LF</strong></p>\n\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong>1.เพิ่มขนาดช่องงานระบบ ผนั้งชั้น 1 เบอร์ 8,23,38,53,68,83</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.เพิ่มความสูงผนังใต้บันได ผนังชั้น 1 เบอร์ 11,26,41,56,71,86</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3.ขยับช่องเดินสายไฟหรือใส่บล๊อคไฟแทน ผนังชั้น 1 เบอร์ 17,32,47,62,77,92</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;โดยมีเอกสารแนบรายละเอียด</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อโปรดทราบและเพื่ออนุมัติ</p>\n',1566381381121,1615781427251,1566381654308,5,'Comment งาน Precast Type L 6.pdf','2021-04-19 05:52:20','2021-05-22 08:07:45',10,'2021-04-19 05:14:37',NULL,NULL,'\\public\\memo\\FMCON6419042021\\'),(67,'FM-HR-64-0001','2021-04-20',1616471031122,'1536712608041','','ขออนุมัติต่ออายุการใช้งาน JobsDB','<p>จากนโยบายเรื่องการเร่งการเติมบุคลากรในตำแหน่ง ที่เป็นกลุ่มหลักในการขับเคลื่อนองค์กรให้ตอบโจทย์ หรือเป้าหมายที่ตั้งไว้&nbsp;โดย ณ ปัจจุบันมีการใช้ช่องทางการสรรหาบุคลากรทางออนไลน์ผ่านทาง JobDB</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อขออนุมัติการใช้งาน และชำระเงินค่าบริการในส่วน JobsDB เพื่อเพิ่มช่องทางในการสรรหาบุคลากรให้หลากหลายขึ้นในการสรรหาบุคลากรทางออนไลน์ โดยมุ่งหวังกลุ่มตำแหน่งงานระดับหัวหน้างาน และกลุ่มประสบการณ์ที่ใกล้เคียงกับความต้องการขององค์กรมากยิ่งขึ้น</p>\n\n<p>ตามรายละเอียดดังนี้</p>\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse\">\n	<tbody>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:54px\">\n			<p>ลำดับที่</p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid bla