al-align:top; width:403px\">\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; รวมเป็นเงินทั้งสิ้น</p>\n			</td>\n			<td style=\"border-bottom:2px double black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:209px\">\n			<p>19,474.50 บาท</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่ออนุมัติ โดยทาง JobsDB ได้เปิดให้ใช้งานตั้งแต่วันที่ 20&nbsp;เมษายน&nbsp;2564 และมีอายุการใช้งานถึงวันที่ 20&nbsp;กรกฏาคม&nbsp;2564</p>\n',1616471031122,1617075740614,1536712608041,0,'20210420131603 ใบเสนอราคา Jobdb.pdf',NULL,NULL,6,'2021-04-20 10:59:18',NULL,NULL,'\\public\\memo\\FMHR6420042021\\'),(69,'FM-MKT-64-0004','2021-04-21',7,'1536712608041','3,2','ขออนุมัติชำระค่าภาษีป้าย ประจำปี 2564 โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;ตามกำหนดชำระภาษีป้าย ประจำปี 2564 ของโครงการ ICOPENH สำนักงานเทศบาลสำโรงเหนือ บริเวณตอม่อ BTS (รูปถ่ายตามแนบ) เนื่องจากป้ายโฆษณาเป็นภาษาไทยปนภาษาอังกฤษ เข้าปะเภท 2(ข) รายละเอียดตามกำหนดอัตราภาษีป้าย พ.ศ. 2564 (26 บาท/500 ตร.ม.) รายละเอียดตามแนบ ดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp;โดยขนาด 240x240 เซนติเมตร จำนวนทั้งหมด 20 ป้าย เป็นเงิน 59,904.00&nbsp;บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;ดังนั้น <strong>ฝ่ายการตลาดจึงเจรจาต่อรองภาษีป้ายเหลือ 20,000 บาท (สองหมื่นบาทถ้วน) เป็นค่าดำเนินการภาษีป้าย ประจำปี 2564&nbsp;โดยชำระเป็นเงินสด (ไม่มีใบเสร็จ)&nbsp;นำชำระโดย คุณลออ เชื้อประกอบกิจ</strong>&nbsp;ณ สำนักงานเทศบาลสำโรงเหนือ ฝ่ายสำรวจ/แผนที่ภาษี&nbsp;ในวันที่ 28 พฤษภาคม&nbsp;2564 หรือ ภายในเดือนพฤษภาคม</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติเงินจำนวนดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;ลงชื่อ..............................................&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ลออ เชื้อประกอบกิจ)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ผู้ช่วยกรรมการบริหาร&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Chief Operation Officer (operation)</p>\n',1525042815017,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-04-21 03:50:25','2021-05-04 08:44:25',NULL,''),(70,'FM-IT-64-0023','2021-04-22',4,'1617075740614','1527376046432,2,5','ขออนุมัติซ่อมเครื่องพิมพ์โครงการ ICO','<p>เนื่องจากเครื่องพิมพ์โครงการ ICO เกิดขัดข้อง ทำให้ไม่สามารถพิมพ์ได้ ทางฝ่ายเทคโนโลยีสารสนเทศจึงได้ดำเนินการแก้ไขเบื้องต้น แต่ไม่สามารถแก้ไขได้ จึงนำส่งซ่อมกับทางผู้ให้บริการซ่อม ปรากฏพบสาเหตุคือ มีสัตว์เข้าไปตายอยู่ในเครื่อง ทำให้อุปกรณ์ภายในได้รับความเสียหาย&nbsp;</p>\n\n<p>ทางฝ่ายเทคโนโลยีสารสนเทศจึงขออนุมัติซ่อม เพื่อให้การดำเนินงานเป็นไปอย่างต่อเนื่อง และมีประสิทธิภาพ รายละเอียดตามเอกสารแนบครับ</p>\n',1526857550562,1527376046432,1617075740614,5,'KAI6404002 Printer HP Pro MFP M177fw.pdf,KAI6404003 เสนอราคาดั้ม สำหรับ Printer HP Pro MFP M177fw.pdf',NULL,NULL,4,'2021-04-22 04:19:24',NULL,NULL,'\\public\\memo\\FMIT6422042021\\'),(71,'FM-IT-64-0024','2021-04-23',4,'1617075740614','2,3,5','ขออนุมัติต่อบริการ dyndns','<p>เนื่องด้วยบริการ dyndns จะหมดอายุในวันที่ 16 พฤษภาคม 2564&nbsp;ทางฝ่ายเทคโนโลยีสารสนเทศได้ใช้บริการนี้ ในการระบุพิกัด IP ของอุปกรณ์ในโครงการต่างๆ สำหรับใช้งานอุปกรณ์ผ่านระบบอินเตอร์เน็ต เช่น การดึงข้อมูลแสกนนิ้วมือ , การดูระบบ CCTV ออนไลน์ หรือ การเข้าไปปรับตั้งค่าอุปกรณ์ เป็นต้น โดยมีระยะเวลาในการต่อบริการ 3&nbsp;รูปแบบดังนี้</p>\n\n<table align=\"center\" border=\"1\" cellpa