กค้า ช่างหน้างานและผู้ที่จะเข้ามาติดต่อเรื่องต่างๆภายในโครง</p>\n\n<p>เมื่อวันที่ 20/04/64 ที่ผ่านมาอุปกรณ์วิทยุสื่อสารเกิดการใช้งานไม่ได้เนื่องจากแบตเตอร์รีเสื่อมสภาพ&nbsp;จึงอยากขอรบกวนทางฝ่ายเทคโนโลยีสารสนเทศเอาตรวจสอบและซ่อมแซมอุปกรณ์ดังกล่าว</p>\n\n<p>โปรดดำเนินการอย่างเร่งด่วน</p>\n',1566381654308,0,1618888979382,3,'',NULL,NULL,9,'2021-04-23 07:18:11',NULL,NULL,''),(74,'FM-ARCH-64-0020','2021-04-26',1593074585627,'1536712608041','6','ขออนุมัติลาไม่รับค่าจ้าง เพื่อดำเนินการวิทยานิพนธ์','<p>เรียน คุณกิติพงษ์ สุมานนท์ ด้วยกระผม นายวิศวรุต เกกินะ กำลังศึกษาอยู่ในระดับชั้น ปริญญาโท และมีความจำเป็นต้องมุ้งเน้นในส่วนของการทำวิทยานิพนธ์ จึงมีความประสงค์จะขออนุมัติลดวันทำงานรูปแบบลาไม่รับค่าจ้างในช่วงเดือนพฤษภาคม และเดือนมิถุนายน เป็นจำนวนเวลาทำงาน 20 วัน และเพื่อไม่ให้เสียการทำงานจะเข้าทำงานในวันพุธและวันพฤหัสบดี (ยกเว้นสัปดาห์ในการลา ทำงานในวันจันทร์ - วันพุธและลาในวันพฤหัสบดี - วันศุกร์) ตามตารางที่แนบมาด้วย&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse; width:689px\">\n	<tbody>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; height:19px; vertical-align:bottom; white-space:nowrap; width:23px\">&nbsp;</td>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:bottom; white-space:nowrap; width:69px\">sun</td>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:bottom; white-space:nowrap; width:69px\">mon</td>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:bottom; white-space:nowrap; width:69px\">tue</td>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:none; border-right:1px solid bl