ckground-color:#f8cbad; border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;- วันทำงาน</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติ</p>\n\n<p>&nbsp;</p>\n',1593074585627,6,1536712608041,1,'',NULL,NULL,9,'2021-04-26 02:46:43',NULL,NULL,''),(75,'FM-MKT-64-0005','2021-04-26',7,'1618888979382','6','ขออนุมัติ ปรับเปลี่ยนเข้าทำงานร่วมกัน 3 คน ตามนโยบายมาตรการปฏิบัติงาน HR 003/64','<p>&nbsp; &nbsp; &nbsp;อ้างอิงจากเอกสารเลขที่ HR 003/64 เรื่อง การกำหนดมาตรการและแนวทางการปฏิบัติงานของพนักงานไอริส กรุ๊ป เพื่อรองรับสถานการณ์การแพร่ระบาดของโรค covid-19 ลงวันที่ 26 เมษายน 2564 ข้อ 1.1&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;ทางฝ่ายการตลาด เล็งเห็นถึงความสำคัญรวมกันในฝ่าย ซึ่งทำงานร่วมกันมีประสิทธิภาพมากกว่าการแยกทีม&nbsp;ทั้งนี้ทางฝ่ายฯ มีจำนวนพนักงานเพียง 3 คน ดังนั้นทางฝ่ายจึงจะขอเปลี่ยนแนวทางปฏิบัติงาน จากเดิมโดยแบ่งออกเป็น 2 ทีมในการทำงาน ทีมที่ 1 ทำงาน Work at office จำนวนร้อยละ 50 และทีมที่ 2 Work from home ร้อยละ 50 โดยให้สลับผลัดเปลี่ยนทีมกันมาทำงานที่สำนักงานกัน ทีมละสัปดาห์ <strong>ขอเปลี่ยนเป็นเข้ามาปฏิบัติงาน Work at office 2 วันคือ&nbsp;วันอังคาร วันพฤหัสบดี และ Work from home 3 วันคือวันจันทร์ วันพุธ วันศุกร์</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติแนวทางการปฏิบัติงานดังกล่าว</p>\n',1525042815017,1612152002474,1618888979382,5,'',NULL,NULL,7,'2021-04-26 07:16:25',NULL,NULL,''),(76,'FM-BD-64-0001','2021-04-26',12,'1618888979382','6','ขอนุมัติปรับเปลี่ยนวันเข้าทำงานตามนโยบายมาตรการปฏิบัติงาน HR 003/64','<p>&nbsp; &nbsp;อ้างอิงจากเอกสารเลขที่ HR 003/64 เรื่อง การกำหนดมาตรการและแนวทางการปฏิบัติงานของพนักงานไอริส กรุ๊ป เพื่อรองรับสถานการณ์การแพร่ระบาดของโรค covid-19 ลงวันที่ 26 เมษายน 2564&nbsp;</p>\n\n<p>&nbsp; &nbsp; ตามข้อปฎิบัติ 1.1&nbsp;ฝ่ายพัฒนาธุรกิจ&nbsp;เล็งเห็นถึงความสำคัญเพื่อประโยชน์สูงสุดในการทำของฝ่ายจึงจะขอเปลี่ยนแนวทางการเข้าปฏิบัติงาน <strong>Work at office 3&nbsp;วันคือ&nbsp;วันอังคาร วันพุธ และวันพฤหัสบดี</strong> ตามกำหนดระยะเวลาเข้า-ออก ข้อ 1.2&nbsp;และ Work from home 2&nbsp;วันคือวันจันทร์และวันศุกร์&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติแนวทางการปฏิบัติงานดังกล่าว</p>\n',1616990700928,0,1618888979382,5,'',NULL,'2021-04-30 07:47:36',12,'2021-04-26 08:43:36',NULL,NULL,''),(77,'FM-PUR-64-0001','2021-04-26',5,'1617075740614','6,5','ขออนุมัติปรับเปลี่ยนวัน-เวลา ปฏิบัติงาน ตามเอกสารเลขที่ HR 003/64','<p>&nbsp; &nbsp; &nbsp;อ้างอิงจากเอกสารบันทึกข้อความ เลขที่ HR 003/64 เรื่อง การกำหนดมาตรการและแนวทางการปฏิบัติงานของพนักงานไอริสกรุ๊ป เพื่อรองรับสถานการณ์การแพร่ระบาดของโรค covid-19&nbsp;ในข้อ <em>1.1&nbsp;พนักงานที่ปฏิบัติงานประจำอยู่ที่สำนักงานใหญ่ ให้ทางผู้อำนวยการ ผู้จัดการหรือผู้บังคับบัญชาสายตรงของแต่ละฝ่ายจัดตารางการมาปฏิบัติงานของพนักงานของแต่ละฝ่าย โดยแบ่งออกเป็น 2 ทีมในการทำงาน ทีมที่ 1 ทำงาน &nbsp;Work at office จำนวนร้อยละ 50 และทีมที่ 2 Work from home ร้อยละ 50 โดยให้สลับผลัดเปลี่ยนทีมกันมาทำงานที่สำนักงานกัน ทีมละสัปดาห์&nbsp;</em></p>\n\n<p>&nbsp; &nbsp; &nbsp;โดยขอแจ้งรายละเอียดในส่วนฝ่ายจัดซื้อซึ่งมีพนักงานปฏิบัติงานจำนวน 2 คน ดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp;1. คุณมณฑา ทองส่งโสม ผจก.ฝ่ายจัดซื้อ ปฏิบัติงานที่สำนักงานใหญ่ (Work at office) ทุกวันทำการ คือ วันจันทร์-วันศุกร์</p>\n\n<p>&nbsp; &nbsp; &nbsp;2. น.ส.นฤมล นิ่มเกตุ จนท.จัดซื้อ ปฏิบัติงาน Work at office และ Work at home เป็นรายสัปดาห์เว้นสัปดาห์</p>\n\n<p>&nbsp;</p>\n\n<p>***เวลาปฏิบัติงาน Work at office และ Work at home ตามเอกสารบันทึกข้อความ เลขที่ HR 003/64 ประกาศ ณ วันที่ 26/4/2564</p>\n',1566381272207,1527894542301,1617075740614,0,'บันทึกข้อความแนวทางการปฏิบัติงานworkfromehomeไอริส กรุ๊ป.pdf',NULL,NULL,5,'2021-04-26 09:11:08',NULL,NULL,'\\public\\memo\\FMPUR6426042021\\'),(78,'FM-CON-64-0024','2021-04-27',1615781427251,'1619411569757','1593074585627,1566381381121','ICOPENH : แจ้งขอยกเลิกผนังกั้นห้องชั้น2 บ้าน Type L','<p>เรียน ผู้อำนวยการงานก่อสร้าง / สถาปนิกออกแบบ</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยผนังกั้นห้องนอนใหญ่ ชั้น2&nbsp;บ้านType L&nbsp; ได้รับคำแนะนำจากผู้บริหารว่าควรยกเลิกผนังในส่วนนี้</p>\n\n<p>ทางฝ่ายก่อสร้างจึงขอส่งเรื่องให้ทางฝ่ายสถาปนิกออกแบบ ร่วมพิจารณาดังรูปแนบครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ&nbsp;</p>\n',1615781427251,1619411569757,1536712608041,1,'แจ้งขอยกเลิกผนังกั้นห้องชั้น2 บ้าน Type L.jpg',NULL,NULL,10,'2021-04-27 06:38:27',NULL,NULL,'\\public\\memo\\FMCON6427042021\\'),(79,'FM-CON-64-0025','2021-04-27',1615781427251,'1619411569757','1593074585627,1566381381121','ICOPENH : แจ้งขอยกเลิกผนังกั้นห้องชั้น2 บ้าน Type L','<p>เรียน ผู้อำนวยการงานก่อสร้าง / สถาปนิกออกแบบ</p>\n\n<p>&nbsp;</p>\n\n<p>เนื่องด้วยผนังกั้นห้องนอนใหญ่ ชั้น2&nbsp;บ้านType L&nbsp; ได้รับคำแนะนำจากผู้บริหารว่าควรยกเลิกผนังในส่วนนี้</p>\n\n<p>ทางฝ่ายก่อสร้างจึงขอส่งเรื่องให้ทางฝ่ายสถาปนิกออกแบบ ร่วมพิจารณาดังรูปแนบครับ</p>\n\n<p>&nbsp;</p>\n\n<p>ขอแสดงความนับถือ&nbsp;</p>\n',1615781427251,1619411569757,1536712608041,1,'แจ้งขอยกเลิกผนังกั้นห้องชั้น2 บ้าน Type L.jpg',NULL,NULL,10,'2021-04-27 06:44:04',NULL,NULL,'\\public\\memo\\FMCON6427042021\\'),(80,'FM-MKT-64-0006','2021-04-27',7,'1536712608041','1618888979382,5,3,2','ขออนุมัติงบประมาณในการซื้อโฆษณาออนไลน์ แคมเปญ Hey Day ประจำเดือนพฤษภาคม 2564 สำหรับ 5 โครงการ ไอริส พาร์ค / ไอโคเปน / ไอริส เวสท์เกต / ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการจัดแคมเปญ&nbsp;Hey Day ประจำเดือนพฤษภาคม 2564 สำหรับ 5&nbsp;โครงการ ไอริส พาร์ค / ไอโคเปน / ไอริส เวสท์เกต /&nbsp;ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน โดยเริ่มตั้งแต่วันที่ 1 - 31&nbsp;พฤษภาคม 2564 มีรายละเอียด ดังนี้</p>\n\n<p>- ค่าโฆษณาผ่านทาง Facebook รวมเป็นเงิน 160,000 บาท สำหรับ 5&nbsp;โครงการ ได้แก่</p>\n\n<p>1. ไอริส พาร์ค&nbsp; 50,000 บาท&nbsp; &nbsp; &nbsp; &nbsp;2. ไอโคเปน&nbsp; 50,000 บาท&nbsp; &nbsp; &nbsp; &nbsp; 3. ไอริส เวสท์เกต&nbsp; 20,000 บาท&nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p>4. ไอเด็น 101&nbsp; 20,000 บาท&nbsp; &nbsp; &nbsp; &nbsp;5. ไอเด็น เกษตร-พหลโยธิน 20,000 บาท</p>\n\n<p>- ค่าโฆษณาผ่านทาง Google สำหรับ 4&nbsp;โครงการ โครงการละ 6,000 บาท รวมเป็นเงิน 24,000 บาท ได้แก่</p>\n\n<p>1. ไอริส พาร์ค&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2. ไอโคเปน&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. ไอเด็น 101&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4. ไอเด็น เกษตร - พหลโยธิน</p>\n\n<p>รวมงบประมาณที่ขออนุมัติเป็นเงินทั้งสิ้น 184,000 บาท</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(กฤศกร ทัพพ์ปัญญา)</p>\n\n<p>&nbsp; &nbsp; &nbsp; ผู้ช่วยผู้จัดการฝ่ายการตลาด</p>\n',1616118836457,1618888979382,1536712608041,0,'',NULL,NULL,7,'2021-04-27 08:38:29',NULL,NULL,''),(82,'FM-IT-64-0026','2021-04-29',4,'1536712608041','2,3','ขออนุมัติจ่ายค่าน้ำมัน บัตร Fleet Card เดือนเมษายน','<p>เนื่องด้วยทางบริษัทได้ทำการออกบัตร Fleet Card เติมน้ำมันกับธนาคารกสิกรไทย เพื่อสะดวกในการเติมน้ำมันของรถยนต์บริษัท</p>\n\n<p>บัดนี้ ทางธนาคารกสิกรไทย ได้ทำการส่งใบแจ้งหนี้การใช้จ่ายบัตร Fleet Card โดยมีรายละเอียดดังนี้</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"width:60%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\">\n			<p><strong>ทะเบียนรถ</strong></p>\n			</td>\n			<td style=\"text-align:center\">\n			<p><strong>ค่าใช้จ่าย</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>NISSAN ฎศ – 745 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp;&nbsp;&nbsp; &nbsp;810.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>TOYOTA 2กถ – 6841 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp; 1,890.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p>TOYOTA 8กว-118 กท</p>\n			</td>\n			<td style=\"text-align:right\">\n			<p>&nbsp; 12,760.00</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:right\">\n			<p><strong>รวมทั้งสิ้น</strong></p>\n			</td>\n		