',NULL,NULL,''),(84,'FM-BD-64-0002','2021-04-30',1616990700928,'1618888979382','1536712608041,7,11,16,8','ขออนุมัติและออกสัญญาแต่งตั้งตัวแทนขายให้กับนักลงทุน บริษัท วี บียอนด์ ดีเวลอปเม้นท์ จำกัด  โครงการ IBY และ IPC','<p>ขออนุมัติและออกสัญญาแต่งตั้งตัวแทนขายให้กับนักลงทุน บริษัท วี บียอนด์ ดีเวลอปเม้นท์ จำกัด &nbsp;โครงการ IBY และ IPC โดยมีเงื่อนไขสำคัญดังนี้</p>\n\n<p>IBY</p>\n\n<ol>\n	<li>ให้นายหน้าขายตามสัญญานี้&nbsp;จำนวน 93 ยูนิต</li>\n	<li>นายหน้าตกลงจะเป็นผู้ติดต่อหาผู้ซื้อทรัพย์สินดังกล่าว เป็นระยะ 60 วันหลังจากการทำสัญญา โดยนายหน้าจะต้องหาลูกค้าเพิ่มสร้างยอดจองจำนวนไม่น้อยกว่า 25 ยูนิตต่อเดือน และมียอดโอนกรมสิทธิมากกว่า 50% ของยอดจอง&nbsp;</li>\n	<li>นายหน้าสามารถทำการโฆษณา ฯลฯ ด้วยงบของนายหน้าเอง</li>\n</ol>\n\n<p>IPC</p>\n\n<ol>\n	<li>ให้นายหน้าขายตามสัญญานี้&nbsp;จำนวน 33&nbsp;ยูนิต</li>\n	<li>นายหน้าตกลงจะเป็นผู้ติดต่อหาผู้ซื้อทรัพย์สินดังกล่าว เป็นระยะ 60 วันหลังจากการทำสัญญา โดยนายหน้าจะต้องหาลูกค้าเพิ่มสร้างยอดจองจำนวนไม่น้อยกว่า 10&nbsp;ยูนิตต่อเดือน และมียอดโอนกรมสิทธิมากกว่า 50% ของยอดจอง&nbsp;</li>\n	<li>นายหน้าสามารถทำการโฆษณา ฯลฯ ด้วยงบของนายหน้าเอง</li>\n</ol>\n\n<p>ทั้งนี้ได้แนบไฟล์ Price List&nbsp;และร่างข้อกำหนดของทั้ง 2 โครงการมาด้วย</p>\n',1616990700928,0,1618888979382,5,'ร่างข้อกำหนด IBY.pdf,ร่างข้อกำหนด IPC revise01.pdf',NULL,'2021-04-30 08:09:45',12,'2021-04-30 03:51:07',NULL,NULL,'\\public\\memo\\FMBD6430042021\\'),(85,'FM-ARCH-64-0021','2021-04-30',1593074585627,'1536712608041','1525820558822,8,1619411569757','IDEN 101 ขอยกเลิกคำขอเอกสารเลขที่ FM-ARCH-64-0017','<p>อ้างถึง&nbsp;เอกสารเลขที่: &nbsp;FM-ARCH-64-0017 เรื่อง&nbsp;&nbsp;เพิ่มขนาดมิตเตอร์ไฟฟ้าสโมสรโครงการ เนื่องจาก คุณ ธิติพงศ์ อุทุมพร ผู้อำนวยการฝ่ายก่อสร้าง ได้ปรึษากับวิศวกรไฟฟ้า &nbsp;และมีข้อสรุปว่า ไม่จำเป็นต้องเพิ่มขนาดมิตเตอร์ไฟฟ้า สามารถใช้ขนาดเดิม 15(45)A 230/400V 3P 4W ได้&nbsp;และเห็นควรให้ฝ่ายกฎหมาย ดำเนินการตามการไฟฟ้ามาติดมิเตอร์ได้เลย&nbsp;</p>\n\n<p>จึงเรียมมาโปรดดำเนินการ</p>\n',1593074585627,1619411569757,1536712608041,6,'',NULL,NULL,9,'2021-04-30 09:22:16',NULL,NULL,''),(86,'FM-ARCH-64-0022','2021-05-03',1566381654308,'1619411569757','10,8','IKP ขอออกหนังสืออนุมัติสเปคตู้ครอบหม้อแปลงไฟฟ้าโครงการถึงผู้อำนวยการไฟฟ้าบางเขน','<p>เนื่องด้วยโครงการไอเดน เกษตร - พหลโยธิน ต้องการอุปกรณ์ติดดั้งตู้ครอบหม้อแปลงที่ได้รับการอนุมัติจากทางเจ้าหน้าที่การไฟฟ้า มีการให้ทางการไฟฟ้า และฝ่ายวางแผนระบบการไฟฟ้าตรวจสอบและทำการแก้ไขสเปคแล้วตามเอกสารแนบ (หน้า A5 , )</p>\n\n<p>&nbsp;</p>\n\n<p>ทั้งนี้จึงขอให้ทางฝ่ายกฎหมายออกหนังสือขออนุมัติสเปคตู้ครอบหม้อแปลงไฟฟ้าโครงการอย่างเป็นทางการ โดยออกหนังสือไปถึงผู้อำนวยการการไฟฟ้าเขตบางเขต</p>\n\n<p>&nbsp;</p>\n\n<p>เรียนมาเพื่อโปรดดำเนินการ</p>\n',1566381654308,0,1619411569757,5,'210430_R1_ IDEN เกษตร - พหลโยธิน.pdf',NULL,'2021-05-04 07:21:00',9,'2021-05-03 05:48:41',NULL,NULL,'\\public\\memo\\FMARCH6403052021\\'),(87,'FM-MKT-64-0008','2021-05-06',7,'1536712608041','2,5,3','ขออนุมัติ ขนย้ายรถกอล์ฟจากโครงการ ไอริส เวสท์เกต ไปประจำที่โครงการ ไอโคเปน','<p>&nbsp; &nbsp; &nbsp;ทางฝ่ายการตลาดเล่งเห็นถึงประโยชน์ของรถกอล์ฟ สำหรับใช้งานที่สำนักงานขาย โครงการเปิดใหม่ จึงจะขอย้ายรถกอล์ฟ ซึ่งเป็นทรัพย์สินของบริษัทฯ (รหัสทรัพย์สินเลขที่ IRG112040003 รถกอล์ฟไฟฟ้ารุ่น GOLF 6-IA)&nbsp;จำนวน 1 คัน จากเดิมประจำอยู่ที่โครงการ ไอริส เวสท์เกต ย้ายไปประจำที่โครงการ ไอโคเปน สุขุมวิท 76&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติดำเนินงานดังกล่าว&nbsp;</p>\n',1525042815017,1612152002474,1536712608041,5,'',NULL,NULL,7,'2021-05-06 09:04:21','2021-05-06 09:24:11',NULL,''),(88,'FM-IT-64-0027','2021-05-07',4,'1617075740614','2,3','ขออนุมัติเติมเงินบัตรผ่านทางพิเศษ','<p>เนื่องด้วยทางบริษัท ไอริส กรุ๊ป จำกัด&nbsp; มีนโยบายให้พนักงานใช้รถยนต์บริษัทฯ ในการติดต่องานภายนอก โดยทางฝ่ายเทคโนโลยีสารสนเทศ จะอำนวยความสะดวกโดยการเติมเงินค่าบัตร EASY PASS ประจำทุกเดือน&nbsp; จึงขออนุมัติเติมบัตรผ่านทางพิเศษอัตโนมัติ ดังนี้</p>\n\n<table cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td>\n			<p><strong>ลำดับ</strong></p>\n			</td>\n			<td>\n			<p><strong>ทะเบียน</strong></p>\n			</td>\n			<td>\n			<p><strong>ยี่ห้อรถ</stro