sp; ยอดคงเหลือของบัตรทางด่วน ณ วันที่&nbsp; 07/05/2564 จาก https://www.thaieasypass.com</p>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1617075740614,3,'ข้อมูล easypass 07-05-2564.pdf','2021-06-06 14:10:14',NULL,4,'2021-05-07 03:51:15',NULL,NULL,'\\public\\memo\\FMIT6407052021\\'),(89,'FM-AFS-64-0001','2021-05-07',1620101079938,'1618888979382','1536712608041,10,5,2','ขออนุมัติซ่อมบ้านแปลง 49/206 IPC( Iris park ชัยพฤกษ์-วงแหวน)','<p>เนื่องจากได้รับเรื่องการแจ้งซ่อมของบ้านลูกบ้าน แปลง 49/206 คุณธันยาภัทร์ ปานฉิม โครงการ Iris park ชัยพฤกษ์-วงแหวน ได้มีการตรวจสอบข้อมูลว่าบ้านแปลงนี้ได้หมดการรับประกันหลังโอนและเงินประกันผลงานของบ้านหลังนี้ได้เบิกคืนผู้รับเหมาไปแล้ว หากมีการซ่อมจะเป็นค่าใช้จ่ายของทางบริษัท</p>\n\n<p>ดังนั้นจึงเรียนขออนุมัติค่าใช้จ่ายในการซ่อมมูลค่างานซ่อมประมาณ 20,000 บาท จากที่ผู้รับเหมาเสนอราคามา โดยมีรายการแจ้งซ่อมดังนี้&nbsp;<br>\n1. มีอาการปั้มน้ำดังตลอดเวลา คาดว่าท่อภายนอกใต้โครงสร้างแตก&nbsp;<br>\n2. ระเบียงชั้น 2 เคยซ่อมการรั่วซึม แต่ไม่มีมีช่างเข้าไปเก็บสี เก็บงาน<br>\n3.บริเวณผนังด้านข้างมีรอยน้ำซึมเวลาฝนตก</p>\n\n<p><br>\nจึงได้จัดทำเอกสารเพื่อขออนุมัติและจะได้ดำเนินการซ่อมให้แก่ลูกบ้านต่อไป</p>\n',1620101079938,1618888979382,1536712608041,0,'รูปภาพ 206 IPC.pdf',NULL,NULL,13,'2021-05-07 08:15:41',NULL,NULL,'\\public\\memo\\FMAFS6407052021\\'),(90,'FM-AFS-64-0002','2021-05-07',1620101079938,'1618888979382','1536712608041,10,5,2','ขออนุมัติซ่อมบ้านแปลง 49/206 IPC( Iris park ชัยพฤกษ์-วงแหวน)','<p>เนื่องจากได้รับเรื่องการแจ้งซ่อมของบ้านลูกบ้านแปลง&nbsp;49/206 คุณธันยาภัทร์&nbsp;ปานฉิม&nbsp; โครงการ&nbsp;Iris&nbsp;park&nbsp;ชัยพฤกษ์-วงแหวน โอนกรรมสิทธิ์เมื่อวันที่ 23/08/2562 และวันหมดการรับประกันทั่วไป 23/08/2563 ลูกบ้านได้มีการแจ้งเรื่องก่อนการหมดการรับประกันโดยมีหลักฐานในการการแจ้งซ่อมผ่านทางไลน์กับคุณเก๋ After Sale เมื่อวันอาทิตย์ ที่29 ธันวาคม 2562&nbsp;ทางก่อสร้างและฝ่ายเกี่ยวข้องจึงได้มีการตรวจสอบข้อมูลบ้านแปลงนี้&nbsp; ได้หมดการรับประกันหลังโอน และเงินประกันผลงานของบ้านหลังนี้ได้เบิกคืนผู้รับเหมาไปแล้ว&nbsp; โดยมีรายการแจ้งซ่อมเพิ่มเติมดังนี้&nbsp;(มีรูปและรายละเอียดตามเอกสารแนบ)</p>\n\n<p>1.&nbsp;มีอาการปั้มน้ำดังตลอดเวลา&nbsp;คาดว่าท่อภายนอกใต้โครงสร้างแตก&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>2.&nbsp;ระเบียงชั้น&nbsp;2&nbsp;เคยซ่อมการรั่วซึม&nbsp;แต่ไม่มีมีช่างเข้าไปเก็บสี&nbsp;เก็บงาน&nbsp;</p>\n\n<p>3.บริเวณผนังด้านข้างมีรอยน้ำซึมเวลาฝนตก&nbsp;&nbsp;</p>\n\n<p>ซึ่งได้ประเมินค่าใช้จ่ายในการซ่อมมูลค่าประมาณ&nbsp;20,000&nbsp;บาท&nbsp; หากมีการซ่อม จะเป็นค่าใช้จ่ายของทางบริษัท&nbsp;ไอริส กรุ๊ป จำกัด</p>\n\n<p>จึงได้จัดทำเอกสารเพื่อขออนุมัติและจะได้ดำเนินการซ่อมให้แก่ลูกบ้านต่อไป&nbsp;</p>\n',1620101079938,1618888979382,1536712608041,1,'206IPC หลักฐานการเเจ้งซ่อมก่อนหมดการรับประกัน.pdf',NULL,NULL,13,'2021-05-07 09:30:39',NULL,NULL,'\\public\\memo\\FMAFS6407052021\\'),(91,'FM-AFS-64-0003','2021-05-12',1620101079938,'1536712608041','1618888979382,10,2,3','ขออนุมัติจัดจ้างในการเข้าซ่่อมบ้านของลูกบ้าน IPC 206 ให้นายรชตพล  ( อ้างอิงจากMEMOFM-AFS-64-0002 ','<p>ตามที่ได้เคยขออนุมัติเเจ้งซ่อมบ้านของลูกบ้าน IPC 206 &nbsp;คุณกิตติพงษ์ ได้อนุมัติทางไลน์เเล้ว จึงได้จัดทำ MEMO ขึ้นมาใหม่เพื่อขอขออนุมัติจ่ายเงินจำนวน 15,000 บาท ให้ผู้รับเหมา นายรชตพล ภายใน 7 วันหลังจากส่งมอบงาน</p>\n\n<p>&nbsp;</p>\n\n<p>จึงขอพิจารณาอนุมัติเร่งด่วน</p>\n',1620101079938,1618888979382,1536712608041,1,'ใบเสนอราคานายรชตพล.pdf',NULL,NULL,13,'2021-05-12 06:26:42',NULL,NULL,'\\public\\memo\\FMAFS6412052021\\'),(92,'FM-AFS-64-0004','2021-05-12',1620101079938,'1536712608041','1618888979382','ขออนุมัติเบิกใช้โทรศัพท์มือถือ ส่วนกลาง After Sale','<p>ขออนุมัติเบิกใช้โทรศัพท์มือถือ ส่วนกลาง After Sale</p>\n\n<p>เนื่องจากสายงาน After Sale เป็นงานดูแลบริการลูกค้าหลังการขาย&nbsp; หากลูกบ้านมีปัญหาเที่ต้องการจะเเจ้งซ่อมแซมส่วนต่างๆภายในบ้าน จะต้องติดต่อผ่านAfter Salle เป็นอันดับเเรก เพื่อที่After Sale จะได้ประสานงานติดต่อไปยังทีมวิศวกร เพื่อเข้าตรวจสอบและเเก้ไขให้ลูกบ้านทันที&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1620101079938,1618888979382,1536712608041,0,'',NULL,NULL,13,'2021-05-12 07:51:36',NULL,NULL,''),(93,'FM-AFS-64-0005','2021-05-12',1620101079938,'1536712608041','1531005517521','ขออนุมัติเบิกใช้โทรศัพท์มือถือ ส่วนกลาง  After Sale','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เนื่องจาก After Sale เป็นงานที่ดูแลบริการลูกค้าหลังการขาย&nbsp; ลูกบ้านมีปัญหาที่ต้องการจะแจ้งซ่อมแซมในส่วนต่างๆภายในบ้าน จำเป็นต้องติดต่อผ่าน After Sale&nbsp; เป็นอันดับแรก เพื่อความสะดวกเเละรวดเร็วต่อการติดต่อประสานงานทั้งในเเละนอนสถานที่&nbsp;จึงได้จัดทำขึ้นเพื่อขออนุมัติเบิกใช้โทรศัพท์มือถือ ส่วนกลาง &nbsp;After Sale</p>\n',1620101079938,1618888979382,1536712608041,1,'',NULL,NULL,13,'2021-05-12 08:50:23',NULL,NULL,''),(94,'FM-IT-64-0028','2021-05-13',4,'1536712608041','2,3','ขอเบิกบัตรเครดิตเพื่อชำระค่าบริการ dyndns','<p>เนื่องจากบริการ dyndns จำเป็นต้องชำระค่าบริการด้วยวิธีการตัดผ่านบัตรเครดิต ฝ่ายเทคโนโลยีสารสนเทศจึงรบกวนขอเบิกบัตรเครดิต คุณกิตติพงษ์&nbsp;สุมานนท์ มอบให้กับ คุณธนิต เนตรโพธิ์แก้ว เพื่อดำเนินการชำระค่าบริการดังกล่าวต่อไป</p>\n\n<p>จึงเรียนมาเพื่อโปรดทราบ และ พิจารณาดำเนินการต่อไป</p>\n',1526339054692,0,0,7,'FM-IT-64-0024 ต่อบริการ dyndns 2 ปี.pdf',NULL,NULL,4,'2021-05-13 09:00:47',NULL,NULL,'\\public\\memo\\FMIT6413052021\\'),(95,'FM-ARCH-64-0023','2021-05-14',1566381654308,'1619411569757','10,3','IKP ขออนุมัติส่งมอบงานติดตั้งมิเตอร์ประปาและชิ้นส่วนท่อประปาที่หายไป','<p>โครงการไอเดนเกษตร-พหลโยธิน</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; เนื่องด้วยทางโครงการไอเดนเกษตร-พหลโยธิน ได้ดำเนินการติดตั้งมิเตอร์ประปาแล้วเสร็จในบ้านเลขที่ 35 - 40 และคลับเฮ้าส์ และติดตั้งตัวอุดท่อชิ้นส่วนของประปา&nbsp;&nbsp;ทางฝ่ายบริหารงานโครงการจึงขอส่งรูปเพื่อยืนยันการติดตั้งตามเอกสารแนบดังกล่าว<br>\n<br>\n<br>\nหมายเหตุ -&nbsp; ติดตั้งตัวอุดท่อแล้วเสร็จเมื่อวันที่ 5/4/64&nbsp; &nbsp;&nbsp;&nbsp;-&nbsp; ติดตั้งมิเตอร์ประปาแล้วเสร็จเมื่อวันที่ 3/5/64</p>\n\n<p>&nbsp;</p>\n\n<p>ขอบคุณครับ</p>\n',1566381654308,0,1619411569757,3,'มิเตอร์ประปาเคพี.pdf,ชิ้นส่วนประปาที่หายไป.pdf',NULL,NULL,9,'2021-05-14 09:26:44',NULL,NULL,'\\public\\memo\\FMARCH6414052021\\'),(96,'FM-AFS-64-0006','2021-05-17',1620101079938,'1536712608041','1618888979382,10,8,3,2','ขออนุมัติลดเงินประกันลูกบ้านโครงการICOPENH 88/4  TS','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ตามที่ได้รับเเจ้งจากลูกบ้านโครงการ ICOPENH บ้านเลขที่ 88/4 TS&nbsp;วันที่17 พฤษภาคม 2564 &nbsp;เจ้าของบ้านคุณรัตน์นภา อินถานะ&nbsp; มีความประสงค์จะต่อเติมตกแต่งบ้าน และได้ทราบเงื่อนไขในการวางเงินประกันจำนวน 50,000 บาท เนื่องจากลูกบ้านมีเงินไม่เพียงพอตามจำนวนที่บริษัทไอริส กรุ๊ป จำกัด ได้กำหนดตามระเบียบไว้ ลูกบ้านขอความอนุเคราะห์ขอปรับลดเงินเหลือ จำนวน 20,000 - 30,000&nbsp;บาท จึงได้จัดทำเอกสารเพื่อพิจารณาอนุมัติให้แก่ลูกบ้านต่อไป</p>\n',1620101079938,1618888979382,1536712608041,1,'88-4ICOต่อเติมบ้าน.jpg,88-4 TS ICO.jpg',NULL,NULL,13,'2021-05-17 02:48:35',NULL,NULL,'\\public\\memo\\FMAFS6417052021\\'),(97,'FM-IT-64-0029','2021-05-17',4,'1617075740614','2,3,5','ขออนุมัติสั่งซื้ออุปกรณ์ฮาร์ดดิสก์สำหรับเครื่องเซอเวอร์ JDE Edwards','<p>เนื่องจากบริษัท ไอริส กรุ๊ป จำกัด ได้ใช้โปรแกรม&nbsp;JDE Edwards&nbsp;ของ ORACLE ในการบริหารทรัพยากรองค์กร&nbsp;(ERP)&nbsp;ณ เวลานี้ระบบแจ้งเตือนของเซอเวอร์ ได้แจ้งเตือนความเสียหายของฮาร์ดดิสก์จำนวน 1 ตัว</p>\n\n<p>เพื่อให้การทำงานเป็นไปอย่างราบรื่น ทางฝ่ายเทคโนโลยีสารสนเทศ ขอเสนอให้มีการสั่งซื้ออุปกรณ์ตัวใหม่เพื่อทดแทนในส่วนที่เกิดความเสื่อมสภาพ โดยมีรายละเอียดดังนี้</p>\n\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<thead>\n		<tr>\n			<th scope=\"col\" style=\"text-align: center;\">รายการ</th>\n			<th scope=\"col\" style=\"text-align: center;\">จำนวน</th>\n			<th scope=\"col\" style=\"text-align: center;\">ราคาต่อหน่วย</th>\n			<th scope=\"col\" style=\"text-align: center;\">จำนวนเงิน</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>Dell 600GB 15K RPM SAS 12Gbps 512n 2.5in Hot-plug</td>\n			<td style=\"text-align:center\">1</td>\n			<td style=\"text-align:right\">12,400.00</td>\n			<td style=\"text-align:right\">12,400.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ราคารวม</td>\n			<td style=\"text-align:right\">12,400.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ภาษีมูลค่าเพิ่ม</td>\n			<td style=\"text-align:right\">868.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ราคารวมภาษี</td>\n			<td style=\"text-align:right\">14,136.00</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1617075740614,3,'APS-QT-7-64 ใบเสนอราคา HHD for R740 JDE Server.pdf','2021-06-06 14:10:06',NULL,4,'2021-05-17 07:48:20',NULL,NULL,'\\public\\memo\\FMIT6417052021\\'),(98,'FM-IT-64-0030','2021-05-17',4,'1617075740614','2,3,5','ขออนุมัติสั่งซื้ออุปกรณ์ฮาร์ดดิสก์สำหรับเครื่องเซอเวอร์ JDE Edwards','<p>เนื่องจากบริษัท ไอริส กรุ๊ป จำกัด ได้ใช้โปรแกรม&nbsp;JDE Edwards&nbsp;ของ ORACLE ในการบริหารทรัพยากรองค์กร&nbsp;(ERP)&nbsp;ณ เวลานี้ระบบแจ้งเตือนของเซอเวอร์ ได้แจ้งเตือนความเสียหายของฮาร์ดดิสก์จำนวน 1 ตัว</p>\n\n<p>เพื่อให้การทำงานเป็นไปอย่างราบรื่น ทางฝ่ายเทคโนโลยีสารสนเทศ ขอเสนอให้มีการสั่งซื้ออุปกรณ์ตัวใหม่เพื่อทดแทนในส่วนที่เกิดความเสื่อมสภาพ โดยมีรายละเอียดดังนี้</p>\n\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<thead>\n		<tr>\n			<th scope=\"col\" style=\"text-align: center;\">รายการ</th>\n			<th scope=\"col\" style=\"text-align: center;\">จำนวน</th>\n			<th scope=\"col\" style=\"text-align: center;\">ราคาต่อหน่วย</th>\n			<th scope=\"col\" style=\"text-align: center;\">จำนวนเงิน</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>Dell 600GB 15K RPM SAS 12Gbps 512n 2.5in Hot-plug</td>\n			<td style=\"text-align:center\">1</td>\n			<td style=\"text-align:right\">12,400.00</td>\n			<td style=\"text-align:right\">12,400.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ราคารวม</td>\n			<td style=\"text-align:right\">12,400.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ภาษีมูลค่าเพิ่ม</td>\n			<td style=\"text-align:right\">868.00</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" rowspan=\"1\" style=\"text-align:right\">ราคารวมภาษี</td>\n			<td style=\"text-align:right\">14,136.00</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1617075740614,0,'APS-QT-7-64 ใบเสนอราคา HHD for R740 JDE Server.pdf',NULL,NULL,4,'2021-05-17 07:50:32',NULL,NULL,'\\public\\memo\\FMIT6417052021\\'),(99,'FM-CON-64-0026','2021-05-18',1615426891970,'1536712608041','1619411569757,1531524013391,2,13','ขออนุมัติเบิกเงินประกันผลงานให้แก่ผู้รับเหมา บจก.พี.เค.พี.','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ด้วยทางฝ่ายบริการหลังการขายโครงการไอริสพาร์ค ได้รับข้อร้องเรียนจากลูกบ้าน เรื่องของงานซ่อมแซมบ้านหลังโอนกรรมสิทธิ์&nbsp; จึงได้ประสานให้ทางฝ่ายก่อสร้างได้ดำเนินการให้ผู้รับเหมา บจก.พี.เค.พี.&nbsp;ให้เข้ามาดำเนินงานซ่อมแซมบ้านตามข้อร้องเรียน</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บัดนี้ ทางผู้รับเหมา&nbsp;บจก.พี.เค.พี. ได้เข้ามาดำเนินการซ่อมแซมให้ลูกบ้านแล้วเสร็จ จำนวน 3 แปลง คือ แปลง 217,&nbsp;218, 228 แล้วทางเจ้าของบ้านได้เซนต์รับรองเอกสารตรวจรับงานเรียบร้อยแล้วและมีการแจ้งกับทางเจ้าของบ้านว่าจะไม่มีการซ่อมแซมหลังจากนี้แล้ว</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ทางฝ่ายก่อสร้างได้พิจารณาและทำการต่อรองราคาแล้วเห็นควรอนุมัติเบิกประกันผลงาน จำนวน 40,000.00 บาท โดยรายละเอียดตามเอกสารไฟล์แนบ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp;&nbsp;</p>\n',1615426891970,1619411569757,1536712608041,3,'รายการเบิกหัก PKP IPC.pdf,สรุปงานช่างเชิด.pdf','2021-05-18 09:57:30',NULL,10,'2021-05-18 08:26:25',NULL,NULL,'\\public\\memo\\FMCON6418052021\\'),(100,'FM-CON-64-0027','2021-05-18',1566381381121,'1527894542301','1619411569757','ขอแก้ไขกล้องวงจรปิดทางเข้าออก','<p><strong>I COPENH (Sukhumvit 76) PROJECT</strong></p>\n\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ตามที่หน้างานโครงการ Icopehn ได้มีการเดินตรวจสอบการวางท่อประปาเฟส 1 กับเจ้าหน้าที่การประปานครหลวง แล้วเกิดความเสียหาย&nbsp;ดังนี้</p>\n\n<p>1.ตู้ส่งสัญญาณกล้องวงจรปิดหลังรั้วบ้านแปลง 1 หลุดชำรุดเสียหาย</p>\n\n<p>2.สายสัญญาณกล้องวงจรปิดขาด 3 สายบริเวณข้างป้อม รปภ. ทางเข้า</p>\n\n<p>3.บล๊อคเชื่อมต่อสายสัญญาณใต้ดินชำรุดเสียหาย บริเวณข้างป้อม รปภ. ทางเข้า</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; โดยการดำเนินการดังกล่าวทางบริษัท โฟลบริดคอร์ปอเรชั่น จำกัดได้เข้ามาตรวจสอบหน้างานและได้เสนอราคาซ่อมแซมแก้ไขมาที่ฝ่ายจัดซื้อจัดจ้าง เรียบร้อยแล้ว</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาทราบและโปรดอนุมัติอย่างเร่งด่วน</p>\n',1566381381121,1619411569757,1536712608041,3,'76B-64-0004_เดินสายกล้องวงจรปิด รปภ.pdf','2021-05-18 10:04:11',NULL,10,'2021-05-18 09:52:00',NULL,NULL,'\\public\\memo\\FMCON6418052021\\'),(101,'FM-MKT-64-0009','2021-05-19',7,'1536712608041','5,2,3,1618888979382','ขออนุมัติงบประมาณของรางวัล แคมเปญ Lucky draw Lucky Deal สำหรับโครงการไอโคเปน','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการจัดแคมเปญ&nbsp;Lucky draw Lucky Deal สำหรับโครงการไอโคเปน&nbsp;ระยะเวลาเข้าร่วม ตั้งแต่วันที่ 1&nbsp;มิถุนายน – 31&nbsp;กรกฎาคม 2564 เพื่อกระตุ้นยอดจองและโอนให้บรรลุตามเป้าหมาย (40 ยูนิต) ซึ่งมีของรางวัลสำหรับจับฉลาก รวม 80 รางวัล มูลค่าทั้งสิ้น 4,979,000 บาท&nbsp;รายละเอียดดังนี้</p>\n\n<p>1.ส่วนลดราคาทาวน์โฮม มูลค่า 200,000 บาท จำนวน 20 รางวัล รวม 4,000,000 บาท</p>\n\n<p>2.เครื่องปรับอากาศ beko 4 เครื่อง มูลค่า 50,000 จำนวน 10 รางวัล รวม 500,000 บาท</p>\n\n<p>3.Iphone 12 Mini 64GB มูลค่า 25,900 บาท จำนวน 10 รางวัล รวม 259,000 บาท</p>\n\n<p>4.บัตรกำนัลจาก Homepro มูลค่า 10,000 บาท จำนวน 20 รางวัล รวม 200,000 บาท</p>\n\n<p>5.บัตรกำนัล Starbuck มูลค่า 1,000 บาท จำนวน 20 รางวัล รวม 20,000 บาท</p>\n\n<p>หมายเหตุ 1 : ของรางวัลทั้งหมดจะเพิ่มเติมรายละเอียดในรายการของแถมท้ายสัญญา หมายเหตุ 2 : ลูกค้าจะไปรับสิทธิในการจับฉลากหลังจากโอนกรรมสิทธิ์เรียบร้อยแล้วภายใน 45 วัน</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(กฤศกร ทัพพ์ปัญญา)</p>\n\n<p>&nbsp; &nbsp; &nbsp; ผู้ช่วยผู้จัดการฝ่ายการตลาด</p>\n',1616118836457,1618888979382,1536712608041,0,'',NULL,NULL,7,'2021-05-19 09:48:08',NULL,NULL,''),(102,'FM-MKT-64-0010','2021-05-20',7,'1536712608041','1618888979382,5,3,2','ขออนุมัติงบประมาณของรางวัล แคมเปญ Lucky draw Lucky Deal สำหรับโครงการไอโคเปน','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการจัดแคมเปญ&nbsp;Lucky draw Lucky Deal สำหรับโครงการไอโคเปน&nbsp;ระยะเวลาเข้าร่วม ตั้งแต่วันที่ 1&nbsp;มิถุนายน – 31&nbsp;กรกฎาคม 2564 เพื่อกระตุ้นยอดจองและโอนให้บรรลุตามเป้าหมาย (40 ยูนิต) ซึ่งมีของรางวัลสำหรับจับฉลาก รวม 80 รางวัล มูลค่าทั้งสิ้น 5,029,000 บาท&nbsp;รายละเอียดดังนี้</p>\n\n<p>1.ส่วนลดราคาทาวน์โฮม มูลค่า 200,000 บาท จำนวน 20 รางวัล รวม 4,000,000 บาท</p>\n\n<p>2.เครื่องปรับอากาศ Sharp 4 เครื่อง รวมติดตั้ง มูลค่า 55,000 จำนวน 10 รางวัล รวม 550,000 บาท</p>\n\n<p>3.Iphone 12 Mini 64GB มูลค่า 25,900 บาท จำนวน 10 รางวัล รวม 259,000 บาท</p>\n\n<p>4.บัตรกำนัลจาก Sharp มูลค่า 10,000 บาท จำนวน 20 รางวัล รวม 200,000 บาท</p>\n\n<p>5.บัตรกำนัล Starbuck มูลค่า 1,000 บาท จำนวน 20 รางวัล รวม 20,000 บาท</p>\n\n<p>หมายเหตุ 1 : ของรางวัลทั้งหมดจะเพิ่มเติมรายละเอียดในรายการของแถมท้ายสัญญา หมายเหตุ 2 : ลูกค้าจะไปรับสิทธิในการจับฉลากหลังจากโอนกรรมสิทธิ์เรียบร้อยแล้วภายใน 45 วัน</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(กฤศกร ทัพพ์ปัญญา)</p>\n\n<p>&nbsp; &nbsp; &nbsp; ผู้ช่วยผู้จัดการฝ่ายการตลาด</p>\n',1616118836457,1618888979382,1536712608041,5,'',NULL,NULL,7,'2021-05-20 04:29:04','2021-05-28 03:23:47',NULL,''),(103,'FM-MKT-64-0011','2021-05-20',7,'1536712608041','1618888979382,5,2,3','ขออนุมัติงบประมาณในการทำ Virtual 360 โครงการ ไอเด็น 101/ไอเด็น เกษตร พหลโยธิน/ ไอโคเปน','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการทำ Virtual 360 สำหรับ 3&nbsp;โครงการ&nbsp;ไอเด็น 101/ไอเด็น เกษตร พหลโยธิน/ ไอโคเปน โดยมีรายละเอียดดังนี้</p>\n\n<p>1. โครงการ ไอเด็น 101 ถ่ายทำบ้านตัวอย่าง 1 หลัง + ซุ้มประตู ราคา 40,000 บาท</p>\n\n<p>2. โครงการ ไอเด็น เกษตร พหลโยธิน&nbsp;ถ่ายทำบ้านตัวอย่าง 1 หลัง + ซุ้มประตู ราคา 40,000 บาท</p>\n\n<p>3. โครงการ ไอโคเปน&nbsp;ถ่ายทำบ้านตัวอย่าง 1 หลัง + ซุ้มประตู ราคา 30,000 บาท</p>\n\n<p>รวมงบประมาณที่ขออนุมัติเป็นเงินทั้งสิ้น 110,000 บาท</p>\n\n<p>หมายเหตุ: ราคานี้รวมช่องทางการแสดงผลใน Google Map/Google Street View/ Post แนะนำโครงการใน Facebook home.co.th/ เพิ่มรายละเอียด Virtual 360 ใน website home.co.th</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(กฤศกร ทัพพ์ปัญญา)</p>\n\n<p>&nbsp; &nbsp; &nbsp; ผู้ช่วยผู้จัดการฝ่ายการตลาด</p>\n',1616118836457,1618888979382,1536712608041,1,'',NULL,NULL,7,'2021-05-20 07:56:11',NULL,NULL,''),(104,'FM-MKT-64-0012','2021-05-20',7,'1536712608041','1618888979382,5,3,2','ขออนุมัติงบประมาณในการทำ Digital Video Content Review โครงการ ไอโคเปน (Home Buyer Guide)','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการทำ Digital Video Content Review โครงการ ไอโคเปน (Home Buyer Guide)&nbsp;เพื่อเป็นการนำเสนอข้อมูลโครงการ การเดินทาง วิเคราะห์ทำเล และโปรโมชั่นเด่น (โปร lucky draw) โดยมีพิธีกรคุณแอนดี้ เขมพิมุก ดำเนินรายการสัมภาษณ์เจ้าของโครงการ&nbsp;</p>\n\n<p>ทั้งนี้เป็นช่วงโปรโมชั่นของทาง home.co.th ที่ให้ราคาพิเศษ จาก 130,000 บาท เหลือ 85,000 บาท&nbsp;และแถมฟรีโฆษณาแบบ Ad Zone ในเว็บไซต์ให้เป็นเวลา 1 เดือน มูลค่า 20,000 บาท</p>\n\n<p>งบประมาณที่ขออนุมัติเป็นเงินทั้งสิ้น 85,000 บาท</p>\n\n<p>หมายเหตุ: ราคานี้รวมช่องทางการแสดงผลใน Website หน้าแรก / Facebook Post / Youtube และให้ไฟล์ต้นฉบับมาใช้งานต่อ</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(กฤศกร ทัพพ์ปัญญา)</p>\n\n<p>&nbsp; &nbsp; &nbsp; ผู้ช่วยผู้จัดการฝ่ายการตลาด</p>\n',1616118836457,1618888979382,1536712608041,1,'',NULL,NULL,7,'2021-05-20 09:03:56',NULL,NULL,''),(105,'FM-ARCH-64-0024','2021-05-21',1593074585627,'5','1527894542301,1619411569757','IDEN 101 ขออนุมัติจัดจ้างบริษัททำความสะอาดสระว่ายน้ำ','<p>เนื่องด้วยสระว่ายน้ำโครงการ IDEN 101 เกิดความไม่สะอาดจากตะไคร่น้ำและสิ่งสกปรกที่ตกลงไปเพราะขาดการไหล่เวียนของน้ำและขาดการเติมสารเคมี ทางโครงการ&nbsp; IDEN 101 จึงเห็นควรให้ทางฝ่ายจัดซื้อจัดจ้าง ดำเนินการจัดจ้าง&nbsp;บริษัททำความสะอาดสระว่ายน้ำ ตามราคาที่ได้ตกลงไว้ก่อนหน้าในราคาที่ 1,500 บาทต่อครั้ง ในวันที่ 12 พฤษภาคม 2564&nbsp;</p>\n\n<p>และเห็นควรให้จัดจ้าง&nbsp;&nbsp;บริษัททำความสะอาดสระว่ายน้ำ เข้ามาดูแลในลักษณะรายเดือน (เดือนละ 1 - 2 ครั้ง ) เพื่อความสะอาดของสระว่ายน้ำและความเสถียรของงานระบบสระว่ายน้ำ</p>\n\n<p>จึงเรียนมาเพื่ออนุมัติ</p>\n',1593074585627,1593074585627,1536712608041,5,'IDEN101_SWIMMINGPOOL_PHOTO.jpg',NULL,NULL,9,'2021-05-21 03:41:57',NULL,NULL,'\\public\\memo\\FMARCH6421052021\\'),(106,'FM-ARCH-64-0025','2021-05-21',1566381654308,'1536712608041','10,1619411569757,5','IKP ขออนุมัติล้างแอร์ของบ้านแฝดแปลง 5 และแปลง 6','<p>&nbsp; &nbsp; &nbsp; &nbsp;เนื่องจากหน้างานโครงการไอเดนเกษตร-พหลโยธิน มีความประสงค์อยากจะล้างเครื่องปรับอากาศ&nbsp;เพราะเนื่องจากเครื่องปรับอากาศไม่สามารถทำความเย็นได้เท่าที่ควร และมีฝุ่นเกาะบริเวณเครื่องกรองคอมเพรสเซอร์แอร์จำนวนมาก&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;บ้านหลังที่จะล้างเครื่องปรับอากาศมี บ้านแฝดแปลง 5 จำนวน 3 เครื่อง แบ่งเป็นเครื่องปรับอากาศติดผนัง 2 เครื่อง และ เครื่องปรับอากาศฝังฝ้า 1 เครื่อง ตามเอกสารแนบ และบ้านแฝดแปลง 6 จำนวน 8 เครื่อง&nbsp;แบ่งเป็นเครื่องปรับอากาศติดผนัง 6&nbsp;เครื่อง และ เครื่องปรับอากาศฝังฝ้า 2&nbsp;เครื่อง ตามเอกสารแนบ</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;จึงเรียนมาขออนุมัติ</p>\n',1566381654308,1619411569757,1536712608041,5,'ล้างแอร์.pdf','2021-05-22 08:01:18',NULL,9,'2021-05-21 10:15:03',NULL,NULL,'\\public\\memo\\FMARCH6421052021\\'),(107,'FM-MKT-64-0013','2021-05-24',7,'1536712608041','1618888979382,2,3','ขออนุมัติ ค่าดำเนินการค่าปรับป้ายโฆษณา โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;เนื่องด้วยฝ่ายการตลาดได้มีการลงป้ายโฆษณาโครงการ ICOPENH บริเวณถนนสุขุมวิท และ ถนนปู่เจ้าสมิงพราย สมุทรปราการ ประจำปี 2564 ในทุกเดือนของปี ซึ่งกิจกรรมดังกล่าวเป็นการติดตั้งป้ายบนพื้นที่เทศบาลเมืองปู่เจ้าสมิงพราย สมุทรปราการ</p>\n\n<p>&nbsp; &nbsp; &nbsp;เพื่อให้การดำเนินงานเป็นไปด้วยความเรียบร้อย ทางฝ่ายการจึงจะขออนุมัติค่าใช้จ่ายให้เจ้าหน้าที่ (เทศกิจ) ช่วยอำนวยความสะดวกในการติดตั้งป้าย จากเดิม ชำระจำนวนเงิน 5,000 บาท (ห้าพันบาทถ้วน) ให้กับทางเทศบาลเมืองปู่เจ้าสมิงพราย สมุทรปราการ&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;<strong>ฝ่ายการตลาดได้มีการเจรจาต่อรอง เหลือ 3,000 บาท (สามพันบาทถ้วน) ต่อเดือน รายละเอียดดังนี้ โดยชำระเป็นเงินสด แบ่งออกเป็น มีใบเสร็จ และไม่มีใบเสร็จ สลับกันในแต่ละเดือน ชำระผ่านการโอนเข้าบัญชี ธนาคารกสิกรไทย เลขบัญชี 008-3-22658-7 ชื่อบัญชี น.ส. ปุณยนุช สุขเกตุ (ตามเอกสารแนบ)&nbsp;รายละเอียดดังนี้&nbsp;</strong></p>\n\n<p><strong>1. เดือนพฤษภาคม / กรกฎาคม / กันยายน / พฤศจิกายน เป็นการชำระแบบ&nbsp;ไม่มีใบเสร็จ&nbsp;</strong></p>\n\n<p><strong>2. เดือนมิถุนายน / สิงหาคม / ตุลาคม / ธันวาคม เป็นการชำระแบบ มีใบเสร็จ โดยทางเจ้าหน้าที่เทศกิจ จะนำใบเสร็จรับเงินนำส่งให้ที่สำนักงานขาย โครงการ ICOPENH</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อทราบ และขออนุมัติเงินจำนวนดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;(ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; Chief Operation Officer (Operation)</p>\n',1525042815017,1612152002474,1536712608041,5,'842021_๒๑๐๔๒๑_78.jpg,S__1310727.jpg,S__1310729.jpg',NULL,NULL,7,'2021-05-24 06:42:51',NULL,NULL,'\\public\\memo\\FMMKT6424052021\\'),(108,'FM-BD-64-0003','2021-05-25',1616990700928,'1536712608041','1583315519071,1531524013391','ขอเบิกเงินทดรองสำหรับจัดประชุมผู้ถือหุ้นกู้','<p>&nbsp; เนื่องด้วยมีการจัดงานประชุมผู้ถือหุ้นกู้รุ่น IRIS216A และ&nbsp;IRIS219A ในวันที่ 1/6/64&nbsp;ณ บริษัทหลักทรัพย์ เคทีบีเอสที จำกัด (มหาชน)&nbsp;อาคารซีอาร์ซี ทาวเวอร์ ออลซีซั่นส์ เพลส ชั้นที่ 52 งานจะมีจัด 2 ช่วงคือ 10.30 น. และ 13.30 น. โดยจะมีผู้ถือหุ้นกู้เข้าร่วมประชุมประมาณ 20 คนต่อรอบ จึงขอเบิกเงินทดรองจ่ายจำนวน 10,000 บาท สำหรับใช้รับรองงานประชุมผู้ถือหุ้นกู้ดังกล่าว</p>\n',1616990700928,0,1536712608041,3,'',NULL,NULL,12,'2021-05-25 08:59:36',NULL,NULL,''),(109,'FM-IT-64-0031','2021-05-27',4,'1536712608041','5,2,3','ขออนุมัติสั่งซื้อคอมพิวเตอร์โน๊ตบุ๊ค 2 in 1 สำหรับคุณชัชชนก เตชะวณิช','<p>เนื่องจากคุณชัชชนก&nbsp;เตชะวณิช ต้องการใช้งานเครื่องคอมพิวเตอร์ที่มีน้ำหนักเบา และ สามารถสั่งงานด้วยการสัมผัสหน้าจอได้</p>\n\n<p>ฝ่ายเทคโนโลยีสารสนเทศไม่มีอุปกรณ์ที่ตรงตามความต้องการของคุณชัชชนก จึงได้ดำเนินการจัดหาผลิตภัณฑ์ที่ตอบสนองตามความต้องการดังกล่าวโดยมีรายละเอียดตามรายการดังนี้</p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center\">รายการ</td>\n			<td style=\"text-align:center\">จำนวน</td>\n			<td style=\"text-align:center\">ราคาต่อหน่วย</td>\n			<td style=\"text-align:center\">จำนวนเงิน</td>\n		</tr>\n		<tr>\n			<td colspan=\"1\" rowspan=\"7\" style=\"text-align:left; vertical-align:top\">Notebook 2 in 1 Microsoft Surface Go2 P/8/128<br>\n			OS:&nbsp;Windows 10 Home in S mode<br>\n			CPU: Intel Pentium GOLD 4425Y<br>\n			RAM 8GB / SSD 128 GB<br>\n			Dispalay 10.5\" PixelSense 1920x1280 (10 point multi touch)<br>\n			+ Surface GO Type Cover Charcoal (keyboard)<br>\n			+ Surface Pen Charcoal</td>\n			<td colspan=\"1\" rowspan=\"4\" style=\"text-align:center; vertical-align:top\">1</td>\n			<td colspan=\"1\" rowspan=\"4\" style=\"text-align:center; vertical-align:top\">23,831.78</td>\n			<td style=\"text-align:center\">23,831.78</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" rowspan=\"1\" style=\"text-align:right\">ราคารวม</td>\n			<td style=\"text-align:right\">23,831.78</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" rowspan=\"1\" style=\"text-align:right\">ภาษีมูลค่าเพิ่ม 7%</td>\n			<td style=\"text-align:right\">1,668.22</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" rowspan=\"1\" style=\"text-align:right\">ราคารวมทั้งสิ้น</td>\n			<td style=\"text-align:right\">25,500.00</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1527376046432,1617075740614,1536712608041,1,'',NULL,NULL,4,'2021-05-27 08:34:52',NULL,NULL,''),(110,'FM-MKT-64-0014','2021-05-31',7,'1536712608041','1618888979382,6,5,3,2','ขออนุมัติงบประมาณในการทำ Video Orientation','<p>&nbsp;</p>\n\n<p>เนื่องด้วยฝ่ายทรัพยากรบุคคลและฝ่ายการตลาด มีการวางแผนงานในการทำ&nbsp;Video Orientation เพื่อเป็นการนำเสนอข้อมูลต่างๆ ที่เกี่ยวข้องกับบริษัท ได้แก่ วิสัยทัศน์ พันธกิจ ข้อมูลโครงการที่ผ่านมาและโครงการปัจจุบัน โครงสร้างองค์กร บริษัทในเครือ และข้อมูลอื่นๆ ที่จำเป็น เพื่อใช้ในการประชาสัมพันธ์ด้าน Branding ให้กับลูกค้าและพนักงานต่อไป</p>\n\n<p>งบประมาณที่ขออนุมัติ ประมาณ 200,000 บาท (ราคาอาจมีการเปลี่ยนแปลง)</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;(ทะยานชล วงศ์ศรีสกุลแก้ว)</p>\n\n<p>&nbsp; &nbsp; COO (Admin) and HR Director</p>\n',1616118836457,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-05-31 06:04:37','2021-05-31 06:41:57',NULL,''),(111,'FM-MKT-64-0015','2021-05-31',7,'1536712608041','1618888979382,2,5,3','ขออนุมัติงบประมาณในการซื้อโฆษณาออนไลน์ ประจำเดือนมิถุนายน 2564 สำหรับ 3 โครงการ / ไอโคเปน / ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน','<p>เนื่องด้วยฝ่ายการตลาดมีการวางแผนงานในการจัดทำโฆษณาออนไลน์ประจำเดือนมิถุนายน 2564 สำหรับ 3&nbsp;โครงการ&nbsp;ไอโคเปน /&nbsp;ไอเด็น 101 / ไอเด็น เกษตร-พหลโยธิน โดยเริ่มตั้งแต่วันที่ 1 - 30&nbsp;มิถุนายน 2564 มีรายละเอียด ดังนี้</p>\n\n<p>- ค่าโฆษณาผ่านทาง Facebook รวมเป็นเงิน 110,000 บาท สำหรับ 5&nbsp;โครงการ ได้แก่</p>\n\n<p>1. ไอโคเปน&nbsp; 70,000 บาท&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2. ไอเด็น 101&nbsp; 20,000 บาท&nbsp; &nbsp; &nbsp; &nbsp;3. ไอเด็น เกษตร-พหลโยธิน 20,000 บาท</p>\n\n<p>- ค่าโฆษณาผ่านทาง Google สำหรับ 3&nbsp;โครงการ โครงการละ 6,000 บาท รวมเป็นเงิน 18,000 บาท ได้แก่</p>\n\n<p>1.&nbsp;ไอโคเปน&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2. ไอเด็น 101&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. ไอเด็น เกษตร - พหลโยธิน</p>\n\n<p>รวมงบประมาณที่ขออนุมัติเป็นเงินทั้งสิ้น 128,000 บาท</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ชัชชนก เตชะวณิช)</p>\n\n<p>Chief Operation Officer (operation)</p>\n',1616118836457,1612152002474,1536712608041,0,'',NULL,NULL,7,'2021-05-31 06:49:01',NULL,NULL,''),(112,'FM-CON-64-0028','2021-06-02',1566381381121,'1527894542301','1619411569757','ขอทำความสะอาดสระว่ายน้ำ','<p><strong>I COPENH (Sukhumvit 76) PROJECT</strong></p>\n\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; เนื่องด้วยฝ่ายก่อสร้าง ได้ตรวจสอบสระว่ายน้ำบริเวณสโมสรของโครงการ แล้วได้พบปัญหาที่เกิดขึ้นกับสระว่ายน้ำ รายละเอียดดังต่อไปนี้</p>\n\n<p>1.ตะไคร้ขึ้น น้ำมีสีเขียว ก้นสระมีตระกอน แก้ไขเมื่อวันที่ 3/4/2564 เป็นจำนวนเงิน 1,000 บาท</p>\n\n<p>2.ตะไคร้ขึ้น น้ำมีสีเขียว ก้นสระมีตระกอน แก้ไขเมื่อวันที่ 12/5/2564 เป็นจำนวนเงิน 2,500 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;โดยการดำเนินการดังกล่าวทางผู้รับเหมาคิดค่าใช้จ่ายรวมทั้งสิน 3,500 บาท</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อโปรดทราบและเพื่ออนุมัติ</p>\n',1566381381121,1619411569757,1536712608041,6,'',NULL,NULL,10,'2021-06-02 05:18:17',NULL,NULL,''),(113,'FM-MKT-64-0016','2021-06-02',7,'1536712608041','1618888979382,2,3,5','ขออนุมัติงบประมาณในการทำสื่อ PR','<p>เนื่องด้วยฝ่ายการตลาด มีการวางแผนงานในการทำสื่อ PR (Public Relations) ในช่วงไตรมาส 3 - 4 ปี 2564 เพื่อเป็นการสื่อสารไปยังลูกค้าและประชาชนทั่วไป&nbsp;เพื่อสร้างความเข้าใจ สร้างภาพลักษณ์ที่ดี สร้างความน่าเชื่อถือ และเพื่อให้เป็นที่รู้จักในวงกว้าง&nbsp;โดยมีจุดประสงค์หลักให้เกิดความชื่นชอบและประทับใจในองค์กรเพิ่มมากขึ้น</p>\n\n<p>งบประมาณที่ขออนุมัติ ประมาณ 150,000 บาท (ราคาอาจมีการเปลี่ยนแปลง)</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ชัชชนก เตชะวณิช)</p>\n\n<p>Chief Operation Officer (operation)</p>\n',1616118836457,1612152002474,1536712608041,5,'',NULL,NULL,7,'2021-06-02 06:40:11',NULL,NULL,''),(114,'FM-CON-64-0029','2021-06-02',1566381381121,'1527894542301','1619411569757','ขอทำความสะอาดสระว่ายน้ำ','<p><strong>I COPENH (Sukhumvit 76) PROJECT</strong></p>\n\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; เนื่องด้วยฝ่ายก่อสร้าง ได้ตรวจสอบสระว่ายน้ำของสโมสร พบว่าเจอปัญหาภายในสระว่ายน้ำ โดยมีรายละเอียดดังนี้</p>\n\n<p>1.ตะไคร้ขึ้นบนผิวน้ำ น้ำมีสีเขียว มีตะกอนก้นสระ น้ำมีกลิ่น จึ่งมีการแก้ไขเมื่อวันที่ 3/4/2564 เป็นจำนวนเงิน 1,000 บาท</p>\n\n<p>2.ตะไคร้ขึ้นบนผิวน้ำ น้ำมีสีเขียว มีตะกอนก้นสระ น้ำมีกลิ่น จึ่งมีการแก้ไขเมื่อวันที่ 13/5/2564 เป็นจำนวนเงิน 1,000 บาท</p>\n\n<p>3.ตะไคร้ขึ้นบนผิวน้ำ น้ำมีสีเขียว มีตะกอนก้นสระ น้ำมีกลิ่น จึ่งมีการแก้ไขเมื่อวันที่ 14/5/2564 เป็นจำนวนเงิน 1,000 บาท</p>\n\n<p>4.เติมเกลือเพื่อปรับสภาพน้ำ จึงมีการแก้ไขเมื่อวันที่ 14/5/2564 เป็นจำนวนเงิน 500 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; โดยการดำเนินการดังกล่าวทางผู้รับเหมาคิดค่าใช้จ่ายรวมทั้งสิ้น 3,500 บาท&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;จึงเรียนมาเพื่อโปรดทราบและเพื่ออนุมัติ</p>\n',1566381381121,1619411569757,1536712608041,5,'','2021-06-04 03:52:52',NULL,10,'2021-06-02 08:18:59',NULL,NULL,''),(115,'FM-ARCH-64-0026','2021-06-08',1566381654308,'1536712608041','1619411569757,10,5,9','Ico เปลี่ยนกระเบื้องหน้าบ้าน Type L ','<p>เนื่องจากหน้างานมีการแจ้งว่ากระเบื้องที่ปูบ้าน L ของโครงการ ICO ของไม่พอและไม่มีการนำเข้าในส่วนของกระเบื้องยี่ห้อ&nbsp;&nbsp;kerano รุ่น ฮิลล์</p>\n\n<p>จึงขอส่งรูปแบบแก้ไขใหม่ ตามไฟล์แนบข้างต้น&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>เรียนมาเพื่อโปรดอนุมัติ</p>\n',1566381654308,1619411569757,1536712608041,5,'ICO_210604_กระเบื้องหน้าบ้านL (edit).pdf,ICO_210604_แก้ไขกระเบื้องหน้าบ้าน.pdf',NULL,NULL,9,'2021-06-08 05:28:03',NULL,NULL,'\\public\\memo\\FMARCH6408062021\\'),(116,'FM-ARCH-64-0027','2021-06-08',1566381654308,'1536712608041','1619411569757,5,10,1618888979382','IKP ขออนุมัติติดตั้งมอเตอร์ประตูหน้าโครงการบริเวณป้อมยาม','<p>เนื่องจากทางหน้างานโครงการไอเดนเกษตร พหลโยธิน มีความต้องการติดตั้งมอเตอร์ล้อเลื่อนในตำแหน่งประตูทางเข้าหน้าโครงการ บริเวรป้อมยาม เพื่อเป็นภาพลักษณ์ให้โครงการ</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อขออนุมัติ</p>\n',1566381654308,1618888979382,1536712608041,1,'1623141095252.jpg,IKP_ใบเสนอราคามอเตอร์ประตูทางเข้า_แอคคาส.pdf,IKP_ใบเสนอราคามอเตอร์ประตูทางเข้า_โฟลบริค.pdf,IKP_ตารางเทียบมอเตอร์ประตูทางเข้าโครงการตามCommentออฟ.pdf',NULL,NULL,9,'2021-06-08 08:37:25',NULL,NULL,'\\public\\memo\\FMARCH6408062021\\'),(117,'FM-ARCH-64-0028','2021-06-08',1566381654308,'1536712608041','1619411569757,5,10,1618888979382','IKP ขออนุมัติติดตั้งมอเตอร์ประตูหน้าโครงการบริเวณป้อมยาม','<p>เนื่องจากทางหน้างานโครงการไอเดนเกษตร พหลโยธิน มีความต้องการติดตั้งมอเตอร์ล้อเลื่อนในตำแหน่งประตูทางเข้าหน้าโครงการ บริเวรป้อมยาม เพื่อเป็นภาพลักษณ์ให้โครงการ</p>\n\n<p>&nbsp;</p>\n\n<p>จึงเรียนมาเพื่อขออนุมัติ</p>\n',1566381654308,1618888979382,1536712608041,1,'1623141095252.jpg,IKP_ใบเสนอราคามอเตอร์ประตูทางเข้า_แอคคาส.pdf,IKP_ใบเสนอราคามอเตอร์ประตูทางเข้า_โฟลบริค.pdf,IKP_ตารางเทียบมอเตอร์ประตูทางเข้าโครงการตามCommentออฟ.pdf',NULL,NULL,9,'2021-06-08 08:39:25',NULL,NULL,'\\public\\memo\\FMARCH6408062021\\'),(118,'FM-SALE-64-0001','2021-06-09',1620980894197,'1536712608041','2,3,11','ขออนุมัติเพิ่มผลตอบแทนให้พนักงานขาย','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จากการประชุมฝ่ายขาย เมื่อวันที่ 19 ตุลาคม 2563เรื่อง Sale Commission ที่ประชุมมีมติ</p>\n\n<p>เห็นชอบจ่ายผลตอบแทนพนักงานขาย (คอมมิชชั่น)เพื่อเป็นแรงจูงใจในการขาย และเพิ่มยอดขายใน</p>\n\n<p>สถานการณ์ปัจจุบัน ให้มากยิ่งขึ้น โดยกำหนดตั้งแต่ 19/10/63 ที่ผ่านมา ให้มีผลถึงวันที่ 31/12/2564</p>\n\n<p>1.พนักงานขายจะได้รับค่าคอมมิชชั่นทั้ง 8 โครงการ ดังนี้&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; a .โครงการ IDEN-KP</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน 1-2 &nbsp;Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp; 3 Unit &nbsp;&nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp;4+Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; b.โครงการ IDEN101</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน &nbsp;&nbsp;&nbsp;1 Unit ค่าตอบแทนร้อยละ &nbsp;0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp; 2 Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp; &nbsp;3+Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; c.โครงการ I-COPENH</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 1-2 Unit &nbsp;ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 3-4 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 5-6 Unit &nbsp;ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; &nbsp;7+Unit &nbsp;ค่าตอบแทนร้อยละ 0.30 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; d.โครงการ IRIS-PARK</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; &nbsp; 1 Unit ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 2-3 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน &nbsp;&nbsp;&nbsp;4 Unit ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; &nbsp;5+Unit&nbsp; ค่าตอบแทนร้อยละ 0.30 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; e.โครงการ IRIS-WESTGATE</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน &nbsp;1-3&nbsp; Unit ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน &nbsp;4-5&nbsp; Unit ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน &nbsp;6-9&nbsp; Unit ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; 10+ Unit ค่าตอบแทนร้อยละ 0.30 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; f. โครงการ VENIS-THE-IRIS</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอนต่อ &nbsp;1 Unit ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; g. โครงการ THE-IRIS ศรีนครินทร์</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;ยอดโอนต่อ&nbsp; &nbsp;ห้องละ&nbsp;10,000 บาท</p>\n\n<p>2.เพื่อให้บริษัทบรรลุเป้าหมายการขาย</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -กรณีทำได้ ตามเป้าหมาย <strong>ฝ่ายขาย</strong> จะได้รับค่าตอบแทนเพิ่ม 0.10% ของยอดโอน ตามสัดส่วนแต่ละ&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>โครงการ และเบิกจ่ายในเดือนถัดไป</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-กรณีขายได้ ต่ำกว่าเป้าหมาย แต่ได้70 % ขึ้นไป รับค่าตอบแทนเพิ่ม 0.05 %ของยอดโอน</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-กรณีขายได้ เกินเป้าหมาย 110% ขึ้นไป รับIncentive เพิ่ม 10,000บาท</p>\n\n<p>เงื่อนไขเพิ่มเติม</p>\n\n<p>พนักงานขายจะได้รับคอมมิชชั่น ตามเงื่อนไขดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-สรุปยอดทำสัญญาในสิ้นเดือนนั้นๆ กรณี บ้านพร้อมโอน ต้องโอนภายใน 30 วัน นับจากวันจอง&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หากเลยกำหนด คอมมิชชั่นลดลง0.05% เฉพาะแปลงนั้นๆ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -กรณีบ้านไม่พร้อมโอน คิดค่าคอมมิชชั่นตามยอดที่ทำสัญญาในสิ้นเดือนนั้นๆ และต้องโอนภายใน</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 30วัน นับจากบ้านเสร็จ หากเลยกำหนด คอมมิชชั่นลดลง 0.05%เฉพาะแปลงนั้นๆ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-Commission/Incentive จะได้ในเดือนถัดไป หลังจากเดือนโอนกรรมสิทธิ์</p>\n\n<p>&nbsp;3. ปฎิบัติตาม Service Agreement</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-กรอกLeads ครบ ตัดยอดทุกวันศุกร์ และตอบคำถามลุกค้าผ่าน Social(ตารางที่1)+500บ./เดือน</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-คงสภาพการเป็นพนักงาน จนถึงวันจ่ายCommission</p>\n\n<p>รายละเอียด/เอกสารประกอบการเบิก</p>\n\n<ol>\n	<li>ส่งสรุปตั้งเบิกภายในวันที่ 10 ของเดือนถัดไป</li>\n	<li>ตารางสรุปโอนฯ ยอดรับรู้รายได้ประจำเดือนโดยมีผู้บริหารลงนามอนุมัติ</li>\n	<li>Memo ข้อกำหนดการเบิกจ่าย Incentiveโดยมีผู้บริหารลงนามอนุมัติ</li>\n</ol>\n\n<p>&nbsp; จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ลงชื่อ....................................ผู้อนุมัติ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ประธานเจ้าหน้าที่บริหาร</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;......../........../...........</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1620980894197,0,0,5,'',NULL,NULL,11,'2021-06-09 09:44:04',NULL,NULL,''),(119,'FM-SALE-64-0002','2021-06-09',1620980894197,'1536712608041','2,3,11','ขออนุมัติเพิ่มผลตอบแทนพิเศษฝ่ายขาย','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จากการประชุมฝ่ายขาย เมื่อวันที่ 19 ตุลาคม 2563เรื่อง Sale Commission ที่ประชุมมีมติ</p>\n\n<p>เห็นชอบจ่ายผลตอบแทนฝ่ายขาย&nbsp;นอกเหนือจาก Commission PSS (Profit Selling Sharing) คือ</p>\n\n<p>ส่วนแบ่งการขายของผลกำไร ในกรณีที่ฝ่ายขายนำเสนอขายกับลูกค้าโดย ไม่ได้เสนอโปรชั่นทั้งหมด</p>\n\n<p>ตามMarginที่บริษัทกำหนดไว้ และราคาที่เสนอขายไม่ต่ำกว่าราคาขายสุทธิของฝ่ายขาย ฝ่ายขายจะ</p>\n\n<p>ได้รับส่วนต่างที่เหลือของโปรโมชั่นที่เสนอขายลูกค้าไป โดยแบ่งระยะเวลา</p>\n\n<p>1.ระยะเวลา 1 เม.ย. 2564 – 31 พ.ค. 2564 ฝ่ายขายจะได้รับ 100%</p>\n\n<p>2.ระยะเวลา 1 &nbsp;มิ.ย. 2564 – 31 ธ.ค. 2564 ฝ่ายขายจะได้รับ&nbsp; &nbsp;80%</p>\n\n<p>ชึ่งจะได้รับ หลังจากโอนกรรมสิทธิ์เรียบร้อยแล้ว และเบิกจ่ายได้ในเดือนถัดไปพร้อมคอมมิชชั่น</p>\n\n<p>**หากเป็นผลงานการขายของฝ่ายขาย(คนเก่าลาออก)ได้ขายไว้ และฝ่ายขาย(คนใหม่)เก็บเอกสารดูแลต่อ</p>\n\n<p>จะได้รับดังนี้</p>\n\n<p>ระยะเวลา 1 เม.ย. 2564 – 31 ธ.ค. 2564 ฝ่ายขาย (คนใหม่) จะได้รับ&nbsp; &nbsp;50% จากผลตอบแทนคนเก่า</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbs