p; &nbsp; &nbsp;(กิตติพงษ์ สุมานนท์)</p>\n\n<p>&nbsp; &nbsp;Chief Operation Officer(Operation)&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ประธานเจ้าหน้าที่บริหาร&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n',1620980894197,0,0,7,'',NULL,NULL,11,'2021-06-09 10:12:50',NULL,NULL,''),(120,'FM-AFS-64-0007','2021-06-10',1620101079938,'1536712608041','1618888979382,10,2','ขออนุมัติจัดจ้างบริษัทพีเคพีก่อสร้าง (2017)จำกัดเข้าซ่อมแซมบ้านแปลงที่ 220 IPC','<p>เนื่องจากได้รับเรื่องการแจ้งซ่อมของบ้านลูกบ้านแปลง 49/220 &nbsp;คุณ ปรียาลักษณ์ บุญมั่นโครงการ Iris park ลูกบ้านได้ โอนกรรมสิทธิ์เมื่อวันที่ 19/9/2018และวันหมดการรับประกันทั่วไป 19/9/2019ลูกบ้านได้มีการแจ้งซ่อมก่อนหมดการรับประกันไว้กับคุณเก๋ AFTER SALE และเคยได้รับการแก้ไขมาแล้ว &nbsp;แต่ก็กลับมาเป็นเหมือนเดิม ลูกบ้านจึงขอแจ้งความประสงค์ ให้เข้าดำเนินการแก้ไขซ่อมให้ AFTER SALE &nbsp;ได้ประสานงานกับวิศวกรเข้าตรวจสอบ พบว่าควรได้รับการแก้ไขจากงานเดิม (ตามรูปและรายละเอียดในเอกสารแนบ) โดยมีรายการแจ้งซ่อมดังนี้&nbsp;</p>\n\n<p>1แก้ไขเชิงชายรอบบ้าน<br>\n2แก้ไขรอยแตกร้าวและรอยต่อทั้งหมด<br>\n3ซ่อมงานบันได<br>\n4แก้ไขน้ำซึมจากหน้าต่าง<br>\n5แก้ไขงานฝ้าหลังคา<br>\nทาง AFTER SALE จึงได้ประสานงานกับผู้ที่เกี่ยวข้องเพื่อให้เสนอราคางานซ่อมตามที่แจ้งข้างต้น โดยได้มีการเจรจาต่อรอง ราคาเรียบร้อยแล้ว<br>\n&nbsp; &nbsp; โดยขออนุม้ติว่าจ้างให้ บริษัท พีเคเพี ก่อสร้าง (2017) จำกัด เป็นผู้เข้าไปดำนเนิการซ่อม ด้วยมูลค่าสุทธิ &nbsp;38,520 บาท ซึ่งค่าใช้ที่เกิดขึ้น &nbsp;จะเป็นค่าใช้จ่ายของทางบริษัท ไอริส กรุ๊ป จำกัด เพื่อใช้ในการดำเนินการแก้ไขซ่อมแซมให้ลูกบ้าน<br>\nจึงได้จัดทำเอกสารเพื่อขออนุมัติและจะได้ดำเนินการซ่อมให้แก่ลูกบ้านต่อไป</p>\n',1620101079938,1618888979382,1536712608041,1,'MEMO220.pdf',NULL,NULL,13,'2021-06-10 02:34:28',NULL,NULL,'\\public\\memo\\FMAFS6410062021\\'),(121,'FM-AFS-64-0008','2021-06-10',1620101079938,'1536712608041','1618888979382','ขออนุมัติจัดจ้างบริษัทพีเคพีก่อสร้าง (2017)จำกัดเข้าซ่อมแซมบ้านแปลง224 IPC','<p>เนื่องจากได้รับเรื่องการแจ้งซ่อมของบ้านลูกบ้านแปลง 49/224 &nbsp;คุณ จิรณัชชา สมเสียง โครงการ Iris park ลูกบ้านได้ โอนกรรมสิทธิ์เมื่อวันที่ 29/6/2018และได้หมดการรับประกันทั่วไป 29/6/2019 ลูกบ้านได้มีการแจ้งซ่อมก่อนหมดการรับประกันไว้กับคุณเก๋ AFTER SALE และเคยได้รับการแก้ไขมาแล้ว จำนวน 3 ครั้ง แต่ก็กลับมาเป็นเหมือนเดิม ลูกบ้านจึงขอแจ้งความประสงค์ ให้เข้าดำเนินการแก้ไขซ่อมให้ AFTER SALE &nbsp;ได้ประสานงานกับวิศวกรเข้าตรวจสอบ พบว่าควรได้รับการแก้ไขจากงานเดิม (ตามรูปและรายละเอียดในเอกสารแนบ) โดยมีรายการแจ้งซ่อมดังนี้&nbsp;<br>\n1แก้ไขน้ำซึมด้านข้างทั้งหมด<br>\n2รื้อเปลี่ยนบัวใหม่<br>\n3เก็บงานทาสี<br>\n4แก้ไขน้ำซึมจากห้องน้ำชั้น 2<br>\n5แก้ไขน้ำซึมจากหน้าต่างทุกบาน<br>\n6แก้ไขรอยแตกร้าว หน้าระเบียงและด้านข้าง</p>\n\n<p><br>\nทาง AFTER SALE จึงได้ประสานงานกับผู้ที่เกี่ยวข้องเพื่อให้เสนอราคางานซ่อมตามที่แจ้งข้างต้น โดยได้มีการเจรจาต่อรอง ราคาเรียบร้อยแล้ว<br>\n&nbsp; &nbsp; โดยขออนุม้ติว่าจ้างให้ บริษัท พีเคเพี ก่อสร้าง (2017) จำกัด เป็นผู้เข้าไปดำนเนิการซ่อม ด้วยมูลค่าสุทธิ &nbsp;40,660 บาท ซึ่งค่าใช้ที่เกิดขึ้น &nbsp;จะเป็นค่าใช้จ่ายของทางบริษัท ไอริส กรุ๊ป จำกัด เพื่อใช้ในการดำเนินการแก้ไขซ่อมแซมให้ลูกบ้าน<br>\nจึงได้จัดทำเอกสารเพื่อขออนุมัติและจะได้ดำเนินการซ่อมให้แก่ลูกบ้านต่อไป</p>\n',1620101079938,1618888979382,1536712608041,1,'MEMO 224.pdf',NULL,NULL,13,'2021-06-10 02:34:37',NULL,NULL,'\\public\\memo\\FMAFS6410062021\\'),(122,'FM-SALE-64-0003','2021-06-10',1620980894197,'1536712608041','2,3,11','อัตราค่าตอบแทน ทีมSALE AGENCY','<p>&nbsp; &nbsp; &nbsp; เนื่องด้วยปัจจุบันมีการเพิ่มช่องทางการขายด้วยการเปิดรับตัวแทนขาย(Agent) ของทุกโครงการ มีทั้งตัวแทนขายในรูปแบบบริษัทและตัวแทนอิสระ ซึ่งมีทีมSale Agency คอยSupport ข้อมูลเพื่อให้การดำเนินงานของตัวแทนขายเป็นไปอย่างราบรื่น จึงมีการสร้าง