ละตัวแทนอิสระ ซึ่งมีทีม Sale Agency คอย Support ข้อมูลเพื่อให้การดำเนินงานของตัวแทนขายเป็นไปอย่างราบรื่น จึงมีการสร้างแรงจูงใจ จากที่มียอดขายและโอน(จากAgent) ให้กับทีม Sale Agency ด้วยการกำหนดอัตราค่าตอบแทนของยอดโอน แต่ละโครงการ ดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<table align=\"center\" cellspacing=\"0\" style=\"border-collapse:collapse; width:376px\">\n	<tbody>\n		<tr>\n			<td colspan=\"3\" style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:.7px solid black; border-top:none; height:33px; vertical-align:middle; white-space:nowrap; width:207px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; โครงการ</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:1px solid black; border-top:none; text-align:center; vertical-align:middle; white-space:nowrap; width:169px\">&nbsp; ค่าตอบแทน/ยูนิต (บาท)</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:.7px solid black; border-top:1px solid black; height:21px; vertical-align:bottom; white-space:nowrap\">ไอริส แอเวนิว ลาดกระบัง(IA)</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; text-align:center; vertical-align:bottom; white-space:nowrap\">500</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:none; border-top:1px solid black; height:21px; vertical-align:bottom; white-space:nowrap\">ดิ ไอริส พระราม9-ศรีนครินทร์(TIR)</td>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; text-align:center; vertical-align:bottom; white-space:nowrap\">10,000</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:none; border-top:1px solid black; height:20px; vertical-align:bottom; white-space:nowrap\">เวนิช ดิ ไอริส วัชรพล</td>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; text-align:center; vertical-align:bottom; white-space:nowrap\">700</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;......................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;( คุณถิรณิชา วะสุวัชร์ )</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ฝ่ายตัวแทนขาย( SALE AGENCY)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;..........................................&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;.......................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ( คุณชัชชนก เตชะวณิช )&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;( คณกิตติพงษ์ สุมานนท์ )</p>\n\n<p>&nbsp; &nbsp;Chief Operation Officer(Operation)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ประธานเจ้าหน้าที่บริหาร</p>\n',1620980894197,0,0,7,'',NULL,NULL,11,'2021-06-10 04:44:55',NULL,NULL,''),(124,'FM-IT-64-0032','2021-06-14',4,'1536712608041','5','ขออนุมัติต่อสัญญาเช่าคอม บริษัท เทคสไตล์ จำกัด','<p>เนื่องจากสัญญาเช่าคอมเก่า จะหมดลงในวันที่ 16/6/2564 ซึ่งเป็นคอมพิวเตอร์ที่ใช้งานทั้งในฝ่ายบัญชีการเงิน และจัดซื้อ ซึ่งจำเป็นต้องใช้งานในปัจจุบัน</p>\n\n<p>&nbsp; ดังนั้นทางฝ่าย ไอที จึงขออนุมัติต่อสัญญาเช่าคอม รายละเอียดตามเอกสารแนบ</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1526857550562,1527376046432,1536712608041,3,'Quotation TS6406312.pdf','2021-07-07 10:10:14',NULL,4,'2021-06-14 06:33:23',NULL,NULL,'\\public\\memo\\FMIT6414062021\\'),(125,'FM-MKT-64-0017','2021-06-14',7,'1536712608041','1618888979382','ขออนุมัติต่อค่าเช่าพื้นที่ติดตั้งป้ายในเขตทางหลวง โครงการ IBY','<p>&nbsp; &nbsp; &nbsp; เนื่องจากฝ่ายการตลาดได้รับหนังสือแจ้งให้ชำระค่าเช่าพื้นที่ติดตั้งป้ายในเขตทางหลวง ลงวันที่ 9 มิถุนายน 2564&nbsp;จากแขวงทางหลวงนนทบุรี ซึ่งจะครบกำหนดระยะเวลา 1 ปี ในวันที่ 12 กรกฎาคม 2564 โดยให้ชำระค่าเช่าป้ายโครงการ “ ไอริส เวสท์เกต ” จำนวน 3&nbsp;ป้ายๆ ละ 10,000 บาท/ปี รวมเป็นเงินทั้งสิ้น 30,000 บาท (3 ป้าย)</p>\n\n<p>&nbsp; &nbsp; &nbsp; <strong>ดังนั้นฝ่ายการตลาดจึงขออนุมัติค่าใช้จ่ายดังกล่าว เป็นจำนวนเงินทั้งสิ้น 30,000 บาท (สามหมื่นบาทถ้วน) โดยชำระผ่านเครื่องรูดบัตร EDC หรือชำระผ่านธนาคารกรุงไทย <em>ภายในวันที่ 2 กรกฎาคม 2564</em></strong></p>\n\n<p>&nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อทราบและขออนุมติค่าใช้จ่ายดังกล่าว<br>\n<br>\n<br>\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Chief Operation Officer (operation)</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1525042815017,1612152002474,1536712608041,6,'20210614143505_00001.jpg',NULL,NULL,7,'2021-06-14 08:02:42',NULL,NULL,'\\public\\memo\\FMMKT6414062021\\'),(126,'FM-AFS-64-0009','2021-06-15',1620101079938,'1536712608041','1618888979382,1619411569757','ขออนุมัติซ่อมแซมห้องชุดโครงการ ไอริส เวสท์เกต 4302 ','<p>เนื่องจากได้รับแจ้งซ่อม โครงการไอริส เวสท์เกต บางใหญ่ &nbsp;ห้องชุด 4301 ทางวิศวกรได้เข้าตรวจDF ก่อนลูกค้าจะเข้าตรวจรับห้องในวันที่ 20 มิถุนายน 2564 พบปัญหามีน้ำรั่วซึมมาจากมีคราบน้ำมาที่ผนังห้องนอน และซึมเข้าพื้นภายในห้องนอน วิศวกรจึงได้ตรวจสอบพบว่าปัญหาเกิดจากฝั่งห้องลูกบ้าน 4302 วันที่ 14 มิถุนายน 2564 ได้ประสานงานแจ้งกับทางนิติให้แจ้งกับลูกบ้านดำเนินการแก้ไข &nbsp;แต่ทางลูกบ้านแจ้งว่าไม่มีเงินในการซ่อม และไม่เร่งที่จะเข้าแก้ไขให้ ทางวิศวกร จึงขอความอนุเคราะห์ ให้ทางบรัษัทไอริส กรุ๊ป จำกัด ออกค่าใช้จ่ายในการดำเนินการซ่อมแซมให้</p>\n\n<p><br>\nจึงได้จัดทำเอกสารเพื่อขออนุมัติและจะได้ดำเนินการซ่อมให้แก่ลูกบ้านต่อไป</p>\n',1620101079938,1618888979382,1536712608041,0,'1623744449002.jpg,S__6479939.jpg,S__6479941.jpg,S__6479944.jpg,S__6479946.jpg,S__6479947.jpg',NULL,NULL,13,'2021-06-15 08:35:02',NULL,NULL,'\\public\\memo\\FMAFS6415062021\\'),(127,'FM-SALE-64-0005','2021-06-16',1620980894197,'1536712608041','2,3,11','ขออนุมัติเพิ่มผลตอบแทนพิเศษให้พนักงานขาย','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จากการประชุมฝ่ายขาย เมื่อวันที่ 19 ตุลาคม 2563เรื่อง Sale Commission ที่ประชุมมีมติ</p>\n\n<p>เห็นชอบจ่ายผลตอบแทนพนักงานขาย (คอมมิชชั่น)เพื่อเป็นแรงจูงใจในการขาย และเพิ่มยอดขายใน</p>\n\n<p>สถานการณ์ปัจจุบัน ให้มากยิ่งขึ้น โดยกำหนดตั้งแต่ 19/10/63 ที่ผ่านมา ให้มีผลถึงวันที่ 31/12/2564</p>\n\n<p>1.พนักงานขายจะได้รับค่าคอมมิชชั่นทั้ง 8 โครงการ ดังนี้&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; a .โครงการ IDEN-KP</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน 1-2 &nbsp;Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp; 3 Unit &nbsp;&nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp;4+Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; b.โครงการ IDEN101</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน &nbsp;&nbsp;&nbsp;1 Unit ค่าตอบแทนร้อยละ &nbsp;0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp;&nbsp;&nbsp; 2 Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ยอดโอน&nbsp; &nbsp;3+Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; c.โครงการ I-COPENH</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 1-2 Unit &nbsp;ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 3-4 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 5-6 Unit &nbsp;ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; &nbsp;7+Unit &nbsp;ค่าตอบแทนร้อยละ 0.30 + Incentive 10,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; d.โครงการ IRIS-PARK</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน&nbsp; &nbsp; 1 Unit ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน 2-3 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ยอดโอน &nbsp;&nbsp;&nbsp;4 Unit ค่าตอบแทนร้อยละ 0.30</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n',1620980894197,0,0,7,'',NULL,NULL,11,'2021-06-16 04:21:17',NULL,NULL,''),(128,'FM-SALE-64-0006','2021-06-16',1620980894197,'1536712608041','2,3,11','อัตราค่าตอบแทน ทีมSALE AGENCY','<p>&nbsp; เนื่องด้วยปัจจุบันมีการเพิ่มช่องทางการขายด้วยการเปิดรับตัวแทนขาย(Agent) ของทุกโครงการ มีทั้งตัวแทนขายในรูปแบบบริษัทและตัวแทนอิสระ ซึ่งมีทีมSale Agency คอยSupport ข้อมูลเพื่อให้การดำเนินงานของตัวแทนขายเป็นไปอย่างราบรื่น จึงมีการสร้างแรงจูงใจ จากที่มียอดขายและโอน (จากAgent) ให้กับทีม Sale Agency ด้วยการกำหนดอัตราค่าต