d>\n			<td style=\"text-align:right\">&nbsp;</td>\n			<td style=\"text-align:right\">14,953.27</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">ภาษีมูลค่าเพิ่ม</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">&nbsp;</td>\n			<td style=\"text-align:right\">1,046.73</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">ราคารวมภาษี</td>\n			<td style=\"text-align:center\">&nbsp;</td>\n			<td style=\"text-align:right\">&nbsp;</td>\n			<td style=\"text-align:right\">16,000.00</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n',1526339054692,1527376046432,1617075740614,3,'','2021-07-07 10:10:23',NULL,4,'2021-06-16 08:03:23',NULL,NULL,''),(130,'FM-PUR-PUR-IDEN101-64-0001','2021-06-16',5,'1536712608041','1617075740614,10,2,3','ขออนุมัติ งานโครงสร้างพื้นเพื่อรองรับงานรางประตูทางเข้าโครงการ IDEN101','<p>ตามที่ได้มีการสรุปงานประตูทางเข้าไปแล้วแต่ด้วยหน้างานยังไม่ได้ทำโครงสร้างพื้นเพื่อรองรับงานประตู จึงได้ดำเนินการจัดหา ผรม.เพื่อทำงานโครงสร้าง ตามที่ได้ติดต่อไปแล้ว มี ผรม.ส่งราคากลับมา 2 รายตามเอกสารแนบ&nbsp;</p>\n\n<p>1. บ. ไอดีเอ เสนอราคาสุทธิ 39,111.44 บาท&nbsp;</p>\n\n<p>2. ช่างวี เสนอราคาสุทธิ&nbsp;38,000.-บาท ต่อรองได้ 35,000.- บาท&nbsp;</p>\n\n<p>จึงได้จัดทำเอกสาร เพื่อขออนุมัติให้ ช่างวีเป็น ผู้ดำเนินการตามขั้นตอนไป</p>\n',1527894542301,1617075740614,1536712608041,0,'IDEN101_เสนอราคาเสาเข็มประตูทางเข้า_ช่างวี.pdf,IDEN101_เสนอราคาเสาเข็มประตูทางเข้า_IDA.pdf',NULL,NULL,5,'2021-06-16 08:38:07',NULL,NULL,'\\public\\memo\\FMPURPURIDEN1016416062021\\'),(131,'FM-PUR-IDEN101-64-0001','2021-06-16',5,'1536712608041','1617075740614,10,2,3,5','ขออนุมัติ งานโครงสร้างพื้นเพื่อรองรับงานรางประตูทางเข้าโครงการ IDEN101','<p>ตามที่ได้มีการสรุปงานประตูทางเข้าไปแล้วแต่ด้วยหน้างานยังไม่ได้ทำโครงสร้างพื้นเพื่อรองรับงานประตู จึงได้ดำเนินการจัดหา ผรม.เพื่อทำงานโครงสร้าง ตามที่ได้ติดต่อไปแล้ว มี ผรม.ส่งราคากลับมา 2 รายตามเอกสารแนบ&nbsp;</p>\n\n<p>1. บ. ไอดีเอ เสนอราคาสุทธิ 39,111.44 บาท&nbsp;</p>\n\n<p>2. ช่างวี เสนอราคาสุทธิ&nbsp;38,000.-บาท ต่อรองได้ 35,000.- บาท&nbsp;</p>\n\n<p>จึงได้จัดทำเอกสาร เพื่อขออนุมัติให้ ช่างวีเป็น ผู้ดำเนินการตามขั้นตอนไป</p>\n',1527894542301,1617075740614,1536712608041,1,'IDEN101_เสนอราคาเสาเข็มประตูทางเข้า_ช่างวี.pdf,IDEN101_เสนอราคาเสาเข็มประตูทางเข้า_IDA.pdf,IDEN101_รูปตำแหน่งที่ทำโครงสร้างพื้น.jpg',NULL,NULL,5,'2021-06-16 08:47:13',NULL,NULL,'\\public\\memo\\FMPURIDEN1016416062021\\'),(132,'FM-CON-64-0030','2021-06-16',1566381381121,'1527894542301','1619411569757','ขอทำถนนภายในโครงการเพิ่มเติม','<p><strong>I COPENH (Sukhumvit 76) PROJECT</strong></p>\n\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;เนื่องด้วยฝ่ายก่อสร้าง ได้ตรวจสอบการทำงานสาธารณูปโภค เพื่อให้เกิดความเรียบร้อย สะอาดและใช้งานได้จริง เพื่อที่จะได้ดำเนินงานปักเสาพาดสายไฟฟ้าของการไฟฟ้านครหลวง และเดินท่อประปาของการประปานครหลวง และเพื่อสะดวกในการเข้าชมโครงการของลูกค้า โดยมีรายละเอียดงานดังต่อไปนี้</p>\n\n<p>1.ถนนซอย 2 หน้าแปลง LB และ LC รวมถึงท่อระบายน้ำ</p>\n\n<p>2.ถนนซอย 3&nbsp;หน้าแปลง LD&nbsp;และ LE&nbsp;รวมถึงท่อระบายน้ำ&nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p>3.ถนนซอย 5&nbsp;หน้าแปลง LF&nbsp;และ SB&nbsp;รวมถึงท่อระบายน้ำ&nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>4.ถนนซอย 7&nbsp;หน้าแปลง SC&nbsp;และ SD&nbsp;รวมถึงท่อระบายน้ำ&nbsp;</p>\n\n<p>5.ถนนซอย 9&nbsp;หน้าแปลง SE&nbsp;และ SF&nbsp;รวมถึงท่อระบายน้ำ&nbsp;</p>\n\n<p>6.ถนนซอย 11&nbsp;หน้าแปลง SG&nbsp;และ SH&nbsp;รวมถึงท่อระบายน้ำ</p>\n\n<p>7.ถนนเมนหลักจากแปลง LB ถึง SH&nbsp;รวมถึงท่อระบายน้ำ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;โดยได้ประสานงานกับบริษัท เอื้อขนส่ง จำกัดไวเบื้องต้นแล้ว พร้อมทั้งบริษัท เอื้อขนส่ง จำกัด ได้เตรียมวัสดุและเครื่องจักรในการทำงานเข้าพื้นที่หน้างานเรียบร้อย แล้ว</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อโปรดทราบและเพื่ออนุมัติ</p>\n',1566381381121,1619411569757,1536712608041,3,'16_6_64 งานเอื้อ.pdf','2021-06-16 10:00:44',NULL,10,'2021-06-16 09:12:06',NULL,NULL,'\\public\\memo\\FMCON6416062021\\'),(133,'FM-AFS-64-0010','2021-06-17',1620101079938,'1536712608041','1618888979382,10,2,3,5','ขออนุมัติงบประมาณการเปลี่ยนกุญแจ 49/219 โครงการไอริส พาร์คIPC ','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;เนื่องจาก กุญแจบ้านและภายในห้องของบ้านสต็อกทั้งหมด 20 หลัง ที่ได้ตรวจสอบแล้ว ของโครงการไอริส พาร์ค&nbsp; IPC ที่มีกุญแจจำนวน 4 หลัง และสูญหาย ไม่สามารถสืบหาได้ จำนวน 16 หลัง ซึ่งได้เรียกช่างทำกุญแจเข้ามาตรวจสอบแล้วไม่สามารถเปลี่ยนปั้มกุญแจ Copy ได้ จึงได้เสนอราคาที่เปลี่นไส้กุญแจพร้อมค่าแรงต่อหลังละ&nbsp; 3,000 บาท จำนวน 16 หลัง ซึ่งรวมเป็นมูลค่าทั้งหมด 48,000 บาท&nbsp;&nbsp; (บ้าน 1 หลัง มีกุญแจจำนวน 6 จุด)</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1ประตูหน้าบ้าน&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2 ประตูหลังบ้าน&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3&nbsp;ประตูห้องนอน1&nbsp; &nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4ประตูห้องนอน 2&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5กุญแจประตูกระจก&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 6กุญแจตู้จดหมาย</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; จึงขออนุมัติเบิกงบประมาณในการเปลี่ยนกุญแจบ้านต่อดังกล่าว</p>\n\n<p><strong>หมายเหตุ:</strong>เนื่องจากมีบ้านเร่งด่วนที่ต้องการใช้กุญแจในการเตรียมส่งมอบกุญแจบ้าน</p>\n\n<p>วันศุกร์ที่18มิถุนายน2564 ของลูกค้าบ้านเลขที่ 49/219&nbsp; นายอัครัช จิตตะศิริ &nbsp;ได้โอนกรรมสิทธิ์</p>\n\n<p>เมื่อวันที่ 7 มิถุนายน 2564</p>\n',1620101079938,1618888979382,1536712608041,1,'รายงายเบิกกุญแจ 219 IPC MEMO.pdf',NULL,NULL,13,'2021-06-17 04:27:14',NULL,NULL,'\\public\\memo\\FMAFS6417062021\\'),(134,'FM-PUR-IDENKP-64-0001','2021-06-17',5,'1536712608041','1617075740614,1619411569757,2,3,5','ขออนุมัติจัดจ้าง งานล้างแอร์ บ้านแฝด แปลง 5-6 โครงการ IKP','<p>&nbsp; &nbsp; &nbsp;เนื่องจากฝ่ายจัดซื้อได้รับเอกสารอนุมัติขอล้างแอร์ (MEMO FM-ARCH-64-0025) จากทางหน้างานโครงการ IKP มานั้น และได้ทำการเปรียบเทียบราคา ดังนี้</p>\n\n<p><img alt=\"\" src=\"http://hr.iris.co.th:3000\\public\\memo\\FMPURIDENKP6417062021\\ล้างแอร์ kp.jpg\" style=\"float:left; height:35%; width:100%\">&nbsp; &nbsp; &nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงขออนุมัติจัดจ้าง นายโสภณ ลี้เทียนสว่าง (ช่างเก่ง)&nbsp;เข้าดำเนินงานล้างแอร์ บ้านแฝด แปลง 5-6 จำนวน รวม 11 ตัว ในมูลค่าสุทธิ&nbsp;6,400 บาท และได้มีการต่อรองราคาเหลือ 6,100 บาท รายละเอียดตามเอกสารที่แนบ</p>\n',1566381272207,1617075740614,1536712608041,5,'ล้างแอร์ kp,IKP_ตารางเทียบราคา - ล้างแอร์ แปลง 5-6 15.06.64,IKP_FM-ARCH-64-00 ขออนุมัติล้างแอร์บ้านแฝด ป, ป.6 - IKP',NULL,NULL,5,'2021-06-17 08:09:05','2021-06-18 04:34:04',NULL,'\\public\\memo\\FMPURIDENKP6417062021\\'),(135,'FM-MKT-64-0018','2021-06-17',7,'1536712608041','1618888979382','ขออนุมัติ ค่าใช้จ่าย ค่าจ้างนางแบบ ประกอบการถ่ายทำ Review โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;เนื่องจากฝ่ายการตลาด มีการดำเนินงานถ่ายทำ Home Buyer Review โครงการ ICOPENH&nbsp;ในวันที่ 21 มิถุนายน 2564 เพื่อทัศนียภาพโครงการที่สวยงาม ทางฝ่ายการตลาดจึงจะขออนุมัติ จ้างนางแบบ Pretty MC จำนวน 1 คน เพื่อถ่ายประกอบบรรยากาศสระว่ายน้ำ (Tie-in)&nbsp;ขณะถ่ายรายการ ซึ่งมีค่าใช้จ่าย 3,000 บาท&nbsp;(หัก ณ ที่จ่าย 3%) ยอดสุทธิ 2,910 บาท</p>\n\n<p>&nbsp; &nbsp; จึงเรียนมาเพื่อทราบและขออนุมัติค่าใช้จ่ายดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Chief Operation Officer (operation)</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1525042815017,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-06-17 09:44:45',NULL,NULL,''),(136,'FM-CON-64-0031','2021-06-18',1615426891970,'1536712608041','1619411569757,1531524013391,2,13','ขออนุมัติเบิกเงินประกันผลงานให้แก่ผู้รับเหมา บจก.พี.เค.พี','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;เนื่องจากผู้รับเหมา บจก พี.เค.พี ทำเรื่องขออนุมัติเบิกเงินประกันผลงาน จำนวน 5 แปลง คือ แปลง 22, 20, 215, 216, 227 ทางฝ่ายก่อสร้างจึงได้ประสานงานและตรวจสอบข้อมูลกับทางเจ้าของบ้านทั้งห้าหลังพบว่าไม่มีการซ่อมแซมเพิ่มเติมใดใด เนื่องจากก่อนหน้านี้ทางผู้รับเหมาได้มาทำการแก้ไขและเข้าลงพื้นที่ตรวจสอบเป็นที่เรียบร้อยแล้ว พร้อมทั้งให้เจ้าของบ้านเซนต์รับรองเอกสารตรวจรับงานและมีการแจ้งกับทางเจ้าของบ้านว่าจะไม่มีการซ่อมแซมหลังจากนี้จากทางบริษัทอีก</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ทางฝ่ายก่อสร้างได้พิจารณาและทำการต่อรองราคาแล้วเห็นควรอนุมัติให้เบิกประกันผลงาน จำนวน 70,000.00 บาท (เจ็ดหมื่นบาทถ้วน) โดยรายละเอียดตามเอกสารไฟล์แนบ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n',1615426891970,1619411569757,1536712608041,0,'รายการเบิกหัก PKP IPC ครั้งที่ 2.pdf,สรุปงานช่างเชิด2.pdf',NULL,NULL,10,'2021-06-18 04:03:28',NULL,NULL,'\\public\\memo\\FMCON6418062021\\'),(137,'FM-PUR-HO-64-0001','2021-06-18',5,'1536712608041','1617075740614,5,2,3','ขออนุมัติสั่งซื้อคอมพิวเตอร์โน้ตบุ้ค สำหรับคุณชัชชนก เตชะวณิช','<p>&nbsp; &nbsp; &nbsp;เนื่องจากทางฝ่ายจัดซื้อได้รับ MEMO อนุมัติขอสั่งซื้อคอมพิวเตอร์โน้ตบุ้ค 2 in 1 พร้อมแป้นคีย์บอร์ดและปากกา สำหรับคุณชัชชนก เตชะวณิช (อ้างอิง MEMO FM-IT-64-0031) มานั้น จึงได้ทำการเปรียบเทียบราคา รายละเอียดดังนี้</p>\n\n<p>&nbsp; &nbsp; &nbsp;1. บจก.เทคสไตล์&nbsp; &nbsp; &nbsp; &nbsp;เสนอราคาสุทธิ 25,000 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;2. บจก.เอพีเอส กรุ๊ป&nbsp; &nbsp;เสนอราคาสุทธิ 30,270.30 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;3. บจก.เน็ต คิวบ์ (ประเทศไทย)&nbsp; เสนอราคาสุทธิ 32,421 บาท</p>\n\n<p>&nbsp; &nbsp; &nbsp;จึงขออนุมัติสั่งซื้อคอมพิวเตอร์โน้ตบุ้ค 2 in 1 ผ่าน บจก.เทคสไตล์ ราคาสุทธิ 25,000 บาท เพื่อดำเนินการตามขั้นตอนต่อไป</p>\n\n<p>หมายเหตุ : ราคาดังกล่าวเป็นราคาที่รวมแป้นคีย์บอร์ด, ปากกา และรวมภาษีมูลค่าเพิ่ม 7% แล้ว</p>\n\n<p>&nbsp;</p>\n',1566381272207,1617075740614,1536712608041,5,'IT_HO-ตารางเทียบราคา-Notebook คุณเอิร์ธ.pdf,MEMO FM-IT-64-0031.pdf',NULL,NULL,5,'2021-06-18 04:59:11',NULL,NULL,'\\public\\memo\\FMPURHO6418062021\\'),(138,'FM-CON-64-0032','2021-06-18',1615426891970,'1536712608041','1619411569757,2','ขออนุมัติเบิกเงินประกันผลงานให้แก่ผู้รับเหมา บจก.พี.เค.พี','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เนื่องจากผู้รับเหมา บจก พี.เค.พี ทำเรื่องขออนุมัติเบิกเงินประกันผลงาน จำนวน 5 แปลง คือ แปลง 22, 20, 215, 216, 227 ทางฝ่ายก่อสร้างจึงได้ประสานงานและตรวจสอบข้อมูลกับทางเจ้าของบ้านทั้งห้าหลังพบว่าไม่มีการซ่อมแซมเพิ่มเติมใดใด เนื่องจากก่อนหน้านี้ทางผู้รับเหมาได้มาทำการแก้ไขและเข้าลงพื้นที่ตรวจสอบเป็นที่เรียบร้อยแล้ว พร้อมทั้งให้เจ้าของบ้านเซนต์รับรองเอกสารตรวจรับงานและมีการแจ้งกับทางเจ้าของบ้านว่าจะไม่มีการซ่อมแซมหลังจากนี้จากทางบริษัทอีก</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ทางฝ่ายก่อสร้างได้พิจารณาและทำการต่อรองราคาแล้วเห็นควรอนุมัติให้เบิกประกันผลงาน จำนวน 170,000.00 บาท (หนึ่งแสนเจ็ดหมื่นบาทถ้วน) โดยรายละเอียดตามเอกสารไฟล์แนบ</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n',1615426891970,1619411569757,1536712608041,1,'สรุปงานช่างเชิด2.pdf,รายการเบิกหัก PKP IPC ครั้งที่ 2.pdf',NULL,NULL,10,'2021-06-18 05:26:07',NULL,NULL,'\\public\\memo\\FMCON6418062021\\'),(139,'FM-PUR-IDEN101-64-0002','2021-06-18',5,'1536712608041','1617075740614,10,2,3,5','ขออนุมัติงานว่าจ้างดูแลสระรายเดือน (สัญญา1ปี)โครงการ IDEN 101','<p>ตามที่โครงการ ได้มีการสร้างสระว่ายน้ำแล้วเสร็จ แต่ยังไม่มีคนดูแลระบบและความสะอาดของสระว่ายน้ำ ทำให้เกิดปัญหา น้้ำดำ มีตะใคร้ สกปรก ทางจัดซื้อจึงได้ดำเนินการจัดหา และเปรียบเทียบราคา (ตามเอกสารแนบ) โดยสรุปดังนี้</p>\n\n<p>งานดูแลสระว่ายน้ำโครงการ IDEN 101&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse; width:538px\">\n	<tbody>\n		<tr>\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:274px\">\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ผู้เสนอราคา</span></span></span></span></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:113px\">\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ราคาดูแลต่อเดือนสุทธิ</span></span></span></span></p>\n			</td>\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:151px\">\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">รวมราคาดูแลสัญญา</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ปี สุทธิ</span></span></span></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; height:19px; vertical-align:top; width:274px\">\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. </span></span></strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ในนามบุคคล ติดต่อคุณศราวุฒิ </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">080-4365742</span></span></span></span></p>\n			</td>\n			<td style=\"background-color:#d9d9d9; border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; height:19px; vertical-align:top; width:113px\">\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">