์ติดข้อความว่า \"โปรดระวัง ชน\"&nbsp; จำนวน 14 แผ่น&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span></span></span><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</span></span></span></span></p>\n',1566381381121,1619411569757,1536712608041,1,'',NULL,NULL,10,'2021-06-22 04:22:28',NULL,NULL,''),(142,'FM-MKT-64-0019','2021-06-23',7,'1536712608041','8,5,3,2','ขออนุมัติจ่ายค่าเช่าที่ดินโครงการ IDEN101','<p><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">&nbsp; &nbsp; &nbsp;ฝ่ายการตลาดขออนุมัติจ่ายค่าเช่าที่ดิน โครงการ IDEN101 สัญญา 12 เดือน ดังนี้</span></span></span></p>\n\n<p><strong><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">1. ต่อสัญญาเช่าที่ดิน คุณวาทินี วนวิภาส</span></span></span></strong></p>\n\n<p><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">ค่าเช่าที่ดินล่วงหน้า ตั้งแต่ 1 กรกฎาคม 2564 - 30 มิถุนายน 2565&nbsp;โดยขอให้ชำระเป็นเช็คลงวันที่ล่วงหน้า&nbsp;</span></span></span><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">จำนวน 10 ฉบับ ฉบับละ 8,000 บาท(หลังหักภาษี) ลงวันที่ 5 ของทุกเดือน ในวันที่ 23 กรกฎาคม 2564</span></span></span></p>\n\n<p><strong><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">2. ต่อสัญญาเช่าที่ดิน คุณภัทราวรรณ เทียนไทย</span></span></span></strong></p>\n\n<p><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">ค่าเช่าที่ดินล่วงหน้า ตั้งแต่ ตั้งแต่ 1 กรกฎาคม 2564 - 30 มิถุนายน 2565 โดยขอให้ชำระเป็นเช็คลงวันที่ล่วงหน้า&nbsp;</span></span></span><span style=\"font-size:14px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;TH Sarabun New&quot;,sans-serif\">จำนวน 10 ฉบับ ฉบับละ 8,000 บาท(หลังหักภาษี) ลงวันที่ 5 ของทุกเดือน&nbsp;ในวันที่ 23 กรกฎาคม 2564</span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Chief Operation Officer (operation)</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',1525042815017,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-06-23 03:28:40',NULL,NULL,''),(143,'FM-MKT-64-0020','2021-06-24',7,'1536712608041','5,3,2,1618888979382','ขออนุมัติงบประมาณโปรโมชั่นสำหรับลูกค้าโครงการไอโคเปนที่มาจากรายการ Home Buyers Guide ','<p>ตามที่ฝ่ายการตลาดได้มีการถ่ายทำรายการ Home Buyers Guide ที่โครงการไอโคเปนไปเมื่อวันที่ 21 มิถุนายน 2564 โดยจะออนไลน์ใน Youtube วันที่ 28 มิถุนายน 2564</p>\n\n<p>ทั้งนี้ ได้มีการเพิ่มโปรโมชั่นเพื่อกระตุ้นยอดจองให้กับลูกค้าที่แจ้งว่ามาจากรายการ Home Buyers Guide และทำการจองบ้าน โดยโปรโมชั่นมีดังนี้&nbsp;</p>\n\n<p>1. ปูพื้นแสตมป์คอนกรีตบริเวณที่จอดรถ (เหมือนบ้านตัวอย่าง) มูลค่า 400 บาท/ตรม. ให้ฟรี&nbsp;</p>\n\n<p>2. เพิ่มสิทธิ์ในการหมุนวงล้อแคมเปญ Lucky Draw Lucky Deal อีก 1 สิทธิ์ รวมเป็น 2 สิทธิ์</p>\n\n<p>หมายเหตุ: โปรโมชั่นนี้จะสามารถใช้ได้จนถึงวันที่ 12 สิงหาคม 2564 เท่านั้น</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ชัชชนก เตชะวณิช)</p>\n\n<p>Chief Operation Officer (operation)</p>\n\n<p>&nbsp;</p>\n',1616118836457,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-06-24 06:59:39',NULL,NULL,''),(144,'FM-MKT-64-0021','2021-06-25',7,'1536712608041','1618888979382,3,5,2,6','ขออนุมัติงบประมาณในการจัดซื้อจัดจ้างบริษัท Idea Library ในถ่ายทำ Video Orientation ของบริษัท','<p>เนื่องด้วยฝ่ายทรัพยากรบุคคลและฝ่ายการตลาด มีการวางแผนงานในการทำ&nbsp;Video Orientation เพื่อเป็นการนำเสนอข้อมูลต่างๆ ที่เกี่ยวข้องกับบริษัท ได้แก่ วิสัยทัศน์ พันธกิจ ข้อมูลโครงการที่ผ่านมาและโครงการปัจจุบัน โครงสร้างองค์กร บริษัทในเครือ และข้อมูลอื่นๆ ที่จำเป็น เพื่อใช้ในการประชาสัมพันธ์ด้าน Branding ให้กับลูกค้าและพนักงานต่อไป&nbsp;</p>\n\n<p>ทั้งนี้ได้พิจารณาจากความเหมาะสมและความสามารถ เห็นชอบเลือก&nbsp;บริษัท ไอเดีย ไลบรารี่ จำกัด เป็นผู้ดำเนินการ</p>\n\n<p>งบประมาณที่ขออนุมัติตามจริง 150,870&nbsp;บาท (หนึ่งแสนห้าหมื่นแปดร้อยเจ็ดสิบบาท)&nbsp;จากงบประมาณ 200,000 บาท ตามที่เคยขออนุมัติไว้ก่อนหน้านี้</p>\n\n<p>จึงเรียนมาเพื่อโปรดพิจารณาอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>Chief Operation Officer (operation)</p>\n',1616118836457,1612152002474,1536712608041,1,'',NULL,NULL,7,'2021-06-25 07:05:12',NULL,NULL,''),(145,'FM-MKT-64-0022','2021-06-28',7,'1536712608041','8,3,2','ขออนุมัติ ยกเลิกเช่าป้ายทางหลวง โครงการ IRIS Westgate','<p>&nbsp; &nbsp; &nbsp; เนื่องจากฝ่ายการตลาดได้รับหนังสือแจ้งให้ชำระค่าเช่าพื้นที่ติดตั้งป้ายในเขตทางหลวง ลงวันที่ 9 มิถุนายน 2564&nbsp;จากแขวงทางหลวงนนทบุรี ซึ่งจะครบกำหนดระยะเวลา 1 ปี ในวันที่ 12 กรกฎาคม 2564 <strong>ซึ่งทางฝ่ายการตลาดมีความเห็น ขอยกเลิกป้าย ดังกล่าวทั้งหมด</strong> เนื่องจากมีแผนปิดโครงการ IRIS Westgate ภายในปี 2564 และไม่เห็นถึงความจำเป็นที่จะต่อสัญญา</p>\n\n<p>&nbsp; &nbsp; &nbsp; จึงเรียนมาเพื่อทราบและขออนุมัติการยกเลิกดังกล่าว</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ ..............................................</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ชัชชนก เตชะวณิช)</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &