่ายเงินให้กับซัพพลายเออร์ ทั้ง 3 บริษัท 1.บจก.แมนสุขภัณฑ์  2.บจก.บุญถาวร อินเตอร์เนชั่นแนล   3.บจก.เซ็นจูรี่ ฮาร์ดแวร์','<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;จากการประชุมกับทางผู้บริหาร ได้มีนโยบายให้มมีการเบิกจ่ายเงินที่ทางบริษัท ที-แมน คอร์ปอเรชั่น จำกัด ได้ค้างชำระกับทางซัพพลายเออร์ เพื่อไม่ให้มีผลกับกระทบกับชื่อเสียงและการดำเนินธุรกิจของบริษัทฯ ทางฝ่ายงาน&nbsp;&nbsp;&nbsp;โครงการไอเดน เกษตร-พหลโยธิน จึงใคร่ขออนุมัติเบิกจ่ายชำระเงินให้กับซัพพลายเออร์ 3 บริษัท &nbsp;ดังนี้ </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">1.บจก.แมนสุขภัณฑ์&nbsp; ค้างชำระ 453</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">,</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">354.22 บาท&nbsp; </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">2.บจก.บุญถาวร อินเตอร์เนชั่นแนล </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">ค้างชำระ</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"> 167</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">,655.92 บาท</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp; &nbsp;3.</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">บจก.เซ็นจูรี่ ฮาร์ดแวร์&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">ค้างชำระ 115</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cor