pan></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">1.น้ำยาปรับสภาพน้ำ 1 ถัง 20 ลิตร ราคา 1,200 บาท&nbsp;</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">2.ครอลีน 3 กิโลกรัม ราคา 240 บาท</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">3.ค่าแรงและค่าบริการ 2 วัน 1,560 บาท&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; โดยมีค่าใช้จ่ายทั้งหมด 3,000.00</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp;บาท </span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</span></span></span></span></p>\n',1566381381121,1619411569757,1536712608041,3,'','2021-07-03 05:02:14',NULL,10,'2021-07-03 04:55:54',NULL,NULL,''),(152,'FM-SALE-64-0009','2021-07-05',1625109752903,'1536712608041','1618888979382,2,3,11','ขออนุมัติเพิ่มผลตอบแทนพิเศษให้พนักงานขาย','<p>จากการประชุมฝ่ายขาย เมื่อวันที่ 19 ตุลาคม 2563 เรื่อง Sale Commission ที่ประชุมมีมติ</p>\n\n<p>เห็นชอบจ่ายผลตอบแทนพนักงานขาย (คอมมิชชั่น) เพื่อเป็นแรงจูงใจในการขาย และเพิ่มยอดขายใน</p>\n\n<p>สถานการณ์ปัจจุบัน ให้มากยิ่งขึ้น โดยกำหนดตั้งแต่ 19/10/63 ที่ผ่านมา ให้มีผลถึงวันที่ 31/12/2564</p>\n\n<ol>\n	<li>พนักงานขายจะได้รับค่าคอมมิชชั่นทั้ง 8 โครงการ ดังนี้</li>\n</ol>\n\n<ol>\n	<li>โครงการ IDEN-KP</li>\n</ol>\n\n<p>ยอดโอน 1-2 &nbsp;Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.15</p>\n\n<p>ยอดโอน&nbsp;&nbsp;&nbsp; &nbsp;3 Unit &nbsp;&nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>ยอดโอน &nbsp;&nbsp;&nbsp;&nbsp;4+ Unit &nbsp;ค่าตอบแทนร้อยละ &nbsp;&nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<ol start=\"2\">\n	<li>โครงการ IDEN101</li>\n</ol>\n\n<p>ยอดโอน &nbsp;&nbsp;&nbsp;1 Unit ค่าตอบแทนร้อยละ &nbsp;0.15</p>\n\n<p>ยอดโอน&nbsp;&nbsp;&nbsp; 2 Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35</p>\n\n<p>ยอดโอน &nbsp;&nbsp;&nbsp;3+Unit ค่าตอบแทนร้อยละ &nbsp;&nbsp;0.35 + Incentive 10,000 บาท</p>\n\n<ol start=\"3\">\n	<li>โครงการ I-COPENH</li>\n</ol>\n\n<p>ยอดโอน 1-2 Unit &nbsp;ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>ยอดโอน 3-4 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>ยอดโอน 5-6 Unit &nbsp;ค่าตอบแทนร้อยละ 0.30</p>\n\n<p>ยอดโอน 7+Unit &nbsp;ค่าตอบแทนร้อยละ 0.30 + Incentive 10,000 บาท</p>\n\n<ol start=\"4\">\n	<li>โครงการ IRIS-PARK</li>\n</ol>\n\n<p>ยอดโอน &nbsp;&nbsp;&nbsp;&nbsp;1 Unit ค่าตอบแทนร้อยละ 0.15</p>\n\n<p>ยอดโอน 2-3 Unit &nbsp;ค่าตอบแทนร้อยละ 0.25</p>\n\n<p>ยอดโอน &nbsp;&nbsp;&nbsp;&nbsp;4 Unit ค่าตอบแทนร้อยละ 0.30</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n',1625109752903,1618888979382,1536712608041,0,'',NULL,NULL,11,'2021-07-05 03:05:04',NULL,NULL,''),(153,'FM-SALE-64-0010','2021-07-05',1625109752903,'1536712608041','1618888979382,2,3,11','ขออนุมัติเพิ่มผลตอบแทนพิเศษฝ่ายขาย','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp; &nbsp;</span></span></span></span></p>\n\n<p>&nbsp;&nbsp;จากการประชุมฝ่ายขาย เมื่อวันที่ 1 เมษายน 2563 เรื่อง Sales Commission ที่ประชุมมีมติ</p>\n\n<p>เห็นชอบจ่ายผลตอบแทนฝ่ายขาย นอกเหนือจาก Commission แล้ว พนักขายจะได้รับ PSS (Profit Selling Sharing) &nbsp;คือส่วนแบ่งการขายของผลกำไร ในกรณีที่ฝ่ายขายนำเสนอขายกับลูกค้าโดย ไม่ได้เสนอโปรโมชั่นทั้งหมดตาม Margin ที่บริษัทกำหนดไว้ และราคาที่เสนอขายไม่ต่ำกว่าราคาขายสุทธิของฝ่ายขาย ฝ่ายขายจะได้รับส่วนต่างที่เหลือของโปรโมชั่นที่เสนอขายลูกค้าไป โดยแบ่งระยะเวลาดังนี้</p>\n\n<p>1.ระยะเวลา 1 ก.ค. 2564 – 31 ก.ย. 2564 ฝ่ายขายจะได้รับ 100%</p>\n\n<p>2.ระยะเวลา 1 ต.ค. 2564 – 31 ธ.ค. 2564 ฝ่ายขายจะได้รับ&nbsp;&nbsp;&nbsp;80%</p>\n\n<p>ชึ่งจะได้รับ หลังจากโอนกรรมสิทธิ์เรียบร้อยแล้ว และเบิกจ่ายได้ในเดือนถัดไปพร้อม Commission</p>\n\n<p>**หากเป็นผลงานการขายของฝ่ายขาย(คนเก่าลาออก)ได้ขายไว้ และฝ่ายขาย(คนใหม่)ดูแลต่อ จะได้รับดังนี้</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ระยะเวลา 1 ก.ค. 2564 – 31 ธ.ค. 2564 ฝ่ายขาย (คนใหม่) จะได้รับ 50% จากผลตอบแทนคนเก่า</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อพิจารณาอนุมัติ</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n',1625109752903,1618888979382,1536712608041,3,'','2021-07-20 07:53:22',NULL,11,'2021-07-05 03:15:10',NULL,NULL,''),(154,'FM-SALE-64-0011','2021-07-05',1625109752903,'1536712608041','1618888979382','ขออนุมัติเพิ่มผลตอบแทนพิเศษให้พนักงานขาย','<p><span style=\"font-family:Calibri, sans-serif\"><span style=\"font-size:14.6667px\">&nbsp; &nbsp; &nbsp;</span></span><span style=\"font-family:&quot;Angsana New&quot;,serif; font-size:12pt\">จากการประชุมฝ่ายขาย เมื่อวันที่ </span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">19 </span></span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ตุลาคม </span></span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2563 </span></span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">เรื่อง </span></span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sale Commission </span></span><span style=\"font-family:Calibri,sans-serif; font-size:12pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ที่ประชุมมีมติ</span></span></p>\n\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">เห็นชอบจ่ายผลตอบแทนพนักงานขาย (คอมมิชชั่น) เพื่อเป็นแรงจูงใจในการขาย และเพิ่มยอดขายใน</span></span></span