nbsp;&nbsp;</span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;AngsanaUPC&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; เนื่องด้วย</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">ฝ่ายก่อสร้าง ได้ตรวจสอบสภาพหน้างานภายในโครงการ พบว่าต้องดำเนินการทำรั้วรอบโครงการ โดยมีรายละเอียดเบื้องต้นดังนี้</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">1.เพื่อดำเนินการก่อสร้างได้ง่าย (เพราะตอนนี้แปลง ที่ขึ้นโครงสร้างไปแล้วเครื่องจักรไม่สามารถเข้าไปทำงานได้)</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">2.เพื่อจะได้ติดตั้งสแลนเพื่อป้องกัน ฝุ่นละออง และเศษวัสดุ เข้าไปพื้นที่ข้างเคียง ( ชั่วคราวเสียหายหมดแล้วเนื่องจากไม่สามารถติดตั้งแน่นหนาได้ ลมแรง และไม่สามารถเจาะยึดกำแพงข้างเคียงได้)</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">3.เพื่อเวลาลูกค้าซื้อบ้านติดรั้วรอบโครงการจะได้ไม่มีปัญหาเรื่องการทำงาน&nbsp;</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">4.เพื่อป้องกันทรัพย์สิ้นสูญหายภายในโครงการ</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">5.เพื่อเพิ่มความมั่นใจในความปลอดภัย และ เป็นระเบียบ ในการประกอบการตัดสินใจซื้อของลูกค้า</span></span></span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; จึงเรียนมาเพื่อโปรดทราบและเพื่ออนุมัติ</span></span></span></span></p>\n',1566381381121,1619411569757,1536712608041,1,'',NULL,NULL,10,'2021-07-16 07:03:05',NULL,NULL,''),(164,'FM-MKT-64-0024','2021-07-20',7,'1536712608041','2,3,5','ขออนุมัติติดตั้งอุปกรณ์ Smart Home บ้านตัวอย่างแปลง 8 โครงการ ICOPENH','<p>&nbsp; &nbsp; &nbsp;ด้วยฝ่ายการตลาดเล็งเห็นถึงเทคโนโลยีที่จะนำเข้ามาเสริม Promotion และสร้างจุดขายให้กับโครงการ Icopenh &nbsp;ทางฝ่ายการตลาดจึงขออนุมัติงบจำนวน 16,050&nbsp;บาท รวม Vat แล้ว (หนึ่งหมื่นหกพันห้าสิบบาท) เพื่อติดตั้งอุปกรณ์บ้านตัวอย่างแปลงที่ 8 เพื่อให้สำหรับสาธิต &nbsp;สร้างจุดขาย เพื่อดึงดูดลูกค้า โดยมีรายกายอุปกรณ์ติดตั้ง ดังนี้&nbsp;<br>\n1. Smart Station ศูนย์กลางการทำงาน life ทำให้อุปกรณ์ไร้สายทั้งหมดเชื่อมต่อและทำงานร่วมกันได้<br>\n2. Smart Switch ใช้ควบคุมการเปิดปิดไฟผ่าน Application<br>\n3. Cube Motion Sensor เซนเซอร์ตรวจจับการเคลื่อนไหวในบ้าน&nbsp;<br>\n4. Cube D/W Sensor เซนเซอร์ตรวจจับการเปิด - ปิด ประตู<br>\n5. SPOT อุปกรณ์ควบคุม Remote แอร์ ทีวี และอื่นๆ ที่ใช้ Remote ในการควบคุม<br>\n6. Indoor Camera กล้อง IP Camera&nbsp;<br>\n&nbsp; &nbsp; &nbsp;เมื่อติดตั้งแล้วเสร็จจะมีเจ้าหน้าที่มาอบรมวิธีการใช้งานจำนวน 2 ครั้ง เพื่อให้ฝ่ายขาย / หรือฝ่ายที่เกี่ยวข้องสามารถนำเสนอให้กับลูกค้าต่อไปได้</p>\n\n<p><br>\n&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &