	<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:300px\">\n			<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">1 ฟรี Video สื่อโฆษณาอุปกรณ์ IOT ที่ติดตั้งในบ้าน (ให้กับลูกบ้าน)</span></span></p>\n\n			<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">2.Discount on top -- (Internet 500/500 Mb) อีกหลังละ 500บาท จาก 24,500 เป็น 24,000บาท</span></span></p>\n\n			<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">3.โครงข่าย Network True ภายในโครงการ ICOPENH sukhumvit76</span></span></p>\n\n			<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">4.ในอนาคต หากมีผู้เข้าอยู่อาศัยเกิน 80% สามารถแจ้งให้นำตู้ Vending Machine ของ 7-11 หรือตู้ LOTUS เข้ามาวางให้บริการในโครงการได้</span></span></p>\n\n			<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">5.ทำสื่อประชาสัมพันธ์ เปิดโครงการในลักษณะ Partnership ระหว่าง IRIS Group &amp; TRUE</span></span></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">หมายเหตุ :&nbsp; รายการของแถมมาตราฐานดังกล่าวจะมีผลบังคับใช้หลังจากที่ฝ่ายการตลาดได้จัดทำ / ปรับปรุง Promotion </span></span></p>\n\n<p><span style=\"font-size:11px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">&nbsp; &nbsp; &nbsp;จึงเรียนมาเพื่อโปรดพิจารณาและอนุมัติ</span></span></p>\n\n<p><span style=\"font-size:11px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ลงชื่อ ..........................................