INSERT INTO `notice_data` VALUES (1,'ระเบียบการใช้รถยนต์ส่วนกลางบริษัท','เพื่อให้การดำเนินการขอใช้รถยนต์ส่วนกลางบริษัท','2021-06-08 09:36:14','\\public\\announce\\2021-06-08\\1622454179638.jpg'),(3,'เรื่อง Workflow ในการทำงานของแต่ละฝ่าย','เรื่อง Workflow ในการทำงานของแต่ละฝ่าย หากพนักงานท่านใดมีข้อขัดข้อง หรือปัญหาในกระบวนการปฏิบัติงานประการใด ขอความร่วมมือช่วยแชร์ประสบการณ์ ปัญหาที่เกิดขึ้นหรือมีข้อเสนอแนะใดๆ เพิ่มเติม เพื่อนำไปเป็นข้อมูลให้แก่ฝ่ายบริหาร ในปรับปรุงแก้ไข ระบบ และ กระบวนการในการทำงาน ในองค์กรให้มีประสิทธิภาพที่ดียิ่งขึ้น  กรอกเพื่อเสนอแนะการทำงาน URL https://forms.gle/xc4nZSXV5D9J8FD36','2021-06-08 09:40:33','\\public\\announce\\2021-06-08\\Screen Shot 2564-06-08 at 09.38.10.pdf'),(4,'ประกาศลดอัตราเงินสมทบประกันสังคม เหลือ 2.5% ตั้งแต่ มิ.ย. - ส.ค. 2564','ลดอัตราเงินสมทบประกันสังคม เหลือ 2.5% ตั้งแต่ มิ.ย. - ส.ค. 2564','2021-06-08 15:00:50','\\public\\announce\\2021-06-08\\20210608144830.pdf'),(6,'ประกาศผังองค์กรใหม่','ประกาศผังองค์กรใหม่ของบริษัท','2021-06-16 13:24:24','\\public\\announce\\2021-06-10\\Organization chart of Iris group_14.06.64[ประกอบการอบรม Sale].jpg'),(7,'นัดฉีดวัคซีนโควิด19 สำหรับผู้ประกันตนมาตรา 33 ของบริษัท ไอริส กรุ๊ป จำกัด','นัดฉีดวัคซีนโควิด19 สำหรับผู้ประกันตนมาตรา 33 ของบริษัท ไอริส กรุ๊ป จำกัด','2021-06-21 13:46:46','\\public\\announce\\2021-06-18\\20210621134106.pdf'),(8,'ประกาศยกเลิก Work from home','ประกาศยกเลิก Work from home','2021-06-28 13:25:40','\\public\\announce\\2021-06-18\\20210628131403 ประกาศยกเลิก Work from home.pdf'),(9,'กำหนดวาระการประชุมประจำไตรมาส 2/2564','กำหนดวาระการประชุมประจำไตรมาส 2/2564','2021-06-28 13:26:54','\\public\\announce\\2021-06-18\\20210628131338 ประชุมไตรมาส Q2.pdf'),(10,'ระเบียบและข้อบังคับเกี่ยวกับการทำงานของพนักงาน บริษัท ไอริส กรุ๊ป จำกัด','ระเบียบและข้อบังคับเกี่ยวกับการทำงานของพนักงาน','2021-07-08 14:22:13','\\public\\announce\\2021-07-07\\20210617150959 ระเบียบและข้อบังคับเกี่ยวกับการทำงานของพนักงาน.pdf'),(11,'ประกาศแต่งตั้งรักษาการกรรมการผู้อำนวยการฝ่ายปฏิบัติการ (สายงานบริหาร)','ประกาศแต่งตั้งรักษาการกรรมการผู้อำนวยการฝ่ายปฏิบัติการ (สายงานบริหาร)','2021-07-22 15:28:06','\\public\\announce\\2021-07-15\\20210722140841.pdf');
